INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images2`, `albums`, `description`, `content`, `content2`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(1, 'Xuất khẩu lao động Nhật Bản hợp đồng 3 năm', 'xuat-khau-lao-dong-nhat-ban-hop-dong-3-nam', '', 16, 'vietnamese', '[\"16\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><strong>Sony trang bị khá nhiều kết nối thời thượng cho các sản phẩm tivi của mình nhằm đáp ứng tốt nhu cầu kết nối và chia sẻ dữ liệu với các thiết bị bên ngoài. Bên cạnh những kết nối cơ bản như:</strong> HDMI, USB, MHL, Screen Mirroring, vì là một thương hiệu mạnh về công nghệ hiển thị, nên Sony còn tích hợp thêm trên tivi của mình kết nối Photoshare</p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">\"Xuân Trường của chúng tôi giành cú đúp danh hiệu gồm Cầu thủ được yêu thích nhất và giải thưởng cao quý Quả bóng bạc Việt Nam 2017. Chúng tôi tự hào vì tân binh Lương Xuân Trường\", trang chủ của CLB Gangwon FC đăng tải thông tin gửi tới người hâm mộ CLB này ở Hàn Quốc.&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\"><emmg aria-hidden=\"1\" height=\"16\" src=\"https://www.facebook.com/images/emoji.php/v6/f7f/1/16/1f60a.png\" style=\"box-sizing: border-box; text-rendering: geometricPrecision;\" width=\"16\">\"Mong Xuân Trường sẽ giành thêm những danh hiệu cao quý khi chuyển sang chơi cho Gangwon FC ở mùa giải 2017. Chúc Trường luôn duy trì phong độ thi đấu tuyệt vời để cống hiến cho CLB và đội tuyển quốc gia Việt Nam\", CLB Hàn Quốc gửi lời chúc tới tân binh sinh năm 1995.&nbsp;</emmg></p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Gangwon FC tu hao vi so huu Qua bong bac Xuan Truong hinh anh 1\" height=\"1080\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/zatmrs/2017_01_06/15936545_1190791997703081_1360650819075104359_o.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" title=\"Gangwon FC tự hào vì sở hữu Quả bóng bạc Xuân Trường hình ảnh 1\" width=\"1080\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">CLB Gangwon FC tự hào khi sở hữu cầu thủ giành Quả bóng bạc Việt Nam 2016.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p data-ft=\"{\'tn\':\',K\'}\" id=\"u_et_0\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Theo kế hoạch phía Gangwon đưa ra, Xuân Trường sẽ bay sang Hàn Quốc vào 8/1. CLB vừa lên chơi ở K.League Classic sẽ đón anh tại thủ đô Seoul. Dự kiến, cầu thủ sinh năm 1995 sẽ trả lời phỏng vấn những hãng tin của xứ kim chi ngay tại sân bay.</p>\r\n\r\n<p data-ft=\"{\'tn\':\',K\'}\" id=\"u_et_0\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trước đó, hôm 4/1, trong sự kiện tổ chức tại Nhà hát Bến Thành (TP.HCM), Lương Xuân Trường đã vinh dự nhận danh hiệu Quả bóng bạc (QBB) Việt Nam 2016 với 229 điểm. Anh chỉ kém Quả bóng vàng Phạm Thành Lương (CLB Hà Nội) 17 điểm. Bên cạnh đó, tiền vệ này còn nhận giải thưởng Cầu thủ được yêu thích nhất do khán giả bình chọn.</p>\r\n\r\n<table align=\"center\" class=\"article\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<div class=\"inner-article\" data-video-src=\"\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 660px; height: 135px; overflow: hidden; clear: both; position: relative;\">&lt;a data-cke-saved-href=\"http://news.zing.vn/bao-han-quoc-khen-xuan-truong-sau-cu-dup-giai-thuong-post711288.html#inner-article\" href=\"http://news.zing.vn/bao-han-quoc-khen-xuan-truong-sau-cu-dup-giai-thuong-post711288.html#inner-article\" rel=\"nofollow\" \"=\"\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 15px 15px 220px; vertical-align: baseline; background: rgb(247, 247, 247); text-decoration: none; color: rgb(34, 34, 34); display: block; width: 660px; height: 135px; position: relative;\"&gt;\r\n			<p class=\"cover formatted\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: url(&quot;http://znews-photo.d.za.zdn.vn/w210/Uploaded/AfsSI/2017_01_05/DSC_4753.jpg&quot;) 0% 0% / cover transparent; text-size-adjust: 100%; float: left; overflow: hidden; cursor: pointer; width: 200px; position: absolute; top: 0px; left: 0px; bottom: 0px;\">&nbsp;</p>\r\n\r\n			<h2 class=\"title\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; font-family: Helvetica, Arial, sans-serif; font-weight: bold; -webkit-font-smoothing: antialiased;\">Báo Hàn Quốc khen Xuân Trường sau cú đúp giải thưởng</h2>\r\n\r\n			<p class=\"summary\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; overflow: hidden; line-height: 18px; color: rgb(51, 51, 51); max-height: 54px;\">Tờ Chosun của Hàn Quốc đã có một bài viết dài về Lương Xuân Trường khi anh nhận cú đúp giải thưởng tại Gala Quả bóng vàng (QBV) Việt Nam 2016 tối 4/1.</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Gangwon FC tu hao vi so huu Qua bong bac Xuan Truong hinh anh 2\" height=\"566\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/zatmrs/2017_01_06/LXT_1.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"660\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Xuân Trường giành số phiếu áp đảo trong cuộc bình chọn của độc giả Zing.vn.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Hôm 26/12/2016, CLB Gangwon FC đã công bố bản hợp đồng với Lương Xuân Trường. Tiền vệ này hào hứng gia nhập đội bóng mới đồng thời mong chứng tỏ trình độ ở K.League. Đến đội bóng mới, nhiều khả năng tiền vệ sinh năm 1995 sẽ được ra sân nhiều hơn (khoảng 30-40% số trận, theo cam kết từ CLB).&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">“Trường là ngôi sao bóng đá thực thụ, đã được chứng minh ở Đông Nam Á. Chúng tôi cố gắng có anh ấy ở mùa hè vừa qua nhưng không nhận được nhiều sự quan tâm bởi khi đó Gangwon vẫn thi đấu ở giải hạng hai K.League Challenge”, trang chủ Gangwon FC ghi.&nbsp;</p>', '', 'null', 'null', 0, 127, 1, 1, 1, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:25:06', '2017-07-26 14:53:42');
