 auto;\" width=\"531\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 119.594px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; color: rgb(51, 51, 51); line-height: 22px; -webkit-font-smoothing: antialiased;\">Trên bảng xếp hạng, khoảng cách giữa Chelsea và Liverpool thu hẹp xuống 5 điểm. Tottenham vọt 2 bậc lên vị trí thứ ba.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<div class=\"the-article-credit\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 0px -300px; padding: 10px 0px 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 600px; position: relative; clear: both; left: 550px; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">&nbsp;</div>', '', 'null', 'null', 0, 127, 1, 1, 1, 0, 0, 1, '', '', '', 1, 3, '2017-01-06 11:26:47', '2017-08-01 11:31:20');
