(3, 'Vũ Minh Tuấn: Chấn thương làm tôi lỡ việc trọng đại', 'vu-minh-tuan-chan-thuong-lam-toi-lo-viec-trong-dai', '', 41, 'vietnamese', '[\"41\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '\"\"', '<p>Theo số liệu của Opta Joe, tập thể Manchester United của Jose Mourinho đang trải qua chuỗi 13 trận bất bại liên tiếp, thành tích tốt nhất của đội bóng này tính từ khi Sir Alex chia tay sân Old Trafford.</p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Ngay sau đêm gala tại TPHCM, Minh Tuấn bay ra Hà Nội hội quân cùng Quảng Ninh. Chiều 7/1, đội bóng của anh có trận khai mạc V.League 2017 với chủ nhà Hà Nội.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Đây là mặt trận mà Vũ Minh Tuấn mong muốn bắt nhịp tốt ngay từ đầu, điều anh đã không làm được trong mùa giải 2016. Tuấn cho biết: “Năm ngoái tôi bị đau lưng dai dẳng, không làm được việc gì. Mất đến 5, 6 tháng mới hồi phục, khi ấy đã lỡ nhiều việc trọng đại rồi”.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Vu Minh Tuan: \'Chan thuong lam toi lo viec trong dai\' hinh anh 1\" height=\"2004\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/fsmsi/2017_01_06/AND_3697_zing.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"2566\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Vũ Minh Tuấn lập công trong trận đấu giành Siêu cúp quốc gia cho Quảng Ninh ngay trên sân Hà Nội. Ảnh:&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Quốc Bảo</em>.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Vẫn có vai trò lớn trong màu áo Quảng Ninh với chiếc băng đội trưởng dẫn dắt lối chơi, nhưng Vũ Minh Tuấn không đủ thời gian tìm chỗ đứng vững chắc trong ĐT Việt Nam. Anh chỉ được HLV Hữu Thắng dùng nhỏ giọt trong một số trận đấu, và đó chính là thứ làm anh nuối tiếc.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">“Nếu không có bàn thắng bán kết vào lưới Indonesia, tôi nghĩ mình khó có cơ hội lọt vào Top 3 Quả bóng vàng”, tiền vệ vừa trải qua nỗi đau mất cha hồi cuối năm 2016 thừa nhận. Anh cũng không quên chia sẻ rằng đó là một khoảnh khắc mà anh như được người cha đưa đường chỉ lối làm nên pha ghi bàn đẳng cấp, điểm nhấn thực sự trong một năm thi đấu không hoàn toàn ưng ý.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Tuấn tâm sự: “Quả bóng đồng đối với tôi đã là một ghi nhận rất ý nghĩa rồi. Nó sẽ là động lực để tôi phấn đấu hơn nữa trong sự nghiệp của mình.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Tôi không bàn đến chuyện bóng vàng hay bóng bạc, nhưng tôi nghĩ rằng nếu không bị chấn thương thì tôi có thể đóng góp được nhiều hơn nữa cho cả CLB lẫn tuyển quốc gia. Năm 2017 này, mong ước lớn nhất của tôi là được khoẻ mạnh, sung sức để thành công hơn trên tất cả các giải đấu. Khi đội bóng thành công thì giải thưởng cá nhân sẽ tự đến thôi”.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Mùa giải 2017 khởi đầu rất thuận lợi với Minh Tuấn khi Quảng Ninh vượt qua Hà Nội giành Siêu cúp quốc gia sau loạt sút luân lưu. Trong trận đấu hoà 3-3 ở 2 hiệp chính, anh cũng có một bàn thắng quan trọng giúp đội nhà gỡ 2-2 ở hiệp 2.</p>\r\n\r\n<div class=\"notebox ncenter\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 10px 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: rgb(217, 230, 240); text-size-adjust: 100%; color: rgb(0, 0, 0); line-height: 26px; float: left; width: 660px; font-family: &quot;Noto Serif&quot;, serif;\">\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Những giải thưởng trong đêm gala 2016</strong></p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Quả bóng vàng nam: Phạm Thành Lương (Hà Nội)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Quả bóng bạc nam: Lương Xuân Trường (Gangwon, Hàn Quốc)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Quả bóng đồng nam: Vũ Minh Tuấn (Quảng Ninh)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Quả bóng vàng nữ: Huỳnh Như (TP.HCM)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Giải cống hiến: Cựu danh thủ Trần Minh Chiến và cầu thủ Nguyễn Bảo Quân</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Cầu thủ được yêu thích nhất: Lương Xuân Trường (Gangwon, Hàn Quốc)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Quả bóng vàng futsal: Trần Văn Vũ (Thái Sơn Nam)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Cầu thủ trẻ nam xuất sắc: Vũ Văn Thanh (HAGL)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Cầu thủ ngoại xuất sắc: Gaston Merlo (Đà Nẵng)</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Cầu thủ trẻ nữ xuất sắc: Lê Hoài Lương (TP.HCM)</p>\r\n</div>', 'Lớp HKN - 22215 - Đại học kinh doanh Công Nghệ Hà Nội', '', '', 0, 127, 1, -1, 1, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:28:20', '2017-07-21 10:58:53'),
(4, 'Xuất khẩu lao động Nhật Bản hợp đồng 3 năm', 'xuat-khau-lao-dong-nhat-ban-hop-dong-3-nam', '', 16, 'vietnamese', '[\"16\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><strong>Sony trang bị khá nhiều kết nối thời thượng cho các sản phẩm tivi của mình nhằm đáp ứng tốt nhu cầu kết nối và chia sẻ dữ liệu với các thiết bị bên ngoài. Bên cạnh những kết nối cơ bản như:</strong> HDMI, USB, MHL, Screen Mirroring, vì là một thương hiệu mạnh về công nghệ hiển thị, nên Sony còn tích hợp thêm trên tivi của mình kết nối Photoshare</p>', '<ul class=\"events\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding-right: 0px; padding-left: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; list-style: none; width: 660px; clear: both; color: rgb(34, 34, 34); font-family: Helvetica, Arial, sans-serif;\">\r\n	<li class=\"comment featured picture\" id=\"105570\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 20px 0px 0px 40px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 660px; float: left; clear: both; position: relative; display: block;\">\r\n	<div class=\"event\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; top: 0px; position: relative; float: left; width: 620px;\">\r\n	<div class=\"event-content\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px 0px 20px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(238, 238, 238); border-left-color: initial; border-image: initial; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; float: right; line-height: 22px; -webkit-font-smoothing: antialiased; position: relative; top: 0px;\">\r\n	<h3 style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-size: 1.1em; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Sanchez bất mãn với Arsenal</h3>\r\n\r\n	<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Daily Mirror tiết lộ, Alexis Sanchez đang cân nhắc khả năng không gia hạn hợp đồng với Arsenal và ra đi ngay sau khi mùa giải 2016/17 kết thúc. Ngôi sao người Chile ngán ngẩm với tham vọng không rõ ràng của đội chủ sân Emirates và đỉnh điểm là thái độ không hài lòng khi đồng đội ăn mừng bàn thắng gỡ hòa 3-3 trước Bournemouth ở vòng 20 giải Ngoại hạng.&nbsp;</p>\r\n\r\n	<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Hiện giao kèo giữa ngôi sao người Chile và \"Pháo thủ\" còn thời hạn đến tháng 6/2018.&nbsp;</p>\r\n\r\n	<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; outline: 0px; vertical-align: baseline; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 620px; max-width: 100%; display: block; overflow: hidden; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased; border: 0px !important; background: none !important;\">\r\n		<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n			<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n				<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; display: block; width: 620px; position: relative; cursor: pointer;\"><img alt=\"Chuyen nhuong 5/1: Chelsea tien sat \'Yaya Toure moi\' hinh anh 1\" height=\"423\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/mdf_rexqdd/2017_01_05/sanc_1.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 595.188px; height: auto; max-width: 96%;\" width=\"634\" /></td>\r\n			</tr>\r\n			<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</div>\r\n	</div>\r\n	</li>\r\n	<li class=\"quotation featured picture\" id=\"105576\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 20px 0px 0px 40px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 660px; float: left; clear: both; position: relative; display: block;\">\r\n	<div class=\"event\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; top: 0px; position: relative; float: left; width: 620px;\">\r\n	<div class=\"event-content\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px 0px 20px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(238, 238, 238); border-left-color: initial; border-image: initial; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; float: right; line-height: 22px; -webkit-font-smoothing: antialiased; position: relative; top: 0px;\">\r\n	<h3 style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-size: 1.1em; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Mourinho không mua sắm trong phiên chợ đông</h3>\r\n\r\n	<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Trả lời phỏng vấn về kế hoạch mua sắm trong tháng 1, HLV Jose Mourinho cho biết: \"Tôi hài lòng với đội hình hiện tại và sẽ không chiêu mộ thêm cầu thủ trong kỳ chuyển nhượng mùa đông năm nay\".</p>\r\n\r\n	<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\"Quỷ đỏ\" đang chịu tổn thất nặng nề ở hàng thủ khi trung vệ Eric Bailly trở về khoác áo tuyển Bờ Biển Ngà tham dự CAN 2017.</p>\r\n\r\n	<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; outline: 0px; vertical-align: baseline; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 620px; max-width: 100%; display: block; overflow: hidden; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased; border: 0px !important; background: none !important;\">\r\n		<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n			<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n				<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; display: block; width: 620px; position: relative; cursor: pointer;\"><img alt=\"Chuyen nhuong 5/1: Chelsea tien sat \'Yaya Toure moi\' hinh anh 7\" height=\"375\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/mdf_rexqdd/2017_01_05/m.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 594px; height: auto; max-width: 96%;\" width=\"594\" /></td>\r\n			</tr>\r\n			<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</div>\r\n	</div>\r\n	</li>\r\n	<li class=\"quotation featured picture\" id=\"105579\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 20px 0px 0px 40px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 660px; float: left; clear: both; position: relative; display: block;\">\r\n	<div class=\"event\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; top: 0px; position: relative; float: left; width: 620px;\">\r\n	<div class=\"event-content\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px 0px 20px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(238, 238, 238); border-left-color: initial; border-image: initial; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; float: right; line-height: 22px; -webkit-font-smoothing: antialiased; position: relative; top: 0px;\">\r\n	<h3 style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-size: 1.1em; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Tottenham quyết giữ chân trụ cột</h3>\r\n\r\n	<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Chứng kiến &nbsp;cảnh Harry Kane và Dele Alli liên tục bị các CLB lớn ve vãn, HLV Mauricio Pochettino tuyên bố sẽ không bán bộ đôi người Anh với bất cứ giá nào: \"Chúng tôi sẽ không chấp nhận bất kỳ lời đề nghị nào dành cho Kane và Alli. Họ là cầu thủ của Spurs và sẽ mãi như vậy\".</p>\r\n\r\n	<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Trước đó, báo chí Anh đưa tin PSG đã hỏi mua tiền vệ Dele Alli với giá 50 triệu bảng. Trong khi đó, Harry Kane cũng đang là ưu tiên hàng đầu của Manchester United để thay thế vị trí của Ibrahimovic trong tương lai.</p>\r\n\r\n	<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; outline: 0px; vertical-align: baseline; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 620px; max-width: 100%; display: block; overflow: hidden; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased; border: 0px !important; background: none !important;\">\r\n		<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n			<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n				<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; display: block; width: 620px; position: relative; cursor: pointer;\"><img alt=\"Chuyen nhuong 5/1: Chelsea tien sat \'Yaya Toure moi\' hinh anh 9\" height=\"415\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/mdf_rexqdd/2017_01_05/kane.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 595.188px; height: auto; max-width: 96%;\" title=\"Chuyển nhượng 5/1: Chelsea tiến sát \'Yaya Toure mới\' hình ảnh 9\" width=\"738\" /></td>\r\n			</tr>\r\n			<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; max-width: 100%; display: block; overflow: hidden;\">\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</div>\r\n	</div>\r\n	</li>\r\n	<li class=\"comment featured picture\" id=\"105595\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 20px 0px 0px 40px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 660px; float: left; clear: both; position: relative; display: block;\">\r\n	<div class=\"event\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; top: 0px; position: relative; float: left; width: 620px;\">\r\n	<div class=\"event-content\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px 0px 20px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(238, 238, 238); border-left-color: initial; border-image: initial; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; width: 620px; float: right; line-height: 22px; -webkit-font-smoothing: antialiased; position: relative; top: 0px;\">\r\n	<h3 style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px 5px; padding: 0px; border: 0px; outline: 0px; font-size: 1.1em; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Schneiderlin tập một mình trước tin đồn rời MU</h3>\r\n\r\n	<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Morgan Schneiderlin&nbsp;khiến người hâm mộ MU không khỏi xót xa khi đăng lên trang cá nhân đoạn clip tập luyện một mình trong công viên. Không dính chấn thương nhưng ngôi sao người Pháp vẫn bị HLV Jose Mourinho ghẻ lạnh. Anh chỉ là sự lựa chọn số 6 cho vị trí tiền vệ của MU mùa này, sau cả Marouane Fellaini và lão tướng Schweinsteiger. Báo chí Anh tiết lộ, cựu sao Southampton sắp gia nhập Everton với giá 20 triệu bảng ngay trong kỳ chuyển nhượng mùa&nbsp;</p>\r\n	</div>\r\n	</div>\r\n	</li>\r\n</ul>', '', 'null', 'null', 0, 127, 1, 1, 1, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:29:20', '2017-07-26 14:53:20'),
(5, 'Nấm tỏa dương', 'nam-toa-duong', '', 16, 'vietnamese', '[\"16\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '\"\"', '<p><strong>Dâm dương hoắc</strong>: Dâm Dương Hoắc là tên 1 loại cây dại, từ lâu đã được dùng làm thuốc trong YHCT. Khoa học hiện đạiđã có nhiều nghiên cứu về công dụng của Dâm Dương Hoắc trong điều trị yếu sinh lý.</p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Cho đến nay, Patrice Evra vẫn day dứt về quyết định chia tay MU vào tháng 7/2014, chỉ 2 tháng sau khi ký hợp đồng mới có thời hạn đến mùa hè 2015.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">“Luôn luôn là một sai lầm khi rời khỏi MU và không hề dễ chịu khi làm việc đó”, Evra nói với Sky Sports cách đây 1 năm, “Rất khó để nói chính xác lý do tôi ra đi, nhất là khi đội bóng vẫn cần tôi lại và Van Gaal thậm chí còn muốn trao cho tôi băng đội trưởng. Nhưng một ngày kia, lúc đã nghỉ hưu, có thể tôi sẽ nói rõ ràng”.</p>\r\n\r\n<h3 style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Chiến binh thực thụ</h3>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trong một phỏng đoán, có thể Evra nghĩ rằng sự ra đi của mình mang lại lợi ích cho CLB. Thời điểm đó, những cựu binh như Rio Ferdinand, Nemanja Vidic, Darren Fletcher và không ít cầu thủ bị coi là người thừa như Danny Welbeck, Shinji Kagawa, Anderson đều lần lượt nói lời tạm biệt. MU cần một cuộc cách mạng và hậu vệ người Pháp nên bước ra để nhường chỗ cho những nhân tố mới.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Patrice Evra tro lai MU, nuoc co hoan hao cua Mourinho hinh anh 1\" height=\"997\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/lce_Qjruc/2017_01_05/Manchester_United_vs_Liverpool_epl_feb_2012_Patrice_Evra_celebrates.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"1600\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Khó có ai&nbsp;luôn ra sân với tình yêu MU rực cháy như Evra.&nbsp;&nbsp;\r\n			<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; display: inline;\">&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Tất cả đều biết, trong thâm tâm, Evra luôn mong muốn ở lại để rồi kết thúc sự nghiệp tại Old Trafford. “Từ buổi đầu đặt chân đến MU, tôi đã có cảm giác đây là định mệnh. Bởi chỉ khi khoác chiếc áo đỏ, tôi mới tìm thấy bản ngã và được sống với chính mình. Mãi mãi, tôi là một Quỷ đỏ”, anh tâm sự với MUTV.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Sẽ rất khó để tìm ra ai đó luôn ra sân với tình yêu MU rực cháy như Evra. Hậu vệ người Pháp không ham muốn trở thành nổi bật, sẵn sàng đáp ứng mọi yêu cầu của HLV, chỉ cần làm những gì tốt nhất cho CLB. Trên sân, hiếm khi nhìn thấy anh đi bộ. Thay vào đó, Evra chạy và có mặt ở khắp nơi, làm tất cả để đội bóng kết thúc trong chiến thắng.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Ở trận đấu quan trọng với Liverpool vào mùa xuân 2011, Evra đã bác bỏ yêu cầu ngồi ngoài vì chấn thương đầu gối. “Nó không nghiêm trọng và điều tôi muốn nói, tôi là một chiến binh. Tôi chỉ ngừng chạy khi nghỉ hưu”.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Patrice Evra tro lai MU, nuoc co hoan hao cua Mourinho hinh anh 2\" height=\"1080\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/lce_Qjruc/2017_01_05/patriceevramanchesterunitedHD.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"1920\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">\"Tôi là một chiến binh và chỉ ngừng chạy khi nghỉ hưu”, Evra nói.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Tinh thần của Evra là cái gì đó MU còn thiếu trong thời hậu Sir Alex, với những cầu thủ từ chối ra sân chỉ vì một vài cơn đau không rõ ràng (như Luke Shaw và Chris Smalling). Mourinho luôn cần mẫu chiến binh quên mình như vậy. Và ông sẽ không từ chối nếu có cơ hội được làm việc với Evra...</p>\r\n\r\n<h3 style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">... nhất là khi anh vẫn còn hữu dụng</h3>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Theo&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Whoscored</em>, năm 2016 tại Serie A, chỉ có một trong số những cầu thủ thực hiện hơn 100 đường chuyền ở 1/3 sân đối phương có độ chính xác cao hơn hậu vệ người Pháp (83,6%).</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Mùa trước, Evra vẫn đóng góp 2 bàn thắng, 3 kiến tạo và cung cấp 26 cơ hội, đồng thời có 54 cú tắc bóng, 34 lần đánh chặn cùng 55 lần phá bóng giải nguy. Tại Euro 2016, anh là một thành viên quan trọng trong quá trình đi đến ngôi á quân của tuyển Pháp.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Patrice Evra tro lai MU, nuoc co hoan hao cua Mourinho hinh anh 3\" height=\"391\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/lce_Qjruc/2017_01_05/201701050643015evramumourinho.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"600\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Mourinho sẽ sớm rơi vào tình yêu với Evra.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Ở tuổi 35, không ai nhận thấy sự khác biệt nào ở Evra so với khi anh vẫn quán xuyến hành lang trái MU, lên công về thủ nhịp nhàng và đem đến sự tin cậy đặc biệt. Vì vậy, anh chắc chắn là một lựa chọn tốt hơn Darmian hay Luke Shaw.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Thêm một chi tiết MU được hưởng lợi, đó là mối quan hệ thân thiết giữa Evra và Paul Pogba. Cầu thủ đắt giá nhất hành tinh gọi Evra là “bác Pat” và coi anh như người cha tinh thần. Hồi Euro 2016, Pogba gặp khó khăn trong việc thể hiện mình, chính những lời khuyên từ “bác Pat” đã giúp cầu thủ này hồi sinh. Tương tự, Pogba có thể trở lại là tiền vệ hay nhất thế giới như tại Juventus với sự giúp đỡ của Evra.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Tròn 11 năm trước, Evra đến MU trong mùa xuân để trở thành miếng ghép hoàn hảo, kiện toàn bộ máy chiến thắng. Anh có thể đóng vai trò đó một lần nữa.</p>\r\n\r\n<div class=\"notebox ncenter\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 10px 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: rgb(217, 230, 240); text-size-adjust: 100%; color: rgb(0, 0, 0); line-height: 26px; float: left; width: 660px; font-family: &quot;Noto Serif&quot;, serif;\">\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Patrice Evra tại MU</strong></p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Trận: 379</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Bàn thắng: 10</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Danh hiệu: 5 Premier League (2006/07, 2007/08, 2008/09, 2010/11, 2012/13), 1 Champions League &nbsp;(2007/08), 3 League Cup (2005/06, 2008/09, 2009/10), 1 FIFA Club World Cup (2008), 5 Community Shield (2007/08, 2008/09, 2010/11, 2011/12, 2013/14).</p>\r\n</div>', '', '', '', 0, 127, 1, 1, 1, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:30:37', '2017-07-22 08:35:56');
INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images2`, `albums`, `description`, `content`, `content2`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(6, 'Xuất khẩu lao động Nhật Bản hợp đồng 3 năm', 'xuat-khau-lao-dong-nhat-ban-hop-dong-3-nam', '', 16, 'vietnamese', '[\"16\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><strong>Sony trang bị khá nhiều kết nối thời thượng cho các sản phẩm tivi của mình nhằm đáp ứng tốt nhu cầu kết nối và chia sẻ dữ liệu với các thiết bị bên ngoài. Bên cạnh những kết nối cơ bản như:</strong> HDMI, USB, MHL, Screen Mirroring, vì là một thương hiệu mạnh về công nghệ hiển thị, nên Sony còn tích hợp thêm trên tivi của mình kết nối Photoshare</p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Theo số liệu của&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Opta Joe</em>, tập thể Manchester United của Jose Mourinho đang trải qua chuỗi 13 trận bất bại liên tiếp, thành tích tốt nhất của đội bóng này tính từ khi Sir Alex chia tay sân Old Trafford.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trong mùa giải 2012/13, thầy trò Sir Alex Ferguson lập thành tích 18 trận bất bại liên tiếp. Muốn chạm đến cột mốc này, tập thể cầu thủ dưới quyền Mourinho sẽ phải cố gắng hơn nữa.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trước mắt vào ngày 14/1 tới, The Red Devils sẽ đối đầu với ngọn núi cao mang tên Liverpool trong trận derby nước Anh.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"MU dang bat bai lau nhat trong thoi hau Sir Alex hinh anh 1\" height=\"621\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/mdf_Nexqxk/2017_01_03/GettyImages630802804_1.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"1024\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Ibrahimovic ghi bàn ấn định tỷ số 2-0.&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Ảnh: Getty.</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Thắng 2-0 trên sân West Ham đánh dấu lần thứ 7 liên tiếp MU ca khúc khải hoàn trên các đấu trường. Đây cũng là chuỗi thắng dài nhất của Mourinho kể từ năm 2014 khi còn làm thuyền trưởng Chelsea.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Giành 3 điểm trên sân khách, Quỷ đỏ Manchester vẫn đứng vị trí thứ sáu với 39 điểm. Đối thủ trực tiếp Tottenham sẽ thi đấu trận derby London với Chelsea vào lúc 3h sáng ngày 5/1 (giờ Việt Nam).</p>\r\n\r\n<div class=\"notebox ncenter\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 10px 15px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: rgb(217, 230, 240); text-size-adjust: 100%; color: rgb(0, 0, 0); line-height: 26px; float: left; width: 660px; font-family: &quot;Noto Serif&quot;, serif;\">\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 12px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Một số thống kê khác</strong></p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">18</strong>: Đó là số bàn thắng của Ibrahimovic ghi được trên mọi mặt trận mùa này, vượt trên thành tích của chân sút tốt nhất MU (Anthony Martial, 17 bàn) cả mùa trước.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">40</strong>: Mata đã tham gia vào 40 bàn thắng (25 kiến tạo, 15 pha lập công) từ khi ra mắt MU. Anh đứng thứ nhì trong đội hình Quỷ đỏ, sau Rooney.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 12px 0px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">8</strong>: Không đội nào bị đuổi nhiều người hơn West Ham ở Premier League 2016/17.</p>\r\n</div>', '', 'null', 'null', 0, 127, 1, 1, 1, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:34:39', '2017-07-26 14:52:57'),
(7, 'Sản xuất vật liệu xây dựng và cơ khí', 'san-xuat-vat-lieu-xay-dung-va-co-khi', '', 15, 'vietnamese', '[\"15\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '\"\"', '<p>Chào mừng quý khách hàng đến với website của Nhũ Tương Puma Kính thưa quý khách hàng Công ty cổ phần Nhũ Tương Puma Việt Nam với kinh nghiệm 10 năm trong lĩnh vực sản xuất vật liệu cho các công trình xây dựng.</p>', '<header class=\"the-article-header\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 660px; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">\r\n<h1 class=\"the-article-title cms-title\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 2rem; vertical-align: baseline; background: transparent; text-size-adjust: 100%; font-family: &quot;Noto Serif&quot;, serif; color: rgb(17, 17, 17); -webkit-font-smoothing: antialiased; letter-spacing: -1px !important;\">Điểm danh những \'bóng hồng\' xinh đẹp của Sơn Tùng M-TP</h1>\r\n\r\n<ul class=\"the-article-meta\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 5px 0px 0px; padding-right: 0px; padding-left: 3px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; list-style: none; float: left; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(153, 153, 153); line-height: 18px; -webkit-font-smoothing: antialiased;\">\r\n	<li class=\"the-article-publish cms-date\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 10px 10px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; display: block;\">09:53 06/01/2017</li>\r\n</ul>\r\n</header>\r\n\r\n<ul class=\"the-ar