ring: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Ronaldo lan thu 11 gop mat o doi hinh tieu bieu UEFA hinh anh 2\" height=\"702\" src=\"http://znews-photo.d.za.zdn.vn/w1024/Uploaded/mdf_rexqdd/2017_01_06/1_2.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px -5px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 920px; height: auto;\" width=\"1024\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 119.594px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; color: rgb(51, 51, 51); line-height: 22px; -webkit-font-smoothing: antialiased;\"><strong style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Thủ môn Gianluigi Buffon (Italy - Juventus):</strong>&nbsp;Lão tướng 38 tuổi chinh phục một lượng lớn người hâm mộ nhờ màn trình diễn ấn tượng giúp Juventus thành công ở đấu trường quốc nội và lọt vào tứ kết Euro 2016 cùng tuyển Italy.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-s