(10, 'Biểu tượng gợi cảm 2016 hút 10 triệu fan trên Instagram', 'bieu-tuong-goi-cam-2016-hut-10-trieu-fan-tren-instagram', '', 40, 'vietnamese', '[\"40\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '\"\"', '<p>Theo số liệu của Opta Joe, tập thể Manchester United của Jose Mourinho đang trải qua chuỗi 13 trận bất bại liên tiếp, thành tích tốt nhất của đội bóng này tính từ khi Sir Alex chia tay sân Old Trafford.</p>', '<p class=\"the-article-summary cms-desc\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 14px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; font-family: &quot;Noto Serif&quot;, serif; font-weight: bold; color: rgb(34, 34, 34); line-height: 30px; -webkit-font-smoothing: antialiased; clear: both; float: left; width: 660px;\">Mookda Narinrak nổi tiếng trên mạng nhờ có gương mặt thanh tú, làn da trắng mịn và vóc dáng chuẩn. Cô còn được mọi người ví như Lưu Diệc Phi phiên bản Thái Lan.</p>\r\n\r\n<div class=\"the-article-body cms-body\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 660px; position: relative; font-family: &quot;Noto Serif&quot;, serif; color: rgb(34, 34, 34); line-height: 30px; -webkit-font-smoothing: antialiased;\">\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 14px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; float: none; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Ve dep trong sang cua Miss Teen Thai Lan hinh anh 1\" height=\"381\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/ohunua2/2017_01_04/thailan8.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"587\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Mookda Narinrak (21 tuổi) hiện khá nổi tiếng trong giới trẻ Thái Lan. Cô sở hữu gương mặt thanh tú, đôi mắt to tròn, làn da trắng.&nbsp;\r\n			<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; display: inline;\">&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" c