izing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Mourinho om chat \'nguoi hung\' De Gea sau tran thang hinh anh 16\" height=\"769\" src=\"http://znews-photo.d.za.zdn.vn/w1024/Uploaded/mdf_rexqdd/2017_01_03/kq.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px -5px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 920px; height: auto;\" title=\"Mourinho ôm chặt \'người hùng\' De Gea sau trận thắng hình ảnh 16\" width=\"938\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 119.594px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; color: rgb(51, 51, 51); line-height: 22px; -webkit-font-smoothing: antialiased;\">Kết quả và lịch thi đấu vòng 20 Premier League.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 20px 0px 30px -60px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 920px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Mourinho om chat \'nguoi hung\' De Gea sau tran thang hinh anh 17\" height=\"927\" src=\"http://znews-photo.d.za.zdn.vn/w1024/Uploaded/mdf_rexqdd/2017_01_03/bx.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px -5px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 920px; height: auto;\" width=\"936\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 15px 119.594px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; color: rgb(51, 51, 51); line-height: 22px; -webkit-font-smoothing: antialiased;\">Bảng xếp hạng sau loạt trận tối và đêm thứ hai.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', 'null', 'null', 0, 127, 1, -1, 1, 0, 0, 1, '', '', '', 1, 1, '2017-01-06 11:43:24', '2017-07-26 14:52:08');
