(12, 'Dele Alli vượt mặt Scholes, Beckham, Gerrard và Lampard', 'dele-alli-vuot-mat-scholes-beckham-gerrard-va-lampard', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif; font-size: 18px; font-weight: bold;\">Với cú đúp vào lưới Chelsea, tiền vệ 20 tuổi đã vượt qua những huyền thoại người Anh như Beckham, Scholes, Gerrard và Lampard về khả năng săn bàn.</span></p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Ở vòng 20 Ngoại hạng Anh, Dele Alli sắm vai người hùng khi ghi cả 2 bàn giúp Tottenham chặn đứng chuỗi trận bất bại của Chelsea bằng chiến thắng 2-0 trên sân White Hart Lane.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Với cú đúp vào lưới Chelsea, Dele Alli trở thành tiền vệ người Anh cán mốc 20 bàn nhanh thứ 2 lịch sử Premier League với 52 trận ra sân.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Thành tích của Dele Alli chỉ kém tiền vệ huyền thoại Matt Le Tissier của Southampton với 20 bàn sau 50 trận ra sân, và đưa anh ngang bằng với thành tích của Peter Beardsley (tiền vệ từng thi đấu cho Newcastle United và Liverpool).</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Tuy nhiên, thành tích này đã giúp tiền vệ 20 tuổi vượt qua hàng loạt các huyền thoại người Anh ở Premier League như Paul Scholes, David Beckham, Steven Gerrard và Frank Lampard.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Dele Alli vuot mat Scholes, Beckham, Gerrard va Lampard hinh anh 1\" height=\"398\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/Vyxqxqeiox/2017_01_05/1_1.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" title=\"Dele Alli vượt mặt Scholes, Beckham, Gerrard và Lampard hình ảnh 1\" width=\"594\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Dele Alli vượt qua&nbsp;Beckham, Scholes, Gerrard và Lampard về khả năng săn bàn. Ảnh:&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Getty Images.</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Paul Scholes là tiền vệ người Anh ghi 20 bàn thắng nhanh thứ 3 lịch sử Premier League với 74 trận thi đấu cho Man Utd. Đồng đội của anh là David Beckham cần đến 90 trận để đạt đến thành tích này.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trong khi đó, hai huyền thoại khác là Steven Gerrard và Frank Lampard phải cần đến hơn 100 trận để có được bàn thắng thứ 20 của mình tại giải đấu hàng đầu nước Anh.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Dele Alli gia nhập Tottenham vào tháng 8/2015 từ Milton Keynes Dons với mức giá 5 triệu bảng. Tiền vệ sinh năm 1996 chỉ mất 2 tuần để có được bàn thắng đầu tiên cho Spurs. 18 tháng sau, cầu thủ người Anh đã có được bàn thắng thứ 20 cho CLB thành London sau 52 trận ra sân tại Premier League.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Tính riêng mùa giải này, Dele Alli đã có 11 bàn thắng cho Tottenham trên mọi mặt trận, trong đó có 10 bàn tại Premier League. Cầu thủ 20 tuổi đã ghi tới 7 bàn thắng chỉ trong 4 trận đấu gần nhất cho đội bóng thành London.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Phát biểu trên&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">AS</em>, HLV Mauricio Pochettino dành rất nhiều lời khen ngợi cho Dele Alli: \"Cậu ấy là mẫu cầu thủ có khả năng tạo đột biến lớn khi tấn công. Dele Alli chọn vị trí dứt điểm rất tốt và luôn có niềm tin vào bản thân. Cậu ấy là cầu thủ giỏi nhất của bóng đá Anh những năm gần đây\".</p>', '', 'null', 'null', 0, 127, 1, 0, 1, 0, 0, 1, 'Dele Alli vượt mặt Scholes, Beckham, Gerrard và Lampard', 'Dele Alli vượt mặt Scholes, Beckham, Gerrard và Lampard', 'Dele Alli vượt mặt Scholes, Beckham, Gerrard và Lampard', 1, 3, '2017-01-06 11:45:17', '2017-08-01 11:32:29'),
(13, 'Ngăn chặn 76 thanh niên kéo đến Móng Cái trả thù', 'ngan-chan-76-thanh-nien-keo-den-mong-cai-tra-thu', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '', '<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif; font-size: 18px; font-weight: bold;\">Kiểm tra một cơ sở lưu trú ở Móng Cái (Quảng Ninh), cảnh sát phát hiện 76 thanh niên quê Quảng Ninh và Hải Phòng tụ tập chuẩn bị đi đánh nhau.</span></p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Ngày 6/1, chỉ huy Công an TP Móng Cái, tỉnh Quảng Ninh cho biết đơn vị vừa ngăn chặn 76 thanh niên ở nhiều địa phương khác kéo đến địa bàn để trả thù cá nhân nhằm phô trương thanh thế.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Ngan chan 76 thanh nien keo den Mong Cai tra thu hinh anh 1\" height=\"618\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/jopltui/2017_01_06/0904d664.JPG\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"873\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Nhóm thanh niên kéo đến Móng Cái để trả thù được cảnh sát ngăn chặn. Ảnh:&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Báo Quảng Ninh.</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Theo nguồn tin này, khuya 4/1, Công an TP Móng Cái kiểm tra hành chính một cơ sở lưu trú trên địa bàn. Tại đây, cảnh sát phát hiện 76 thanh niên quê Quảng Ninh và Hải Phòng tụ tập chuẩn bị đi đánh nhau.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Bước đầu, cơ quan chức năng xác định nhóm thanh niên này được Hà Tuấn Nam (tức Nam “Diệp”, 29 tuổi, người địa phương) gọi ra Móng Cái trả thù Phạm Tuấn Anh (29 tuổi, quê Hải Phòng).</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trước đó, do mâu thuẫn cá nhân, Nam và Tuấn Anh đánh nhau trước cửa quán bar Kinh Đô ở TP Móng Cái.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Đội cảnh sát hình sự Công an TP Móng Cái đã buộc nhóm thanh niên trên trở về địa phương, phối hợp với công an sở tại quản lý, phòng ngừa và xác minh làm rõ vai trò người liên quan.</p>', '', '', '', 0, 127, 1, -1, 1, 0, 0, 1, 'Ngăn chặn 76 thanh niên kéo đến Móng Cái trả thù', 'Ngăn chặn 76 thanh niên kéo đến Móng Cái trả thù', 'Ngăn chặn 76 thanh niên kéo đến Móng Cái trả thù', 1, 1, '2017-01-06 11:47:19', '2017-05-18 11:47:09'),
(14, 'Giang hồ nổ súng ở tiệm game bắn cá bị bắt sau đêm tân hôn', 'giang-ho-no-sung-o-tiem-game-ban-ca-bi-bat-sau-dem-tan-hon', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '', '<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif; font-size: 18px; font-weight: bold;\">Thành vừa mở cửa phòng khách sạn thì các trinh sát ập vào bắt giữ, thu giữ dao bấm và xe máy dùng đi gây án.</span></p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Ngày 24/11, Công an quận 11 (TP.HCM) đang củng cố hồ sơ để khởi tố Dương Hiệp Thành (33 tuổi, ngụ quận 6) về hành vi Tàng trữ trái phép vũ khí quân dụng và Cố ý gây thương tích.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Theo điều tra, sau vụ nổ súng xảy ra đêm 18/11 tại tiệm game bắn cá trên đường Hòa Bình (phường 5, quận 11), cảnh sát đã xác định được Thành là kẻ gây án. Anh ta luôn có \"hàng nóng\" trong người. 5 tổ trinh sát được tung quân vây bắt hung thủ.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Giang ho no sung o tiem game ban ca bi bat sau dem tan hon hinh anh 1\" height=\"414\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/nokatb/2016_11_24/15231532_818593808281387_1930919071_o_1.jpg\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"629\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Dương Hiệp Thành. Ảnh:&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">C.A.</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Với thông tin Thành sẽ tổ chức lễ cưới tại một nhà hàng ở đường&nbsp;Nguyễn Văn Luông (phường 11, quận 6) hôm 21/11, ban chuyên án đã lên kế hoạch vây bắt để tránh có sự xáo trộn. Do đó, các trinh sát được phân công cần đeo bám chờ cơ hội.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Sau đêm tân hôn, khi Thành vừa mở cửa phòng khách sạn thì các trinh sát ập vào bắt giữ, thu giữ dao bấm và xe máy dùng đi gây án.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Thành khai, một tuần trước khi nổ súng ở tiệm game bắn cá, anh ta có va chạm xe và cãi cự với một thanh niên. Thấy Lâm trong tiệm game và cho rằng anh này là người đã va chạm với mình nên Thành rút súng dọa nhưng không ngờ súng cướp cò. Viên đạn xuyên qua tay trái nạn nhân, găm thẳng vào tường.</p>\r\n\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; font-family: Helvetica, Arial, sans-serif; color: rgb(85, 85, 85); line-height: 20px; -webkit-font-smoothing: antialiased;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pic\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative; cursor: pointer;\"><img alt=\"Giang ho no sung o tiem game ban ca bi bat sau dem tan hon hinh anh 2\" height=\"420\" src=\"http://znews-photo.d.za.zdn.vn/w660/Uploaded/nokatb/2016_11_24/minh_1.JPG\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; max-width: 100%; width: 660px; height: auto;\" width=\"660\" /></td>\r\n		</tr>\r\n		<tr style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">\r\n			<td class=\"pCaption caption\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 5px 0px 8px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; position: relative;\">Theo kết quả giám định, anh Lâm bị thương tích ít nhất 21%.&nbsp;Ảnh:&nbsp;<em style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%;\">Hải Hiếu.</em></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Về khẩu súng gây án, Thành nói đó là súng tự chế, do một người tên Sơn (ngụ quận 6, chưa rõ lai lịch) tặng. Trên đường bỏ trốn, Thành đã ném khẩu súng xuống kênh Tân Hóa.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Đề cập đến tiểu sử kẻ gây án, cảnh sát cho biết, Thành là cháu ruột một trùm ma túy ở Sài Gòn.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Từ nhỏ đến lớn, Thành tỏ ra ngang ngược, từng tham gia vào đường dây ma túy lớn. Năm 2000, anh ta giết, cướp người lái xe ôm rúng động ở Bình Dương.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Các hành vi gây ra, Thành từng phải lĩnh 18 năm tù với hàng loạt tội danh: Giết người, Cướp tài sản và Vận chuyển trái phép chất ma túy.</p>', '', '', '', 0, 127, 1, 1, 1, 0, 0, 1, 'Giang hồ nổ súng ở tiệm game bắn cá bị bắt sau đêm tân hôn', 'Giang hồ nổ súng ở tiệm game bắn cá bị bắt sau đêm tân hôn', 'Giang hồ nổ súng ở tiệm game bắn cá bị bắt sau đêm tân hôn', 1, 1, '2017-01-06 11:49:33', '2017-05-18 11:46:51'),
(15, 'Trắc nghiệm: Ai được phong tướng ở cả Việt Nam, Trung Quốc?', 'trac-nghiem-ai-duoc-phong-tuong-o-ca-viet-nam-trung-quoc', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '', '<p><span style=\"color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif; font-size: 18px; font-weight: bold;\">Trong lịch sử hàng nghìn năm dựng nước và giữ nước, nhân dân ta sản sinh ra những thủ lĩnh kiệt xuất, trong đó có người được gọi là \"lưỡng quốc tướng quân\".</span></p>', '<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Năm 2014, Bảo tàng Lịch sử Quốc gia Việt Nam công bố tài liệu nghiên cứu của cố NSƯT Minh Hiến. Theo đó, Việt Nam có 2 trong số 10 danh tướng vĩ đại nhất trong lịch sử thế giới. Đó là Trần Hưng Đạo và Võ Nguyên Giáp.</p>\r\n\r\n<p style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\">Trải qua hàng nghìn năm dựng, giữ nước, nhân dân ta đã sản sinh ra những vị tướng tài ba khiến kẻ thù khiếp sợ.</p>\r\n\r\n<p><iframe frameborder=\"0\" height=\"458\" scrolling=\"no\" src=\"http://renderer.qmerce.com/interaction/586e57bc4f601b0929224a21\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border-width: 0px; border-style: initial; outline: 0px; font-size: 18px; vertical-align: baseline; background: rgb(17, 17, 17); text-size-adjust: 100%; width: 660px; color: rgb(34, 34, 34); font-family: &quot;Noto Serif&quot;, serif;\" width=\"100%\"></iframe></p>', '', '', '', 0, 127, 1, 1, 1, 0, 0, 1, 'Trắc nghiệm: Ai được phong tướng ở cả Việt Nam, Trung Quốc?', 'Trắc nghiệm: Ai được phong tướng ở cả Việt Nam, Trung Quốc?', 'Trắc nghiệm: Ai được phong tướng ở cả Việt Nam, Trung Quốc?', 1, 1, '2017-01-06 11:54:54', '2017-05-18 11:46:36'),
