(17, 'Chelsea - Peterborough: Cú dậm nhảy của Chelsea', 'chelsea-peterborough-cu-dam-nhay-cua-chelsea', '', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '', '<h5 style=\"margin: 0px; padding: 0px; font-size: 9pt; font-weight: bold; color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva;\">Trận đấu với Peterborough ở FA Cup có thể xem là cú dậm nhảy của Chelsea để họ “bật cao” trở lại…</h5>', '<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\"><b style=\"margin: 0px; padding: 0px;\">Lực lượng:&nbsp;&nbsp; &nbsp;</b></font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\"><b style=\"margin: 0px; padding: 0px;\">Chelsea</b>: Eden Hazard, Diego Costa và David Luiz được nghỉ.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\"><b style=\"margin: 0px; padding: 0px;\">Peterborough</b>: Có lực lượng tốt nhất.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\"><b style=\"margin: 0px; padding: 0px;\">Đối đầu và phong độ:</b></font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">- Chelsea đã giành chiến thắng trong cả hai lần đụng độ Peterborough (thắng 5-1 năm 1965, thắng 5-0 năm 2001).</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">- Chelsea không bị loại ở vòng 3 FA Cup kể từ mùa 1997/98.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">- Peterborough không thắng CLB ở Premier League (hạng nhất Anh) kể từ năm 1965 (thắng Arsenal).</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: center;\"><img align=\"none\" alt=\"\" src=\"https://metrouk2.files.wordpress.com/2017/01/chelsea-pboro-getty-metro.jpg?quality=80&amp;strip=all&amp;w=1024&amp;strip=all\" style=\"margin: 0px; padding: 10px 5px 5px;\" width=\"500\" /></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Chelsea đã bật cao chưa từng thấy trong lịch sử Premier League với chuỗi 13 chiến thắng liên tiếp mùa này (bằng kỷ lục của Arsenal mùa 2001/02). Dù vậy, điều gì phải đến cũng đến, ở vòng 20 Premier League, họ đã phải gục ngã trước Tottenham với tỷ số 0-2.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Dù sao, thành tích Chelsea đã làm được vẫn quá ấn tượng. Như Conte chia sẻ sau trận đấu: “Tôi đã lường trước CLB sẽ thất bại. Dù sao, thành tích của Chelsea trong thời gian qua đã quá ấn tượng”.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Điều cần thiết với Chelsea lúc này là “quên” thất bại trước Tottenham để tiếp tục bước tiếp. Dù sao, khoảng cách 5 điểm với đội xếp thứ 2 Liverpool cũng có thể giúp The Blues “không hoảng loạn”.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Rất may cho Chelsea, khi vừa gục ngã ở Premier League, họ chỉ phải gặp “tí hon” Peterborough ở vòng 3 FA Cup. Đây có thể là cơ hội để họ lấy lại khí thế trước khi chinh chiến ở Premier League. Bên cạnh đó, HLV Conte cũng nhân dịp này để cho những trụ cột như Diego Costa, Hazard nghỉ ngơi sau khi “cày ải” liên tục thời quan qua. Hay nói cách khác, trận đấu này có thể xem là cú bật nhảy của Chelsea để họ “bật cao” trở lại.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Nhìn chung, đối thủ Peterborough cũng chẳng phải là thử thách quá lớn để Chelsea phải đau đầu (nhất là khi Chelsea được thi đấu ở Stamford Bridge). Hiện tại, Peterborough đang xếp thứ 9 ở League One (tương đương với hạng Nhì ở Anh).&nbsp;</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Bên cạnh đó, thống kê cũng chỉ ra rằng Peterborough chưa từng thắng đội bóng ở hạng cao nhất Anh kể từ năm 1965.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Do đó, ở trận đấu này, HLV Conte sẽ sử dụng Michy Batshuayi hay Kurt Zouma. Trước cuộc chiến, ông cũng cảnh báo những cầu thủ này cần tận dụng cơ hội hiếm hoi ra sân để có thể chứng minh tài năng. Hơn lúc nào hết, HLV Conte đang rất cần những nhân tố dự bị bừng sáng để có thêm lựa chọn ở lượt về.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\">Khả năng Chelsea sẽ thắng (thậm chí thắng đậm) ở trận đấu này. Những người Chelsea cần cú hích như vậy.</font></div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif, Verdana, Geneva; font-size: 12px; text-align: justify;\"><font face=\"arial\" size=\"2\" style=\"margin: 0px; padding: 0px;\"><b style=\"margin: 0px; padding: 0px;\">Dự đoán: Chelsea thắng 5-0.</b></font></div>', '', '', '', 0, 127, 1, 0, 0, 0, 0, 1, ' Chelsea - Peterborough: Cú dậm nhảy của Chelsea', ' Chelsea - Peterborough: Cú dậm nhảy của Chelsea', ' Chelsea - Peterborough: Cú dậm nhảy của Chelsea', 2, 1, '2017-01-08 18:09:17', '2017-05-18 11:46:21');
INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images2`, `albums`, `description`, `content`, `content2`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(28, 'Cách chăm sóc kính chắn gió ô tô tiết kiệm và hiệu quả', 'cach-cham-soc-kinh-chan-gio-o-to-tiet-kiem-va-hieu-qua', '', 43, 'vietnamese', '[\"43\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Theo số liệu của Opta Joe, tập thể Manchester United của Jose Mourinho đang trải qua chuỗi 13 trận bất bại liên tiếp, thành tích tốt nhất của đội bóng này tính từ khi Sir Alex chia tay sân Old Trafford.</p>', '<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Hướng dẫn cách lau chùi kính chắn gió:</span></span></p>\r\n\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 0px; padding-right: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px;\">\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Lau chùi kính từ bên trong xe bằng vải khô sợi nhỏ. Xịt nước lau rửa chuyên dụng lên bề mặt kính chắn gió.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Lật sang mặt sạch của tấm vải và lau gờ trên của kính chắn gió trước. Làm như vậy, bạn sẽ tránh được tình trạng bụi mắc ở khu vực này rơi xuống và làm bẩn kính chắn gió sau khi đã được lau chùi sạch sẽ. Sau đó, thay một mảnh vải mới.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Xịt gờ bên trong kính chắn gió lần nữa và lau sạch bụi. Diện tích bám bụi càng lớn thì xịt càng nhiều nước lau rửa. Lau lại bằng một mảnh vải khô sạch khác.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Lau một bên mặt ngoài của kính chắn gió bằng vải sạch. Xịt nước lau rửa lên khu vực đã lau và gột sạch bằng vòi nước. Lau khô bằng khăn và tiếp tục “xử lý” phần còn lại theo phương pháp tương tự.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Đổ một ít giấm trắng hoặc nước chanh lên mảnh vải sạch sợi siêu nhỏ rồi lau lại một lượt mặt trong và mặt ngoài kính chắn gió.&nbsp;</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Cách lau kính bị mờ vì hơi nước</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Nguyên nhân khiến kính chắn gió bị mờ là do độ ẩm trong không khí cao hoặc do chính nhiệt độ cơ thể và hơi thở của người ngồi trong xe. Nếu để xe ngoài trời, hiện tượng mờ kính do sương là không tránh khỏi ngay cả khi bạn chưa mở cửa xe.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Dùng điều hòa không khí</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Cách đơn giản nhất để chấm dứt tình trạng kính bị mờ hơi nước là dùng điều hòa không khí nếu xe của bạn được trang bị. Trong những ngày nóng nực, điều hòa không khí sẽ làm mát xe bằng cách loại bỏ hơi nước trong không gian nội thất, từ đó giảm nhiệt độ. Do vậy, khi bạn bật điều hòa, lượng hơi nước bám trên bề mặt kính chắn gió sẽ lập tức bốc hơi. Ngay cả độ ẩm trong hơi thở của bạn cũng bị phân tán vào không khí thay vì đọng trên kính chắn gió.</span></p>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: center;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\"><img alt=\"\" src=\"http://baoha.vn/upload/image/foggy.jpg\" style=\"box-sizing: border-box; outline: none; vertical-align: middle; max-width: 100%; height: auto; border: 0px;\" /></span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Điều hòa không khí là một thiết bị hữu hiệu để dọn sạch hơi sương bám trên kính chắn gió.</span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px;\">\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Bước vào trong xe, bạn nên bật điều hòa lên và truyền hơi lạnh qua ống thông khí để làm khô nước bám trên kính chắn gió. Nhiều tài xế thường bấm nút gạt sương mù trên bảng táp-lô rồi sau đó bất ngờ nhấn điều khiển để tắt điều hòa vì không chịu được luồng không khí lạnh tỏa ra đột ngột. Nếu làm như vậy, bạn đang tự “phản” lại chính bản thân mình.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Trong trường hợp không thích luồng không khí lạnh và khô thổi thẳng vào mặt, bạn nên hướng quạt thông gió ra phía cửa sổ bên hông hoặc tăng nhiệt độ lên. Tất nhiên, bạn cũng lưu ý rằng dùng điều hòa không khí để gạt sương sẽ “ngốn” lượng nhiên liệu nhiều hơn bình thường.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Ấn nút gạt sương trên bảng táp-lô</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Nút gạt sương trên những chiếc xe không trang bị điều hòa không khí có nhiệm vụ ủ ấm cho kính chắn gió bằng cách thổi luồng không khí nóng hoặc cho dòng điện chạy qua nhờ một sợi dây mỏng gắn trên kính. Thông thường, loại dây điện tương tự chỉ xuất hiện trên kính chắn gió sau xe.</span></p>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: center;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\"><img alt=\"\" src=\"http://baoha.vn/upload/image/demist.jpg\" style=\"box-sizing: border-box; outline: none; vertical-align: middle; max-width: 100%; height: auto; border: 0px;\" /></span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none;\">\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Nếu xe không được trang bị điều hòa không khí, bạn có thể dùng nút gạt sương để làm sạch kính chắn gió.</span></div>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Dù không đánh tan sương bám trên kính chắn gió nhanh bằng điều hòa nhưng nút gạt sương vẫn phát huy tác dụng tốt. Khi bạn ấn nút, hơi nóng hoặc luồng điện sẽ làm cho nước bám trên bề mặt kính bốc hơi. Nếu cần đi gấp và không chờ thể chờ nút gạt sương hoàn thành nhiệm vụ, bạn có thể mở cửa sổ, hít một hơi thật sâu và thổi thẳng vào kính chắn gió qua một tờ giấy cuộn tròn để dọn hơi nước.</span></p>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Ngoài ra, bạn nên áp dụng chiêu thức “phòng hơn chống”. Chỉ cần mua những tấm phim mềm về và phủ lên kính chắn gió, bạn sẽ thoát được nỗi bực dọc mỗi sáng vì sương mờ.</span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">&nbsp;</span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\">Cách “chữa cháy” cho kính chắn gió bị xước</span></span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: center;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><img alt=\"\" src=\"http://baoha.vn/upload/image/scratch.jpg\" style=\"box-sizing: border-box; outline: none; vertical-align: middle; max-width: 100%; height: auto; border: 0px;\" /></span></span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Những vết xước trên kính chắn gió có thể bị loại bọ bằng một số vật dụng đời thường.</span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none;\">\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">&nbsp;</span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Những ai thường xuyên đi lại trên những con đường rải đá hoặc sỏi sẽ không lạ gì với chuyện kính chắn gió bị xước. Ngay cả những chiếc xe đi ngược chiều cũng có thể hất bụi đất hoặc vụn đá vào kính chắn gió xe của bạn và làm nó bị xước. Rất may là bạn có thể “chữa cháy” những vết xước trên kính xe bằng những thao tác khá đơn giản như sau.</span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">&nbsp;</span></div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Dùng sơn đánh móng tay màu trong</span></span></div>\r\n\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 0px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Đầu tiên, bạn phải xịt nước lau rửa lên bề mặt và xung quanh vết xước trên kính.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Lau bụi bẩn bằng vải mềm. Chú ý là phải lau khô theo chiều dọc của vết xước.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Đánh sơn móng tay màu trong lên toàn bộ vết xước bằng chổi như đánh móng tay thông thường. Nhúng chổi vào dung dịch sơn móng tay và quét qua vết xước trên kính lần thứ hai để đảm bảo không để sót.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Đổ axêtôn vào một mảnh vải mềm và lau toàn bộ phần sơn móng tay dính bên ngoài gờ vết xước.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: none; margin: 0px 0px 10px; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Dùng dung dịch đánh bóng kim loại</span></span></p>\r\n\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 0px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Lau sạch vết xước và khu vực xung quanh bằng vải ẩm.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Lau khô vết xước bằng loại vải không xơ.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Đổ dung dịch đánh bóng kim loại ra một mảnh vải mềm.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Lau vết xước nhiều lần theo chiều dọc bằng vải mềm. Chà dung dịch đánh bóng kim loại cho đến khi vết xước trên kính chắn gió biến mất.</span></li>\r\n</ul>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\">&nbsp;</div>\r\n\r\n<div style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-weight: 700;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Một số bí quyết và cảnh báo</span></span></div>\r\n\r\n<ul style=\"box-sizing: border-box; outline: none; margin: 0px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Sử dụng loại vải mềm thay vì khăn giấy để lau kính chắn gió. Nhiều sản phẩm khăn giấy có thể làm trầy xước kính chắn gió.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Đối những vết xước sâu, bạn không nên dùng sơn đánh móng tay hoặc dung dịch đánh bóng kim loại mà nên mua bộ dụng cụ xóa vết xước chuyên dụng. Nếu vết xước gây cản trở tầm nhìn trong quá trình lái xe, bạn hãy thay mới để đảm bảo an toàn cho bản thân và người xung quanh.</span></li>\r\n	<li style=\"box-sizing: border-box; outline: none; text-align: justify;\"><span style=\"box-sizing: border-box; outline: none; font-size: medium;\">Hãy cẩn thận khi dùng dung dịch đánh bóng kim loại. Chỉ giữ miếng vải thấm dung dịch đánh bóng trên bề mặt vết xước. Nếu lau ra các khu vực khác, kính chắn gió có thể bị xước.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', 'Lớp HKN - 22215 - Đại học kinh doanh Công Nghệ Hà Nội', '', '', 0, 127, 1, 1, 0, 0, 0, 1, 'Cách chăm sóc kính chắn gió ô tô tiết kiệm và hiệu quả', 'Cách chăm sóc kính chắn gió ô tô tiết kiệm và hiệu quả', 'Cách chăm sóc kính chắn gió ô tô tiết kiệm và hiệu quả', 1, 1, '2017-01-17 15:01:51', '2017-07-22 11:30:33'),
