 inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Quy mô: Gồm 3 Block với 7 tòa chung cư.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">HIện tại đang xây dựng Block The One với 2 tòa chung cư&nbsp;</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tòa Nam: 14 căn/sàn, nhìn về hướng Sông Hồng, quần thể khu đô thị Gamuda City.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tòa Bắc: 12 căn/sàn, tầm nhìn toàn bộ khu đô thị, góc nhìn đẹp.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit;\">Tòa Nam</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">chung cư gamuda</a>&nbsp;<span style=\"box-sizing: inherit;\">có hướng nhìn&nbsp;đường vành đai 3, sông Hồng và công viên Yên Sở, còn tòa Bắc view Công viên Yên Sở cũng như nhìn vào khu biệt thự với mật độ cây xanh lên tới 50%. Đây cũng là dự án có mật độ xây dựng rất thấp theo tiêu chuẩn Malaysia với khối đế chỉ 50% và khối căn hộ có mật độ xây dựng chỉ 30%.</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mỗi tháp có 5 thang máy Huyndai luôn đảm bảo sự di chuyển bên trong tòa nhà 1 cách nhanh chóng.&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiện ích: Khu vui chơi giải trí và thư giãn Nhà câu lạc bộ Gamuda Gardens, bệnh viện quốc tế, trường học liên cấp quốc tế Singapore, trường mầm non</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bàn giao nhà: Qúy IV/2016</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">VỊ TRÍ CHUNG CƯ THE ONE RESIDENCE&nbsp;</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chung cư The One Residence&nbsp;toạ lạc trong khuôn viên Dự án Gamuda City, được thừa hưởng&nbsp;một vị trí chiến lược cửa ngõ phía Nam Hà Nội, ngay trên đường Tam Trinh giao với vành đai 3, chỉ cách Hồ Hoàn Kiếm 6km và Khu Phố cổ 25 phú đi xe.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"vi-tri-du-an-gamuda-gardens\" class=\"alignnone size-full wp-image-936\" height=\"679\" sizes=\"(max-width: 1299px) 100vw, 1299px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/vi-tri-du-an-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/vi-tri-du-an-gamuda-gardens.jpg 1299w, http://gamudagardens.vn/wp-content/uploads/2016/04/vi-tri-du-an-gamuda-gardens-300x157.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/vi-tri-du-an-gamuda-gardens-768x401.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/04/vi-tri-du-an-gamuda-gardens-1024x535.jpg 1024w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"1299\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vị trí chung cư Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kết nối giao thông rất thuận tiện: Vào trung tâm Hà Nội&nbsp;bằng tuyến đường Tam Trinh, di chuyển về phía Thanh Xuân, Cầu Giấy, sân bay Nội Bài bằng đường cao&nbsp;tốc&nbsp;trên cao Thanh Trì – Vành Đai 3.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">THIẾT KẾ CĂN HỘ CHUNG CƯ GAMUDA&nbsp;</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">&nbsp;<span style=\"box-sizing: inherit;\">Được thiết kế với các loại diện tích rất phù hợp chỉ từ 60 m2, 66m2,72m2 đến 83 m2 với 2 loại hình căn hộ đó là căn 2 phòng ngủ và 3 phòng ngủ với 100% tất cả các phòng ngủ, phòng khách của các căn hộ đều tiếp xúc với gió trời và ánh sáng tự nhiên. Nên đây được xem là ưu điểm vượt trội mà chủ đầu tư</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda</a>&nbsp;<span style=\"box-sizing: inherit;\">mang lại cho cư dân của chung cư The One Residence.</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit;\">Trên mỗi sàn&nbsp;<a href=\"http://gamudagardens.vn/can-ho-chung-cu/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">chung cư gamuda</a>&nbsp;có 12 đến 14 căn, với 22 tầng căn hộ, mỗi tháp có 5 thang máy Korea luôn đảm bảo sự di chuyển bên trong tòa nhà 1 cách nhanh chóng. Quý khách chỉ mất tối đa&nbsp;1 phút để chờ thang máy, thêm 1 phút để di chuyển từ tầng 1 đến tầng cao nhất của tòa nhà</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế khéo léo&nbsp;căn hộ 2 phòng ngủ diện tích từ 61-66 m2</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"Thiet-ke-can-ho-2-phong-ngu\" src=\"http://chungcuhanoi24h.com.vn/Upload/thiet-ke-can-2-phong-ngu.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Thiết kế căn hộ 2 phòng ngủ\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn hộ 2 phòng ngủ</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn hộ 2 phòng ngủ 72m2</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"thiet-ke-can-ho-2phong-ngu-gamuda\" src=\"http://chungcuhanoi24h.com.vn/Upload/can-ho-gamuda-2phong-ngu-72m2.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Thiết kế căn 72m2\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn hộ 2 phòng ngủ</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"Thiet-ke-can-ho-3-phong-ngu\" src=\"http://chungcuhanoi24h.com.vn/Upload/thie-ke-can-3-phong-ngu.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Thiết kế căn hộ 3 phòng ngủ\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn góc&nbsp;3 phòng ngủ&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hiện tại dự án đã bàn giao vào tháng 11/2016 cho các cư dân. Chung cư Gamuda The One&nbsp;bàn giao với các hạng mục nội thất cơ bản như:</span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<div style=\"box-sizing: inherit;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Sàn phòng khách ốp gạch Ceramic 400 x 400</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các phòng ngủ được lát sàn gỗ</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tường đã sơn bả và trần thạch cao chống ẩm</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng vệ sinh ốp gạch Ceramic và đầy đủ đồ như Lavabo, thiết bị vệ sinh…</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Căn hộ cũng được trang bị hệ thống cửa chính lõi thép chống cháy, hệ thống cửa các phòng; ban công</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đầu chờ điện nước, mạng, cáp quang, ống kỹ thuật, điều hòa đã được lắp đầy đủ&nbsp;</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"phong-ngu-gamuda-gardens\" class=\"alignnone size-full wp-image-744\" height=\"566\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-gamuda-gardens.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-gamuda-gardens-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-gamuda-gardens-768x511.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-ngu-gamuda-gardens-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Căn hộ mẫu chung cư The One Residence</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">TIỆN ÍCH DỰ ÁN CHUNG CƯ GAMUDA GARDENS</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vì tòa chung cư The One Residence nằm trong quần thể khu đô thị Gamuda Gardens rộng 73 ha nên toàn bộ cư dân của The One Residence được thừa hưởng toàn bộ tiện ích, hạ tầng khép kín của Gamuda&nbsp;như Bể bơi ngoài trời tiêu chuẩn Olympic 50 x 25 m; &nbsp;khu thể thao với 2 sân Tennis; 2&nbsp;sân bóng rổ; trường công của Thành phố ngay trong dự án; trường liên cấp quốc tế SIS; khu nhà câu lạc bộ Clubhouse; khu nhà phố Shop House; bệnh viện quốc tế; &nbsp;công viên…</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-ich-khu-do-thi-gamuda-gardens\" class=\"alignnone size-full wp-image-849\" height=\"341\" sizes=\"(max-width: 1024px) 100vw, 1024px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens.png 1024w, http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens-300x100.png 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens-768x256.png 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"1024\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các tiện ích đồng bộ, hiện đại của Chung cư gamuda&nbsp;The One&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà câu lạc bộ Gamuda đã xây dựng xong&nbsp;với nhiều tiện ích nổi trội. Đáp ứng đầy đủ các nhu cầu cho cuộc sống hiện đại.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"khu-vui-choi-gamuda-garden\" class=\"alignnone size-full wp-image-999\" height=\"574\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/khu-vui-choi-gamuda-garden.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/09/khu-vui-choi-gamuda-garden.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/09/khu-vui-choi-gamuda-garden-300x215.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/09/khu-vui-choi-gamuda-garden-768x551.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu vui chơi cho trẻ nhỏ</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt khác với hệ thống an ninh độc lập, ra vào thông qua các chốt bảo vệ giúp mang lại không gian lý tưởng và riêng tư nhất chỉ dành cho cư dân và con em của cư dân, cùng với đó là hành lang, sảnh chờ rộng 1.8 m đến 2 m, cũng như độ cao trần quá lý tưởng (khối đế 3.8 m đến 4 m còn khối căn hộ 3.2 m). Không có quá nhiều chủ đầu tư Việt Nam quan tâm và đầu tư cho cuộc sống cư dân từ những chi tiết nhỏ như vậy.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit;\">Chung cư Gamuda có không gian xung quanh rất thoáng. Không bị các tòa nhà khác&nbsp;che khuất. Tầm View rộng và đẹp cũng là một lợi thế của</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">chung cư Gamuda</a>.&nbsp;<span style=\"box-sizing: inherit;\">Các căn hộ hộ phía Bắc nhìn ra khu đô thị Gamuda Gardens, Hồ điều hòa Yên sở. Tòa nam nhìn ra sông hồng, quần thể khu đô thị Gamuda City</span></span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">TIẾN ĐỘ DỰ ÁN CĂN HỘ CHUNG CƯ GAMUDA NHƯ NÀO?</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chung cư Gamuda đang có tiến độ tốt, đúng như lịch trình giao nhà của chủ đầu tư. Hiện tại tòa chung cư Gamuda the one&nbsp;đã bàn giao. Tòa chung cư Thứ 2 The TWO Residence&nbsp;đang xây dựng đến tầng 16 và &nbsp;trong quá trình hoàn thiện bên trong.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-do-xay-dung-chung-cu-gamuda\" class=\"alignnone size-full wp-image-1393\" height=\"501\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda-768x481.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiến độ thi công tháng 10/2016.Tòa The One cơ bản hoàn thành, tòa The TWO vừa xong móng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"chung-cu-gamuda-the-one-residence\" class=\"alignnone size-full wp-image-1650\" height=\"735\" sizes=\"(max-width: 960px) 100vw, 960px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/12/chung-cu-gamuda-the-one-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/12/chung-cu-gamuda-the-one-residence.jpg 960w, http://gamudagardens.vn/wp-content/uploads/2016/12/chung-cu-gamuda-the-one-residence-300x230.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/12/chung-cu-gamuda-the-one-residence-768x588.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"960\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hướng nhìn từ đường vành đai 3</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"chung-cu-gamuda-ham-de-xe\" class=\"alignnone size-full wp-image-1525\" height=\"594\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-ham-de-xe.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-ham-de-xe.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-ham-de-xe-300x210.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-ham-de-xe-768x537.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu vực hầm để xe</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 