: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Hotline : 0936130538</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><span style=\"box-sizing: border-box; font-size: 16px; color: rgb(0, 128, 0); font-family: tahoma, arial, helvetica, sans-serif;\">***<span style=\"box-sizing: border-box; font-weight: 700;\">&nbsp;Lưu ý: Qúy khách Mua trực tiếp chủ đầu tư để nhận ưu đãi tốt nhất</span></span></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"wpb_text_column wpb_content_element \" style=\"box-sizing: border-box; text-align: center;\">&nbsp;</div>\r\n\r\n<div class=\"wpb_text_column wpb_content_element \" style=\"box-sizing: border-box; text-align: center;\">&nbsp;</div>\r\n\r\n<div class=\"wpb_text_column wpb_content_element \" style=\"box-sizing: border-box; text-align: center;\">\r\n<h2 style=\"box-sizing: border-box; font-family: inherit; line-height: 1.3636; color: inherit; margin: 10px 0px; font-size: 20px;\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 0); font-size: 28px; font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">TỔNG QUAN KHU NHÀ LIỀN KỀ ST4 – CAMELIA HOMES</span></span><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2061\" height=\"41\" sizes=\"(max-width: 333px) 100vw, 333px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_14.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_14.png 333w, http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_14-300x37.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; clear: both;\" width=\"333\" /></span></h2>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; text-align: left;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Tiếp nối thành công của mô hình biệt thự nhà vườn Lily Homes thuộc tiểu khu Botanic. Chủ đầu tư Gamuda Land Việt Nam tiếp tục giới thiệu Nhà vườn Camelia Homes, sản phẩm bất động sản mới nhất tiểu khu Tropical, khu đô thị Gamuda Gardens.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; text-align: left;\">&nbsp;</p>\r\n</div>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: inherit; line-height: 1.3333; color: inherit; margin: 10px 0px; font-size: 1.8rem; text-align: center;\"><span style=\"box-sizing: border-box; font-size: 24px;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(186, 88, 39); font-family: tahoma, arial, helvetica, sans-serif;\">VỊ TRÍ CỦA KHU LIỀN KỀ ST4 –&nbsp;CAMELIA HOMES</span></span></span></h3>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2097\" height=\"27\" sizes=\"(max-width: 434px) 100vw, 434px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png 434w, http://gamudacity.info/wp-content/uploads/2017/06/1.2-1-300x19.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"434\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Với những ưu điểm về vị trí dự án cũng như thiết kế cảnh quan,&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;trong giai đoạn 1 và giai đoạn 2 đã tạo dấu ấn trên thị trường bất động sản phía Nam Hà Nội. Trong giai đoạn 3, Gamuda Land Việt Nam tiếp tục cho ra mắt 133 căn biệt thự liền kề với tên gọi thương mại Camelia Homes ST4 có diện tích nhỏ hơn.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2108\" height=\"939\" sizes=\"(max-width: 1440px) 100vw, 1440px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/mbst4.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/mbst4.jpg 1440w, http://gamudacity.info/wp-content/uploads/2017/06/mbst4-300x196.jpg 300w, http://gamudacity.info/wp-content/uploads/2017/06/mbst4-1024x668.jpg 1024w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"1440\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; text-align: center;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><em style=\"box-sizing: border-box;\">Vị trí Nhà liền kề ST4 trong khu đô thị Gamuda</em></span></p>\r\n\r\n<div class=\"wpb_text_column wpb_content_element \" style=\"box-sizing: border-box; text-align: center;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; text-align: left;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Nằm trong khuôn viên Gamuda Gardens – Khu đô thị tốt nhất Hà Nội, Camelia Homes ST4 với 133 căn biệt thự liền kề là chốn an cư lý tưởng cho những gia đình tìm kiếm không gian sống xanh mát, rời xa những ồn ào của chốn đô thị trung tâm. Những dãy nhà liền kề thiết kế hiện đại, rộng thoáng, bao bọc bởi sân trước và vườn sau, tạo thành một thể kiến trúc thống nhất và năng động. Sở hữu điểm nhấn là những đóa hoa trà duyên dáng, hài hòa và cân đối, Camelia Homes mang đến nét độc đáo, chấm phá trong quang cảnh xanh mướt tại Khu đô thị Gamuda Gardens. Mô hình kiến trúc 3 tầng trên diện tích đất từ 105m2 – 271 m2, diện tích xây dựng từ 196m2 – 204m2, cho phép gia chủ tạo dựng một không gian phù hợp cho mọi sinh hoạt gia đình và mục đích sử dụng.</span></p>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2069\" height=\"563\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/21.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/21.jpg 800w, http://gamudacity.info/wp-content/uploads/2017/06/21-300x211.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; clear: both;\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><em style=\"box-sizing: border-box;\">Phối cảnh ST4 Camelia Homes</em></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Với sân trước, vườn sau bao quanh ngôi nhà, mỗi căn liền kề ST4 đều có 3 mặt thoáng cùng hệ thống cửa sổ kính lớn giúp không gian sống của gia chủ được rộng mở, đón trọn những nguồn ánh sáng và luồng gió tự nhiên vào từng góc phòng. Mỗi tầng đều có những khoảng không gian chung của gia đình như phòng khách, phòng đọc sách hay phòng học, phòng thờ …trong khi vẫn đảm bảo những không gian riêng rộng mở như phòng ngủ lớn và nhỏ được thiết kế hài hòa.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2062\" height=\"547\" sizes=\"(max-width: 826px) 100vw, 826px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_16.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_16.png 826w, http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_16-300x199.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"826\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><em style=\"box-sizing: border-box;\">Mẫu nhà ST4 Camelia Homes</em></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">&nbsp;</p>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 1.3333; margin: 10px 0px; font-size: 1.8rem; text-align: center;\"><span style=\"box-sizing: border-box; font-size: 24px;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(186, 88, 39); font-family: tahoma, arial, helvetica, sans-serif;\">THIẾT KẾ ĐẲNG CẤP QUỐC TẾ</span></span></span></h3>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2097\" height=\"27\" sizes=\"(max-width: 434px) 100vw, 434px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png 434w, http://gamudacity.info/wp-content/uploads/2017/06/1.2-1-300x19.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"434\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Camslia Homes nổi bật với phong cách nhà vườn xanh mướt, với những dãy nhà liền kề thiết kế hiện đại. Mỗi căn Camelia Homes đều được bao bọc bởi sân trước, vườn sau tạo thành một tổng thể kiến trúc hài hòa, thống nhất trong không gian xanh của khu đô thị. Mỗi căn liền kề Gamuda ST4 đều được thiết kế 1 phòng khách, 4 phòng ngủ, 1 phòng thờ ngoài ra còn có các khu sinh hoạt chung ở tầng 2 và tầng 3. Mặt khác, các căn liền kề ST4 còn có hệ thống cửa sổ lớn và ban công rộng giúp đón được lượng gió và ánh sáng tự nhiên chan hòa đến khắp phòng.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2063\" height=\"526\" sizes=\"(max-width: 826px) 100vw, 826px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_17.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_17.png 826w, http://gamudacity.info/wp-content/uploads/2017/06/Screenshot_17-300x191.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"826\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><em style=\"box-sizing: border-box;\">Không gian xanh quang khu nhà</em>&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">&nbsp;</p>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 1.3333; margin: 10px 0px; font-size: 1.8rem; text-align: center;\"><span style=\"box-sizing: border-box; font-size: 24px;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(186, 88, 39); font-family: tahoma, arial, helvetica, sans-serif;\">KHÔNG GIAN NHÀ VƯỜN XANH MÁT</span></span></span></h3>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-2097\" height=\"27\" sizes=\"(max-width: 434px) 100vw, 434px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/1.2-1.png 434w, http://gamudacity.info/wp-content/uploads/2017/06/1.2-1-300x19.png 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"434\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">Những mảng xanh trù phú tạo nên bởi những góc sân vườn, công viên, những con đường rợp bóng cây mang lại cho Camelia Homes vẻ đẹp thân thiện và bình yên. Những đóa hoa trà duyê dáng điểm thêm nét chấm phá độc đáo và thơ mộng cho không gian xanh mướt nơi đây. Từ cảnh quan ngoại vi của khu đô thị đến kiến trức xanh tại nhà vườn đều mang đến cho cư dân trải nghiệm về phong cách sống sinh thái trong lành, khiến Camelia Homes thực sự trở thành chốn mang đến cho cư dân trải nghiệm về phòng cách sống sinh thái trong lành, khiến Camelia Homes thực sự trở thành chốn mong về của cư dân.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\">&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px;\"><span style=\"box-sizing: border-box; font-family: tahoma, arial, helvetica, sans-serif;\"><img alt=\"\" class=\"aligncenter wp-image-2074\" height=\"1013\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/88.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/88.jpg 800w, http://gamudacity.info/wp-content/uploads/2017/06/88-267x300.jpg 267w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"900\" /></span></p>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 1.3333; margin: 10px 0px; font-size: 1.8rem; text-align: center;\"><span style=\"box-sizing: border-box; color: rgb(153, 51, 102); font-family: tahoma, arial, helvetica, sans-serif;\">&nbsp;</span></h3>\r\n\r\n<h3 style=\"box-sizing: border-box; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 1.3333; margin: 10px 0px; font-size: 1.8rem; text-align: center;\"><span style=\"box-sizing: border-box; font-size: 24px;