; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><img alt=\"mat-bang-lien-ke-gamuda-st3-tang-2\" class=\"alignnone size-full wp-image-1675\" height=\"1167\" sizes=\"(max-width: 733px) 100vw, 733px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2.jpg 733w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2-188x300.jpg 188w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2-643x1024.jpg 643w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"733\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế tầng 2</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><img alt=\"mat-bang-lien-ke-gamuda-st3\" class=\"alignnone size-full wp-image-1674\" height=\"1054\" sizes=\"(max-width: 810px) 100vw, 810px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3.jpg 810w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-231x300.jpg 231w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-768x999.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-787x1024.jpg 787w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"810\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 