(47, 'Dành cho trẻ em', 'danh-cho-tre-em', 'danh-cho-tre-em', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/img-tin.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Completely synergize resource sucking relationships via premier niche markets. Professionally cultivate.</p>\r\n\r\n<p>&nbsp;</p>', '<ul>\r\n	<li>\r\n	<p>Giúp cha mẹ khám phá được những tài năng thiên bẩm của con và bắt đầu định hướng phát triển từ sớm.</p>\r\n	</li>\r\n	<li>\r\n	<p>Giúp cha mẹ hiểu được tương quan giữa các chỉ số liên quan mật thiết đến thành công như IQ, EQ, AQ, CQ mà con sở hữu.</p>\r\n	</li>\r\n	<li>\r\n	<p>Giúp cha mẹ dựa vào mô hình 9 loại trí thông minh của Giáo sư Howard Garner xác định loại thông minh của con và định hướng giáo dục sớm, đặc biệt là trong giai đoạn trước 18 tuổi.</p>\r\n	</li>\r\n	<li>\r\n	<p>Giúp cha mẹ xác định các chỉ số đặc biệt khác của con như là: TFRC (tiềm năng tư duy bẩm sinh), VAKRU™ (phương pháp tiếp nhận thông tin hoặc học tập), cấu trúc thùy não (thùy trước trán, thùy đỉnh, thùy chẩm, thùy trán, thùy thái dương), 10 chức năng não bộ (phát triển tố chất bẩm sinh).</p>\r\n	</li>\r\n	<li>\r\n	<p>Giúp cha mẹ hiểu và có phương pháp nuôi dạy con phù hợp hơn ngay từ sớm.</p>\r\n	</li>\r\n</ul>\r\n\r\n<div class=\"p-ve\">\r\n<p>Để đảm bảo chuẩn mực và mang lại giá trị cao nhất cho phụ huynh, TGM chỉ nhận làm dịch vụ STA 4.0 cho các bé từ 3 tuổi trở lên.</p>\r\n</div>', 'Đông Anh - Hà Nội', 'null', 'null', 0, 41, 1, 0, 0, 0, 0, 0, '', '', '', 1, 7, '2017-08-06 22:02:13', '2019-01-11 05:29:37');
