(48, 'Vì sao chọn chúng tôi', 'vi-sao-chon-chung-toi', '', 46, 'vietnamese', '[\"46\"]', '/uploads/images/bai-viet/img-tin.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><b>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed id tortor nisl. Morbi aliquam, tellus et tempor ornare, nulla mauris mattis lectus, sollicitudin faucibus est mauris at neque. Donec euismod est vel diam congue, quis congue urna imperdiet. Nam sed feugiat tellus. Mauris vitae turpis lacinia, semper felis vel, ullamcorper mi. </b></p>\r\n\r\n<p>Donec tincidunt, elit quis porta sagittis, est nulla tristique ex, sed viverra felis sapien a tellus. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Praesent vel dolor imperdiet, condimentum quam ut, interdum dui. Mauris ac viverra nulla, vitae iaculis lacus. Proin vel efficitur massa. Fusce tempus feugiat mi, sit amet ullamcorper odio cursus a. Nulla nisi enim, aliquet ac commodo in, imperdiet vel sapien. Etiam sed semper tortor, sit amet luctus nisl. Sed varius tincidunt libero, et bibendum nunc hendrerit et. Duis sed augue dictum, euismod lacus et, ultricies diam. Pellentesque pulvinar orci vel orci luctus posuere.</p>', '<p>Nocas&nbsp; là tên viết tắt của Công ty cổ phần xây dựng và kết cấu thép số 1 Hà Nội, là một trong những công ty lớn có nhiều năm kinh nghiệm trong lĩnh vực thiết kế ngành kết cấu thép và xây dựng nhà xưởng. Cung cấp nhiều sản phẩm siêu trường, siêu trọng lượng, dịch vụ nhân công lắp dựng tốt, tiến độ nhanh chóng. Trong những năm hoạt đông, Nocas thấy nhu cầu về mua bán khung nhà xưởng cũ tăng nhiều trong những năm gần đây vì vậy chúng tôi đã bổ sung thêm dịch vụ kinh doanh mới về mua bán khung nhà xưởng cũ. Với nội lực và lòng tân tâm, lòng nhiệt huyết của cán bộ công nhân viên cùng với hệ thống sản xuất công nghệ cao hiện đại đảm bảo sẽ mạng lại giá trị sản phẩm chất lượng đáp ứng mọi nhu cầu và niềm tin của Quý khách.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\" Thiết kế ngành kết cấu thép và xây dựng, mua khung nhà thép, khung nhà tiệp, khung nhà xưởng...\" class=\"wp-image-456 size-full bdaia-img-show\" height=\"199\" src=\"http://ketcauthep.net/wp-content/uploads/2015/03/xay-dung-nha-xuong-chuyen-nghiep-1024x1991.gif\" width=\"1024\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Qúa trình hình thành &amp; phát triển</h2>\r\n\r\n<p>&nbsp;Được thành lập từ đầu 02/ 2009, chính thức&nbsp;hoạt động trong lĩnh vực <strong><a href=\"http://ketcauthep.net/xay-dung-nha-xuong/\" rel=\"noopener\" target=\"_blank\">xây dựng nhà xưởng</a></strong> nhà thép tiền chế, sản xuất <strong><a href=\"http://ketcauthep.net/ket-cau-thep/\" rel=\"noopener\" target=\"_blank\">kết cấu thép</a>&nbsp;</strong>công nghệ cao phục vụ các ngành xây dựng, công nghiệp. Chúng tôi đang hướng tới chiến lược tăng trưởng về ngành kết cấu thép, xu hướng của thời đại cập nhận những thức tinh tế nhất vào từng sản phẩm. Hướng tới một nền kinh tế mạnh mẽ cho doanh nghiệp và xã hội.</p>\r\n\r\n<p>Từ một công ty phát triển lên thành một doanh nghiệp hàng đầu trong ngành kết cấu thép và xây dựng nhà xưởng , Nocas&nbsp;đã tư vấn và giúp gần một ngàn quý khách và quý doanh nghiệp tạo ra những sản phẩm chất lương và ưng ý nhất.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://ketcauthep.net/wp-content/uploads/2015/03/ket-cau-thep-xay-dung-nha-xuong1.gif\"><img alt=\"Số một về thiết kết sản xuất kết cấu thép\" class=\"size-full wp-image-121 bdaia-img-show\" height=\"201\" src=\"http://ketcauthep.net/wp-content/uploads/2015/03/ket-cau-thep-xay-dung-nha-xuong1.gif\" width=\"1034\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Hệ thống nhà máy của Nocas</h3>\r\n\r\n<p>Địa chỉ nhà máy chính đặt tại khu: <strong>Chợ VLXD Ngọc Trục, Đại Mỗ, Từ Liêm, Hà Nội</strong>. Trong vòng 7 năm hoạt động với mục tiêu cung cấp những sản phẩm tốt nhất ra thị trường, đã chiếm trọn nhiều lòng tin của quý khách hàng và quý doanh nghiệp. Do nhu cầu sản xuất nhiều từ một nhà máy sản xuất chính, Nocas đã mở rộng thêm một nhà máy thứ hai &nbsp;tại khu Văn Quán, Hà Đông, HN để đáp ứng đủ nhu cầu ngày càng cao về chế tạo kết cấu thép và xây dựng nhà xưởng.</p>\r\n\r\n<p>Mỗi nhà máy đều có những càn bộ công nhân viên lành nghề cùng với cơ sở vật chất phục vụ cho sản xuất cũng như yêu cầu về đúng thiết kế, chất lượng, tiến độ. Nhà máy một, nhà máy hai đều có bộ phận đứng đầu là quản đốc, làm theo đứng quy chế, quy trình sản xuất &nbsp;nghiêm ngặt áp dụng cho từng công nhân và áp dụng &nbsp;theo đúng phom biểu mà ban giám đốc công ty đã đề ra.</p>\r\n\r\n<h3>Tư vấn và chi phí tiếc kiệm nhất</h3>\r\n\r\n<p>&nbsp;Đến với Nocas&nbsp;luôn được hỗ trợ về dịch vụ &nbsp;miễn phí&nbsp;(Tư vấn thiết kế, gia công, dám sát, lắp dựng và báo giá nhanh) cho quý &nbsp;khách&nbsp;và sẽ được giải đáp mọi thắc mắc &nbsp;các nhu cầu.<b>&nbsp;</b>Chúng tôi luôn đảm bảo mang lại cho khách hàng những chi phí tiếc kiểm nhất. Những trong đó vẫn giữ được&nbsp;đảm bảo &nbsp;cao về tiến độ&nbsp;chất lượng, kỹ thuật, thẩm mỹ cao. Trong quá trình dự án đang &nbsp;triên khai ở bất cư giai đoạn nào chúng tôi luôn hỗ trợ, cung cấp cho quý vị giải pháp tốt nhất và tối ưu nhất. Hay liên lạc với chúng tôi, quý vị sẽ ngay lập tức nhận được hỗ trợ, với thời gian nhanh nhất và hoàn toàn miễn phí trong tất cả các lĩnh vực liên quan tới thép và kết cấu :</p>\r\n\r\n<ul>\r\n	<li><a href=\"http://ketcauthep.net/xay-dung-nha-xuong/\" rel=\"noopener\" target=\"_blank\">Công trình xây dựng</a></li>\r\n	<li><a href=\"http://ketcauthep.net/ket-cau-thep/\" rel=\"noopener\" target=\"_blank\">Công trình kết cấu thép</a></li>\r\n	<li><a href=\"http://ketcauthep.net/xay-dung-nha-xuong/khung-nha-xuong-cu/\" rel=\"noopener\" target=\"_blank\">Lắp dựng khung nhà thép cũ</a></li>\r\n	<li><a href=\"http://ketcauthep.net/xay-dung-nha-xuong/khung-nha-xuong-cu/\" rel=\"noopener\" target=\"_blank\">Tháo dỡ khung nhà xưởng</a></li>\r\n	<li><a href=\"http://ketcauthep.net/nocas-tong-cong-ty-tu-van-xay-dung-ket-cau-thep-va-xay-dung-nha-xuong-cong-nghiep-2/\" rel=\"noopener\" target=\"_blank\">Thi công lắp dựng</a></li>\r\n	<li><a href=\"http://ketcauthep.net/\" rel=\"noopener\" target=\"_blank\">Tư vấn thiết kế</a></li>\r\n	<li><a href=\"http://ketcauthep.net/xay-dung-nha-xuong/\" rel=\"noopener\" target=\"_blank\">Các công trình về dân dụng và công nghiệp</a></li>\r\n</ul>\r\n\r\n<h3>Hình ảnh thiết kế và suản xuất của Nocas</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<figure class=\"wp-caption aligncenter\" id=\"attachment_409\" style=\"width: 714px\"><img alt=\"Hình ảnh sản xuất kết cấu thép\" class=\"wp-image-409 size-full bdaia-img-show\" height=\"424\" src=\"http://ketcauthep.net/wp-content/uploads/2015/03/201418451e98-5fba-4e4d-ac72-641dee83e5c7.gif\" width=\"714\" />\r\n<figcaption class=\"wp-caption-text\"><em><span style=\"font-size: 10pt;\">Hình ảnh sản xuất kết cấu thép</span></em></figcaption>\r\n</figure>\r\n\r\n<figure class=\"wp-caption aligncenter\" id=\"attachment_410\" style=\"width: 714px\"><img alt=\"Hình ảnh sản xuất kết cấu thép\" class=\"size-full wp-image-410 bdaia-img-show\" height=\"424\" src=\"http://ketcauthep.net/wp-content/uploads/2015/03/201418451e98-5fba-4e4d-ac72-641dee83e5c71.gif\" width=\"714\" />\r\n<figcaption class=\"wp-caption-text\"><em><span style=\"font-size: 10pt;\">Hình ảnh sản xuất kết cấu thép</span></em></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Hình ảnh lắp dựng</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<figure class=\"wp-caption aligncenter\" id=\"attachment_381\" style=\"width: 714px\"><a href=\"http://ketcauthep.net/cong-trinh-lap-dat-ket-cau-thep-mai-ton-148-hoang-quoc-viet/\" rel=\"noopener\" target=\"_blank\" title=\"Công trình lắp đặt kết cấu thép, mái tôn 148 Hoàng Quốc Việt\"><img alt=\"Công trình lắp đặt kết cấu thép, mái tôn 148 Hoàng Quốc Việt\" class=\"size-full wp-image-381 bdaia-img-show\" height=\"424\" src=\"http://ketcauthep.net/wp-content/uploads/2015/04/Cong-trinh-ket-cau-148-hoang-quoc-viet.gif\" width=\"714\" /></a>\r\n\r\n<figcaption class=\"wp-caption-text\"><span style=\"font-size: 10pt;\"><em>Công trình lắp đặt kết cấu thép, mái tôn 148 Hoàng Quốc Việt</em></span></figcaption>\r\n</figure>\r\n\r\n<figure class=\"wp-caption aligncenter\" id=\"attachment_357\" style=\"width: 714px\"><a href=\"http://ketcauthep.net/cong-trinh-trang-tri-mat-tien-thuy-dien-son-la/\" rel=\"noopener\" target=\"_blank\" title=\"Dự án nhà máy Thủy điện Sơn La\"><img alt=\"Dự án nhà máy Thủy điện Sơn La\" class=\"size-full wp-image-357 bdaia-img-show\" height=\"424\" src=\"http://ketcauthep.net/wp-content/uploads/2015/04/987987987979.gif\" width=\"714\" /></a>\r\n\r\n<figcaption class=\"wp-caption-text\"><em><span style=\"font-size: 10pt;\">Dự án nhà máy Thủy điện Sơn La</span></em></figcaption>\r\n</figure>\r\n\r\n<figure class=\"wp-caption aligncenter\" id=\"attachment_334\" style=\"width: 714px\"><a href=\"http://ketcauthep.net/cong-trinh-nha-may-chinh-nha-canteen-nha-de-xe/\" rel=\"noopener\" target=\"_blank\" title=\"Nhà máy chính nhà, Canteen, nhà để xe\"><img alt=\"Nhà máy chính nhà, Canteen, nhà để xe\" class=\"size-full wp-image-334 bdaia-img-show\" height=\"424\" src=\"http://ketcauthep.net/wp-content/uploads/2015/04/nha-may-cateen.gif\" width=\"714\" /></a>\r\n\r\n<figcaption class=\"wp-caption-text\"><em><span style=\"font-size: 10pt;\">Nhà máy chính nhà, Canteen, nhà để xe</span></em></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Để biết thêm thông tin về cúng tôi. Quý vị đừng ngại ngần tới thăm quan cơ sở vật chất hoặc liên hệ với chúng tôi bất cứ khi nào bạn cần, bạn luôn luôn nhận được sự tư vấn nhiệt thành nhất từ chúng tôi mà không mất bất kỳ khoản chi phí nào. Với đội ngũ kỹ sư giàu kinh nghiệm, công nhân chuyên nghiệp, giá cả hợp lý, chất lượng dịch vụ tốt chắn sẽ làm hài lòng Quý khách.</p>\r\n\r\n<h3><span style=\"color: #3366ff;\">Công Ty Cổ Phần Xây Dựng Và Kết Cấu Thép Số 1 Hà Nội</span></h3>\r\n\r\n<p><strong>Địa chỉ</strong>: Chợ VLXD Ngọc Đại,Đại Mỗ, Tp. Hà Nội</p>\r\n\r\n<p><strong>Hotline</strong>: <span style=\"font-size: 14pt;\"><strong>098 310 39 38</strong></span></p>\r\n\r\n<p><strong>Fax</strong>: 043 789 3947</p>\r\n\r\n<p><strong>Email</strong>:<span style=\"color: #3366ff;\"><a href=\"mailto:Phuongnocas@gmail.com\"> phuongnocas@gmail.com</a></span></p>\r\n\r\n<p><strong>Website</strong>:<span style=\"color: #3366ff;\"><a href=\"http://ketcauthep.net\"> http://ketcauthep.net</a>&nbsp;–&nbsp;<a href=\"https://nocas.vn\">https://nocas.vn</a></span></p>\r\n\r\n<p><strong>Facebook</strong>:<a href=\"https://www.facebook.com/ketcauthepso1\" rel=\"nofollow noopener\" target=\"_blank\" title=\"https://www.facebook.com/ketcauthepso1\">https://www.facebook.com/ketcauthepso1</a></p>', 'Ba Đình - Hà Nội', 'null', 'null', 0, 44, 1, -1, 0, 0, 0, 1, '', '', '', 1, 3, '2017-08-06 22:24:46', '2018-07-23 13:59:53');
INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images2`, `albums`, `description`, `content`, `content2`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(49, 'Sinh Trắc Vân Tay 4.0 là gì? Column 4', 'sinh-trac-van-tay-4-0-la-gi-column-4', '', 47, 'vietnamese', '[\"47\"]', '/uploads/images/bai-viet/img-tin.jpg', '', '\"\"', '<p>Trong xã hội, chỉ có rất ít người may mắn sớm phát hiện ra những tiềm năng và tố chất của bản thân, từ đó họ phát huy để đạt được thành công. Đa số còn lại sống cả cuộc đời lãng phí tài năng của mình vì tất cả chỉ dừng lại ở mức tiềm năng, nhiều khi còn không được nhận biết.</p>\r\n\r\n<p>Không có con đường đến với thành công dễ dàng nhưng luôn có con đường dễ hơn. Một trong những con đường dễ dàng hơn đó là xác định và tận dụng những tiềm năng lẫn tố chất của bản thân càng sớm càng tốt. <b>Sinh Trắc Vân Tay 4.0 (Scientific Talents Analysis – STA)</b> là phiên bản cải tiến mới nhất của Dermatoglyphics Multiple Intelligence Test (DMIT) cũ và là phương pháp khoa học phân tích dấu vân tay chính xác và mới nhất hiện nay, nhằm xác định những thế mạnh độc đáo của bạn và giúp bạn phát huy đúng cách.</p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu đô thị Gamuda Gardens Hoàng Mai là quần thể khép kín&nbsp;với nhiều&nbsp;loại hình nhà ở như biệt thư, nhà liền kề, căn hộ chung cư cao cấp&nbsp;và nhà phố thương mại… Với không gian&nbsp;xanh lành mạnh, công đồng cư dân văn minh cùng hệ thống tiện ích đồng bộ tiêu chuẩn 5* đẳng cấp sẽ&nbsp;đáp ứng đầy đủ nhu cầu trong cuộc sống của cư dân trong khu đô thị.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\"><img alt=\"khu-can-ho-gamuda-gardens\" class=\"alignnone size-full wp-image-1541\" height=\"435\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/khu-can-ho-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/khu-can-ho-gamuda-gardens.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/khu-can-ho-gamuda-gardens-300x154.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/khu-can-ho-gamuda-gardens-768x393.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh các tòa&nbsp;chung cư trong khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Gamuda Gardens được quy hoạch với 7 tòa chung cư&nbsp;cao cấp với chiều cao từ 26 đến 35 tầng. sẽ cung cấp ra thị trường hơn 2100&nbsp;căn hộ với diện tích&nbsp;đa dạng từ 37&nbsp;m2 – 140 m2 tương đương&nbsp;từ 1 – 4 phòng ngủ.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Được xây dựng&nbsp;bởi Gamuda Land đơn vị phát triển bất động sản hàng đầu của Malaysia. Các căn hộ&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">chung cư Gamuda</a>&nbsp;được thiết kế hiện đại, tỉ mỉ, chú trọng không gian xanh&nbsp;ngay trong các tòa chung cư. Cùng Với hệ thống tiện ích hoàn chỉnh trong khu đô thị, Chung cư Gamuda Gardens thực sự là một lựa chọn hoàn hảo&nbsp;cho những hộ gia đình trẻ năng động.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-ich-khu-do-thi-gamuda-gardens\" class=\"alignnone size-full wp-image-849\" height=\"341\" sizes=\"(max-width: 1024px) 100vw, 1024px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens.png 1024w, http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens-300x100.png 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens-768x256.png 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"1024\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các tiện ích trong khu đô thị Gamuda Gardens</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0); font-size: 14pt;\">Tiến độ hạng mục chung cư Gamuda</span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hiện tại Gamuda Land đã bàn giao 2 tòa chung cư The One Residence, 2 tòa The Two Residence đang xây dựng đến tầng 22&nbsp;và 3 tòa&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">The ZEN Residence</a>&nbsp;đang thi công đến tầng 5. Chủ đầu tư sẽ bàn giao cho cư dân lần lượt vào&nbsp;Quý II/2018 và Quý II/2019.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"chung-cu-the-two-residence-1\" class=\"alignnone size-full wp-image-1004\" height=\"567\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/chung-cu-the-two-residence-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/09/chung-cu-the-two-residence-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/09/chung-cu-the-two-residence-1-300x213.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/09/chung-cu-the-two-residence-1-768x544.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh&nbsp;chung cư The Two Resiedence</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">GAMUDA LAND MỞ BÁN TÒA&nbsp;CHUNG CƯ THE&nbsp;TWO&nbsp;RESIDENCE&nbsp;</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">&nbsp;Tiến Độ Thanh Toán :</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khách hàng thanh toán 50% theo tiến độ xây dựng đến khi nhận nhà ,50% còn lại trả chậm trong 36&nbsp;tháng&nbsp;không lãi suất.</span></li>\r\n	<li style=\"box-sizing: inherit; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hỗ trợ vay 70% giá trị căn hộ, Chủ đầu tư hỗ trợ lãi suất đến khi nhận nhà.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">&nbsp;Khuyến Mãi Chung&nbsp;</strong>:</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chiết khấu 4% giá trị căn hộ.</span></span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tặng 2 năm phí quản lý và 1 năm phí sử dụng Dịch vụ trong Clubhouse.</span></span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></span></li>\r\n</ul>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chương trình Kỉ niệm 10 năm thành lập Gamuda Land tại Việt Nam,&nbsp;Tặng nhiều phần quà có giá trị cho khách hàng đặt mua thành công.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"the-two-residence-chinh-sach-ban-hang\" class=\"alignnone wp-image-2060 size-full\" height=\"1200\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-two-residence-chinh-sach-ban-hang-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-two-residence-chinh-sach-ban-hang-1.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-two-residence-chinh-sach-ban-hang-1-213x300.jpg 213w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-two-residence-chinh-sach-ban-hang-1-768x1084.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-two-residence-chinh-sach-ban-hang-1-725x1024.jpg 725w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chính sách bán hàng chủ đầu tư</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tọa lạc tại vị trí trung tâm của khu đô thị&nbsp;<a href=\"http://gamudagardens.vn/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda Gardens</a>, phía trước tiếp giáp đường vành đai 3 và hướng về phía sông Hồng hùng vĩ, mặt sau hướng ra không gian xanh mát của khu đô thị, The TWO Residence hội tụ những ưu việt của chung cư mới, đa năng và khép kín.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"chung-cu-gamuda-the-two-residence\" class=\"alignnone size-full wp-image-1553\" height=\"691\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-the-two-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-the-two-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-the-two-residence-300x244.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-gamuda-the-two-residence-768x624.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với tổng diện tích 73.571 m2, kiến trúc hiện đại hình chữ L kết nối hai tòa tháp cao 27 và 30 tầng, gồm 4&nbsp;tầng gửi xe, 1 trung tâm thương mại và nhiều vườn treo, sân chơi, không gian xanh cho cộng đồng, The TWO Residence mang đến lựa chọn đa dạng về không gian sống tiện ích, thoáng đãng, trong lành, gần gũi với thiên nhiên và an toàn tuyệt đối.</span></p>\r\n\r\n<h1 style=\"box-sizing: inherit; font-size: 2.57em; margin: 0.67em 0px; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Thông tin&nbsp;Chung cư Gamuda The Two Residence</strong></span></h1>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chủ đầu tư: Công ty TNHH Gamuda Land Việt Nam (100% vốn Malaysia)</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vị trí: Km 1,5 Pháp Vân, công viên Yên Sở, Hoàng Mai, Hà Nội.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khởi công : 03/2016.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thông số chung : Khối đế 5 tầng bao gồm : 01 tầng hầm để xe máy sức chứa 900 xe ,Tầng 1 làm TTTM, Tầng 2-3-4 làm tầng nổi để xe ô tô sức chứa 350 xe. Tầng căn hộ từ tầng 5 trở lên với tổng số 550 căn hộ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích : Căn 1 phòng ngủ : 37-43-54m2; Căn 2 phòng ngủ : 77 – 86m2; 3 phòng ngủ : 90m2 – 93 – 126m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mật độ xây dựng : 50%</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mức độ hoàn thiện : Hoàn thiên nội thất cơ bản.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bàn giao dự kiến : Quý II/2018.</span></li>\r\n</ul>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Vị trí chung cư The Two Residence trong khu đô thị Gamuda</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Là một trong 3 Khu căn hộ thuộc Gamuda Gardens, chung cư The TWO Residence tận hưởng một vị trí chiến lược tại cửa ngõ phía Nam Hà Nội, chỉ cách Hồ Hoàn Kiếm 6 km và khu Phố Cổ 25 phút đi xe. Bạn có thể dễ dàng đi đến The TWO Residence thông qua đường Tam Trinh, Quốc lộ 1A, 1B, đường Vành đai số 3, cầu Thanh Trì và đường Vành đai số 4 trong tương lai.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"dia-diem-chung-cu-the-one\" class=\"alignnone size-full wp-image-729\" height=\"416\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/dia-diem-chung-cu-the-one.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/dia-diem-chung-cu-the-one.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/dia-diem-chung-cu-the-one-300x156.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/dia-diem-chung-cu-the-one-768x399.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vị trí Tòa chung cư The Two Residence</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Thiết kế căn hộ chung cư Gamuda</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với thiết kế cẩn thận, tỉ mỉ Hầu hết các căn hộ đều có mặt thoáng nên Các căn hộ được tiếp xúc tối đa&nbsp;ánh sáng tự nhiên và thông gió tự nhiên cho tất cả các phòng. Với 7 thang máy cao cấp Mitsubishi đảm bảo sự di chuyển nhanh chóng cho hơn 500 căn hộ tại chung cư này.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"mat-bang-chung-cu-gamuda\" class=\"alignnone size-full wp-image-1556\" height=\"698\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-chung-cu-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-chung-cu-gamuda-gardens.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-chung-cu-gamuda-gardens-300x262.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-chung-cu-gamuda-gardens-768x670.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng chung cư gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với diện tích đa dạng từ 37 – 126m2, hầu hết các căn hộ của&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">The TWO Residence</a>&nbsp;đều có hai mặt thoáng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"thiet-ke-can-1-phong-ngu-chung-cu-gamuda\" class=\"alignnone size-full wp-image-1560\" height=\"633\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-can-1-phong-ngu-chung-cu-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-can-1-phong-ngu-chung-cu-gamuda.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-can-1-phong-ngu-chung-cu-gamuda-300x223.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-can-1-phong-ngu-chung-cu-gamuda-768x572.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn hộ 1 phòng ngủ diện tích 43 m2</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Thiết kế thông minh, sáng tạo là đặc điểm nổi bật của tòa&nbsp;<a href=\"http://gamudagardens.vn/can-ho-chung-cu/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">chung cư Gamuda giai đoạn 2</a>. Các căn hộ không chỉ có ban công, sân vườn, mà còn có cả hành lang đi xung quanh căn hộ của mình.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"thiet-ke-chung-cu-gamuda-the-two\" class=\"alignnone size-full wp-image-1561\" height=\"748\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-chung-cu-gamuda-the-two.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-chung-cu-gamuda-the-two.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-chung-cu-gamuda-the-two-300x264.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/thiet-ke-chung-cu-gamuda-the-two-768x676.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Căn hộ 3 phòng ngủ với hành lang xanh quanh nhà</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Thiết kế thông minh với&nbsp;căn hộ Dual Key</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đây là loại căn hộ có chung cửa ra vào chính. Bên trong được chia thành 2 lối vào riêng biệt, trong đó, một lối dẫn tới phòng chính, một lối dẫn tới phòng nhỏ hơn. Mỗi phòng hoạt động độc lập được trang bị đầy đủ hệ thống bếp và nhà tắm riêng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"mat-bang-can-ho-gamuda-the-two\" class=\"alignnone size-full wp-image-1559\" height=\"961\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-can-ho-gamuda-the-two.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-can-ho-gamuda-the-two.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-can-ho-gamuda-the-two-265x300.jpg 265w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-can-ho-gamuda-the-two-768x868.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn hộ thông minh cho nhiều nhu cầu</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Hoàn thiện nội thất</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Danh mục hoàn thiện nội thất cho cư dân:</span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tất cả các phong ngủ được lát sàn gỗ, tủ quần áo âm tường, trần thạch cao hệ thống đèn led</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Sàn phòng khách ốp gạch Ceramic 400 x 400;</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các phòng ngủ được lát sàn gỗ</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tường đã sơn bả và trần thạch cao chống ẩm</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng vệ sinh ốp gạch Ceramic và đầy đủ đồ như Lavabo, thiết bị vệ sinh…</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Căn hộ cũng được trang bị hệ thống cửa chính lõi thép chống cháy, hệ thống cửa các phòng; ban công</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đầu chờ điện nước, mạng, cáp quang, ống kỹ thuật, điều hòa đã được lắp đầy đủ</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"nha-mau-chung-cu-gamuda-gardens\" class=\"alignnone size-full wp-image-1551\" height=\"700\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-gamuda-gardens.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-gamuda-gardens-300x247.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-gamuda-gardens-768x632.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nội thất hoàn thiện cho khách hàng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img class=\"alignnone wp-image-1552 size-full\" height=\"600\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-the-two-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-the-two-residence.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-the-two-residence-300x225.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/nha-mau-chung-cu-the-two-residence-768x576.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Nhà mẫu chung cư Gamuda\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà mẫu chung cư The Two Residence</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 12pt; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Tiện ích cho cư dân chung cư Gamuda</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Gamuda luôn&nbsp;giới thiệu các&nbsp;sản phẩm tốt nhất cho cuộc sống hiện đại&nbsp;và lối sống lành mạnh, chẳng hạn như là&nbsp;chất lượng thiết kế, các phong chức năng căn hộ được sắp xếp&nbsp;linh hoạt, tính bền vững và thiết kế thụ động sinh thái thân thiện, và sức mạnh tổng hợp với các tiện ích xung quanh&nbsp;(bán lẻ, nhà câu lạc bộ, giáo dục,&nbsp;vv).</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-ich-chung-cu-the-two-residence\" class=\"alignnone size-full wp-image-1555\" height=\"621\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-the-two-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-the-two-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-the-two-residence-300x219.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-the-two-residence-768x561.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">khu vui chơi ngay trên tầng 5 tòa nhà</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhìn vào mặt bằng ta thấy trên tầng 5 của khu chung cư có phần diện tích khá lớn xây dựng khu vườn lửng, bao gồm: bể bơi, cây xanh, lối đi bộ và các phòng chức năng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chung cư&nbsp;<a href=\"http://gamudagardens.vn/can-ho-chung-cu/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda The Two</a>&nbsp;được thiết kế với các tiện ích gần như đầy đủ ngay trong tòa nhà, Mang đến sự tiện lợi nhất cho hoạt động sinh hoạt của cư dân</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-ich-chung-cu-gamuda\" class=\"alignnone size-full wp-image-1558\" height=\"442\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-gamuda.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-gamuda-300x156.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-gamuda-768x399.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khối đế gồm khu mua sắm và các tầng để xe</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt trước khu&nbsp;<a href=\"http://gamudagardens.vn/can-ho-chung-cu/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">chung cư Gamuda</a>&nbsp;The Two&nbsp;hướng nhìn đường vành đai 3, sông Hồng và công viên Yên Sở, Mặt còn lại&nbsp;view Công viên Yên Sở cũng như nhìn vào khu biệt thự với mật độ cây xanh lên tới 50%. Đây cũng là dự án có mật độ xây dựng rất thấp theo tiêu chuẩn Malaysia với khối đế chỉ 50% và khối căn hộ có mật độ xây dựng chỉ 30%.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"sky-gardens-chung-gamuda-gamuda\" class=\"alignnone size-full wp-image-1557\" height=\"520\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/sky-gardens-chung-gamuda-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/sky-gardens-chung-gamuda-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/sky-gardens-chung-gamuda-gamuda-300x195.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/sky-gardens-chung-gamuda-gamuda-768x499.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thêm một khu sân vườn trên tầng 28 dành cho cư dân</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trên tầng 28 sẽ có Sky Garden – Khu vườn trên cao dành cho cư dân ngắm nhìn sông hồng, trung tâm thành phố, tận hưởng không khí trong lành của công viên hồ điều hòa Yên Sở</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Tiến độ xây dựng</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đến thời điểm hiện tại Tháng 06/2017&nbsp;Tòa The two Residence đã thi công đến tầng 22. Nhà thầu thi công Hòa Bình Cam kết tiến độ và chất lượng xây dựng ở mức cao nhất với khách hàng. Cũng trong thời gian này Chủ đầu tư Gamuda Land đã ra thông báo bàn giao căn hộ The One Residence</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-do-xay-dung-chung-cu-gamuda\" class=\"alignnone wp-image-1393 size-full\" height=\"501\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-xay-dung-chung-cu-gamuda-768x481.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Tiến độ chung cư Gamuda\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Tiến độ xây dựng tòa The Two Residence</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"tien-do-chung-cu-the-two-residence\" class=\"alignnone wp-image-1447 size-full\" height=\"612\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence-300x216.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence-768x553.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"tien-do-chung-cu--the-two-residence\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiến độ tháng 11/2016</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-do-chung-cu-the-two-residence\" class=\"alignnone size-full wp-image-2029\" height=\"501\" sizes=\"(max-width: 865px) 100vw, 865px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence-1.jpg 865w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence-1-300x174.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-the-two-residence-1-768x445.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"865\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Toàn bộ tường căn hộ được xây dựng bằng bê tông cốt thép chống ồn</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"tien-do-chung-cu-gamuda-the-two-residence\" class=\"alignnone size-full wp-image-2191\" height=\"541\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-gamuda-the-two-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-gamuda-the-two-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-gamuda-the-two-residence-300x191.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tien-do-chung-cu-gamuda-the-two-residence-768x489.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiến độ chung cư The TWO Residence tháng 4/2017</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Giá&nbsp;bán và tiến độ thanh toán</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các căn hộ chung cư Gamuda có mức giá từ 23 Tr/m2 cho căn 1 phòng ngủ và 24 Triệu/m2 cho căn 2,3 phòng ngủ (bao gồm VAT và nội thất cao cấp)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Tiến độ thanh toán cụ thể:</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 1: Thanh toán 10% kí Hợp đồng mua bán ( Tháng 7/2016 Hoàn thành móng)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 2: Thanh toán 10% khi xong tầng 5 ( Tháng 11/2016)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 3: Thanh toán 5% khi xong tầng 10 (&nbsp;Tháng 2/2017)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 4: Thanh toán 5% khi xong tầng 15&nbsp;(&nbsp;Tháng 5/2017)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 5: Thanh toán 5% khi xong tầng 20&nbsp;(&nbsp;Tháng 8/2017)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 6: Thanh toán 5% khi xong tầng 25&nbsp;(&nbsp;Tháng 11/2017)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 7: Thanh toán 5%&nbsp;khi hoàn thành kết cấu mái của thòa nhà&nbsp;(&nbsp;Tháng 2/2018)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 8: Thanh toán 5%&nbsp;kể từ ngày hoàn thành lắp đặt các cửa căn hộ&nbsp;( Tùy từng tầng)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 9: Thanh toán 2% khi có thông báo nhận bàn giao căn hộ( Qúy II/2018).</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 10&nbsp;đến đợt 22: Thanh toán mỗi tháng 2% trong 12 tháng Sau khi nhận nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt&nbsp;23&nbsp;– 43: Thanh toán mỗi tháng 1% trong 24 tháng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 44: 1% còn lại trong 10 ngày khi có thông báo cấp&nbsp;sổ đỏ.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Được thiết kế đẹp và hướng tới người dùng, cùng với các tiện ích nổi trội và không gian sống xanh lành mạnh. The TWO Residence – sẽ là lựa chọn tốt nhất cho cuộc sống xanh, tiện ích.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Liên Hệ Tư Vấn Thăm Quan dự án</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>', 'BFA with specialization in Painting&amp;amp;lt;br&amp;amp;gt;\r\nBatch: 2010-14', 'null', 'null', 0, 0, 1, -1, 0, 0, 0, 1, '', '', '', 1, 3, '2017-08-06 22:39:11', '2018-07-23 13:59:46');
INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `images2`, `albums`, `description`, `content`, `content2`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(50, 'Sinh Trắc Vân Tay 4.0 là gì? Column 3', 'sinh-trac-van-tay-4-0-la-gi-column-3', '', 47, 'vietnamese', '[\"47\"]', '/uploads/images/bai-viet/img-tin.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p><iframe allow=\"autoplay; encrypted-media\" allowfullscreen=\"\" frameborder=\"0\" height=\"305\" src=\"https://www.youtube.com/embed/0uC86N2D_1s\" width=\"100%\"></iframe></p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">The Zen Residence Khu căn hộ thứ 3 và cũng là những tòa chung cư cuối cùng được xây dựng&nbsp;trong Khu đô thị sinh thái&nbsp;Gamuda Gardens. Tiếp nối thành công của 4&nbsp;tòa chung cư trước,&nbsp;<a href=\"http://gamudagardens.vn/lien-he/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda Land Việt Nam</a>&nbsp;cho ra mắt 3 tòa chung cư được thiết kế tối ưu nhất dành cho cư dân Gamuda.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"chung-cu-the-zen-residence\" class=\"alignnone wp-image-2011 size-full\" height=\"549\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-the-zen-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-the-zen-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-the-zen-residence-300x194.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/chung-cu-the-zen-residence-768x496.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Phối cảnh The ZEN Residence\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh khu căn hộ The Zen Residence</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0); text-align: center;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0);\"><span style=\"box-sizing: inherit; font-size: 18px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit; font-size: 20px;\">Mở bán Tòa B&nbsp;chung cư The ZEN Residence ngày 12/08/2017.&nbsp;</span></span></span></span></strong></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-size: 14pt; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Chính sách bán hàng mới nhất</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; border: 2px dashed red; margin: 10px 0px; border-radius: 5px; background-color: rgb(255, 255, 200); padding: 10px;\">\r\n<div style=\"box-sizing: inherit; margin-left: 18pt;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">&nbsp;Khuyến Mãi Chung&nbsp;</strong>:</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit; text-align: left;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Chiết khấu 6% giá trị căn hộ khi khách hàng đặt mua trong ngày mở bán.</span></li>\r\n	<li style=\"box-sizing: inherit; text-align: left;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">&nbsp;Tiến Độ Thanh Toán :</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khách hàng thanh toán 50% theo tiến độ xây dựng đến khi nhận nhà, 50% còn lại trả chậm trong 24&nbsp;tháng không lãi suất.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Ngân hàng hỗ trợ vay 85% giá trị căn hộ với lãi suất 0% đến khi nhận nhà. Thời hạn vay tới 20 năm.</span></li>\r\n</ul>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chương trình Kỉ niệm 10 năm thành lập Gamuda Land tại Việt Nam, Bốc thăm trúng thưởng xe Suzuki Swift trị giá 550 triệu, 10 Xe Liberty và nhiều phần quà giá trị khác.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>\r\n\r\n<h1 class=\"post-single-content box mark-links entry-content\" style=\"box-sizing: inherit; font-size: 2.57em; margin: 1.5em 0px 0px; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-size: 14pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng quan Khu chung cư&nbsp;The ZEN Residence</span></strong></span></h1>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Dự án: Khu đô thị Sinh thái Gamuda Gardens</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiểu khu: Khu Căn hộ cao tầng CT1 The Zen Residence</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chủ đầu tư: Công ty TNHH Gamuda Land Việt Nam (100% vốn Malaysia)</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vị trí: Km 4,4 Pháp Vân, Yên Sở, Hoàng Mai, Hà Nội.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích dự án: 73 Ha.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích&nbsp;xây dựng chung cư: 14.1 Ha</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Quy mô: Gồm 3 Block chung cư cao 31, 33 và 35&nbsp;tầng. Mỗi sàn có 11 căn hộ, 6&nbsp;thang máy.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích căn hộ: Từ 53&nbsp;– 221&nbsp;m2 ( Từ 1 -3 Phòng ngủ và các căn Penhouse)</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế: 1 Tầng hầm để xe máy, Tầng 1 trung tâm thương mại, tầng 2,3,4 Để xe ô tô, tầng 5 trở lên là khu căn hộ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khởi công: Qúy I/2017</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bàn giao: Dự kiến quý II/2019</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"the-zen-residence\" class=\"alignnone wp-image-1493 size-full\" height=\"612\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/11/the-zen-residence-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/11/the-zen-residence-1.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/11/the-zen-residence-1-300x216.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/11/the-zen-residence-1-768x553.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Phối cảnh Chung cư The ZEN Residence\" width=\"850\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chung cư&nbsp;The ZEN&nbsp;Residence&nbsp;nhìn từ đường vành đai 3</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn hộ chung cư The ZEN&nbsp;Residence</span></strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Căn hộ The ZEN Residence được thiết kế hợp lí, toàn bộ căn hộ đều đón được ánh sáng tự nhiên, chủ đầu tư Gamuda&nbsp;luôn dẫn đầu trong thiết kế của căn hộ phong cách xẻ khe, áp dụng theo phong cách Singapore luôn được sử dụng trong các thiết kế của Gamuda&nbsp;nhờ sự ưu việt của chúng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"thiet-ke-canh-quan-chung-cu-the-zen-residence\" class=\"alignnone wp-image-1494 size-full\" height=\"601\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-canh-quan-chung-cu-the-zen-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-canh-quan-chung-cu-the-zen-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-canh-quan-chung-cu-the-zen-residence-300x212.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-canh-quan-chung-cu-the-zen-residence-768x543.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"The ZEN Residence Gamuda\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">The ZEN&nbsp;Residence là tổ hợp gồm 3 tòa chung cư</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">The ZEN Residence đa dạng về diện tích, phù hợp với nhu cầu và lối sống khác nhau của các hộ gia đình. Căn hộ studio một phòng ngủ là lựa chọn hợp lý cho vợ chồng trẻ mới kết hôn. Căn 2 đến 3 phòng ngủ và căn penthouse hợp với gia đình nhiều thế hệ, những ai muốn có không gian sinh hoạt chung rộng rãi mà vẫn có không gian riêng cho từng thành viên trong gia đình</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"thiet-ke-chung-cu-the-zen-residence\" class=\"alignnone wp-image-1460 size-full\" height=\"619\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-chung-cu-the-zen-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-chung-cu-the-zen-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-chung-cu-the-zen-residence-300x218.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/11/thiet-ke-chung-cu-the-zen-residence-768x559.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Thiết kế chung cư Gamuda The ZEN\" width=\"850\" /></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Một số điểm nổi trội trong thiết kế chung cư The ZEN Residence:</span></strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Mỗi căn đều có 2 khu vực lô-gia, một nối với bếp, một nối với phòng khách, giúp chủ nhà có thể sử dụng linh hoạt để trồng cây, làm không gian uống cà phê, đọc sách.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Thiết kế giếng trời, ánh sáng tự nhiên ở tất cả các phòng, không gian sống hòa hợp với thiên nhiên.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Mật độ căn hộ trên 1 tầng rất thấp, chỉ 11 căn hộ, không gian xung quanh rất thoáng cho thấy chủ đầu tư đã hy sinh lợi ích rất nhiều để tạo nên không gian, cảnh quan tốt cho cư dân.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Mọi phòng ngủ đều tiếp xúc trực tiếp với ánh sáng tự nhiên, thiết kế đặc biệt với tầm nhìn thoáng, tận hưởng không gian sống lý tưởng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Bãi đỗ xe cực rộng với 4 tầng để xe đảm bảo chỗ đỗ xe oto trong tương lai&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Hệ thống cảm biến khói, báo cháy, chữa cháy tiêu chuẩn quốc tế.&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Hệ thống an ninh 3 lớp&nbsp;gồm bảo vệ 24/24, Cư dân ra vào bằng thẻ từ và Camera&nbsp;ở sảnh và hành lang các tầng căn hộ</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">– Phòng thu gom rác khép kín.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\">Mặt bằng căn hộ The ZEN Residence</span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mỗi tòa chung cư The ZEN Residence chỉ có 11 căn/1 sàn. Thiết kế 6&nbsp;thang máy Mitsubishi đảm bảo cho cư dân di chuyển nhanh chóng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"Mat-bang-toa-A-the-zen-residence\" class=\"alignnone wp-image-2044 size-full\" height=\"631\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/11/Mat-bang-toa-A-the-zen-residence.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/11/Mat-bang-toa-A-the-zen-residence.png 850w, http://gamudagardens.vn/wp-content/uploads/2016/11/Mat-bang-toa-A-the-zen-residence-300x223.png 300w, http://gamudagardens.vn/wp-content/uploads/2016/11/Mat-bang-toa-A-the-zen-residence-768x570.png 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng Tòa A khu căn hộ The ZEN Residence</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"The ZEN-GAMUDA-thiet-ke-can-1-phong-ngu\" class=\"alignnone size-full wp-image-2046\" height=\"572\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/11/The-ZEN-GAMUDA-thiet-ke-can-1-phong-ngu.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/11/The-ZEN-GAMUDA-thiet-ke-can-1-phong-ngu.png 850w, http://gamudagardens.vn/wp-content/uploads/2016/11/The-ZEN-GAMUDA-thiet-ke-can-1-phong-ngu-300x202.png 300w, http://gamudagardens.vn/wp-content/uploads/2016/11/The-ZEN-GAMUDA-thiet-ke-can-1-phong-ngu-768x517.png 768w, http://gamudagardens.vn/wp-content/uploads/2016/11/The-ZEN-GAMUDA-thiet-ke-can-1-phong-ngu-272x182.png 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế căn 1 phòng ngủ +1</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"mat-bang-can-2-phong-ngu-chung-cu-the-zen\" class=\"alignnone size-full wp-image-2045\" height=\"724\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"h