oto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-size: 14pt; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Tiện ích cho cư dân chung cư gamuda</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với nhiều đột phá trong thiết kế. Các tiện ích cho cuộc sống hiện đại sẽ có ngay ở trong khối đế 5 tầng của khu chung cư gồm bể bơi ngoài trời, khu vui chơi dành riêng cho trẻ em, Khu dạo bộ, trung tâm thương mại, nhà hàng, Cafe, Phòng Gym…</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-ich-chung-cu-the-zen-residence\" class=\"alignnone wp-image-1487 size-full\" height=\"563\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/11/tien-ich-chung-cu-the-zen-residence.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/11/tien-ich-chung-cu-the-zen-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/11/tien-ich-chung-cu-the-zen-residence-300x199.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/11/tien-ich-chung-cu-the-zen-residence-768x509.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Tiện ích chung cư The ZEN Residence\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hồ bơi và khu công viên trên tầng 5</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img 