</li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ: 5 phòng + 1 phòng ngủ cho giúp việc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng tắm: 06 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thời hạn sử dụng đất: Sổ đỏ&nbsp;vĩnh viễn</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đầy đủ các hướng: Bắc,&nbsp;Đông Bắc, Tây Nam, Tây Bắc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ 55 đến 65&nbsp;triệu/m2( Tùy từng vị trí và diện tích) chưa trừ chiết khấu.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tình trạng: Đang xây dựng, Dự kiến bàn giao Quý II/2018.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"hinh-anh-biet-thu-song-lap-gamuda-loai-moi\" class=\"alignnone wp-image-1002 size-full\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi-768x480.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Thiết kế biệt thự song lập Gamuda Gardens\" width=\"800\" /></p>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giếng trời tọa lạc tại giữa ngôi nhà là điểm nhấn tinh tế trong tổng thể kiến trúc của Song Lập Courtyard Homes. Vừa mang ý đồ nghệ thuật, vừa đảm bảo lưu chuyển nguồn năng lượng và hơi thở của thiên nhiên hòa quyện với không gian sống, thiết kế giếng trời còn giúp cho gia chủ có cơ hội mở rộng diện tích sinh hoạt trong sinh hoạt.</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 14pt; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Tiện ích cho cư dân&nbsp;biệt thự song lập Gamuda – Courtyard Homes</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"tien-ich-khu-do-thi-gamuda-gardens\" class=\"alignnone wp-image-722 size-large\" height=\"341\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens-1024x341.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Tiện ích cho cư dân Gamuda Gardens\" width=\"1024\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các tiện ích cho cư dân Khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">An cư tại khu đô thị Gamuda gardens, cư dân được tận hưởng không gian sống xanh, yên bình, cộng đồng thân thiện và tiện ích khéo kín bao gồm: Câu lạc bộ Gamuda Gardens, bể bơi tiêu chuẩn quốc tế, sân tennis, sân bóng chuyền, phòng gym, nhà hàng, hội thảo…. hệ thống nhà phố thương mại vứoi đa dạng các cửa hàng ăn uống, quán cafe, siêu thị. Trường liên cấp quốc tế Singapore (SIS).</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"biet-thu-gamuda-gardens-courtyard-homes\" class=\"alignnone wp-image-525 size-full\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes-768x480.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Không gian xanh khu biệt thự song lập Coutyard\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Không gian sống xanh trong khu biệt thự song lập Gamuda loại mới</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 14pt; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Hình ảnh thực tế&nbsp;biệt thự song lập Gamuda đ