(53, 'Thực hư dịch vụ sinh trắc vân tay “giải mã”', 'thuc-hu-dich-vu-sinh-trac-van-tay-giai-ma', '', 33, 'vietnamese', '[\"33\"]', '/uploads/images/bai-viet/img-tin.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>“Sức khỏe của mẹ và bé yêu vô cùng quan trọng trong suốt quá trình mang thai, sinh nở. Để bé phát triển toàn diện ngay từ khi còn trong bụng mẹ cho tới lúc chào đời, đồng thời, để thai phụ có thể vượt cạn an toàn thì một chế độ chăm sóc, nuôi dưỡng khoa học, có sự theo dõi, tư vấn và hỗ trợ của các chuyên gia, bác sỹ là rất cần thiết. Để bé phát triển toàn diện ngay từ khi còn trong bụng mẹ cho tới lúc chào đời, đồng thời, để thai phụ có thể vượt cạn an toàn thì một chế độ chăm sóc, nuôi dưỡng khoa học, có sự theo dõi, tư vấn và hỗ trợ của các chuyên gia, bác sỹ là rất cần thiết.”</p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Gamuda Land Mở bán 23 Căn Biệt thự Đơn lập khu đô thị Gamuda Gardens&nbsp;</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<div style=\"box-sizing: inherit; border: 2px dashed red; margin: 10px 0px; border-radius: 5px; background-color: rgb(255, 255, 200); padding: 10px;\">\r\n<div style=\"box-sizing: inherit; margin-left: 18pt;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">Tiến Độ Thanh Toán:</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thanh toán trả chậm 3&nbsp;năm 0% lãi suất.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khách hàng được Chủ Đầu Tư hỗ trợ tự xây theo thiết kế riêng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">Khuyến Mãi Chung:</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tặng 3 năm phí quản lý và 3 năm phí sử dụng câu lạc bộ Clubhouse.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"biet-thu-don-lap-gamuda-gardens\" class=\"alignnone wp-image-851 size-full\" height=\"533\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-768x512.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự gamuda gardens\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà mẫu biệt thự đơn lập Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Biệt thự đơn lập Gamuda có gì cho bạn?</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Biệt thự đơn lập Gamuda hay còn gọi là biệt thự Mansions – một thiết kế tinh tế và đẳng cấp dành cho các chủ nhân ưa thích không gian sống thanh bình theo phong cách nghỉ dưỡng.</span><br style=\"box-sizing: inherit;\" />\r\n<span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đúng như tên gọi “Mansions”, mỗi căn biệt thự có một không gian mở với sân phía trước, vườn nằm phía sau, tiểu cảnh bên hiên nhà, ôm trọn cuộc sống của gia chủ trong sự thoải mái và giao hòa cùng thiên nhiên. Tầng một với phòng khách, phòng ăn, bếp khô và bếp ướt cùng phòng ngủ cho người già. trong khi các tầng trên là các phòng ngủ riêng khéo léo kết hợp với các không gian chung như phòng khách nhỏ, phòng sinh hoạt chuoung, góc làm việc và đọc sách, góc thư giãn ngoài ban công.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"biet-thu-don-lap-gamuda-gardens\" class=\"alignnone wp-image-879 size-full\" height=\"600\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1-300x225.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-thu-don-lap-gamuda-gardens-1-768x576.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự đơn lập Gamuda\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt trước biệt thự Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit;\">Tận dụng lợi thế của một</span>&nbsp;biệt thự đơn lập&nbsp;<span style=\"box-sizing: inherit;\">với 4 mặt thoáng, thiết kế công năng của tất cả các phòng và khu vực chức năng đều tận dụng tối đa nguồn ánh sáng và gió tự nhiên. Điểm nhấn của biệt thự Gamuda nằm ở khu vực giếng trời chính giữa ngôi nhà, vừa thể hiện ý đồ kiến trúc, vừa luân chuyển nguồn năng lượng, điều hòa không khí và ánh sáng cho toàn bộ căn nhà.</span></span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Thiết kế của Biệt Thự Đơn Lập có gì hấp dẫn</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thiết kế độc đáo, khoa học với không gian mở vẫn là những ưu điểm chính trong cách thiết kế tại Biệt thự Gamuda Garden :</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"mat-bang-biet-thu-gamuda\" class=\"alignnone wp-image-460 size-full\" height=\"534\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda-768x513.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-biet-thu-gamuda-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Mặt bằng thiết kế biệt thự đơn lập\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế các tầng biệt thự đơn lập</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"mat-bang-khu-biet-thu-don-lap-gamuda\" class=\"alignnone\" data-id=\"1497\" height=\"767\" src=\"http://gamudacityhanoi.com/media/1248/khu-biet-thu-don-lap-gamuda-garden.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Mặt bằng khu biệt thự đơn lập\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng khu biệt thự đơn lập</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Thông số kĩ thuật:</strong></span></h3>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<div style=\"box-sizing: inherit;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích đất : 288m2-500m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích xây dựng 3 tầng: 408m2 – 418 m2</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước: Mặt tiền từ 12-18m. Chiều sâu nhà : 24m</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ: 5 phòng + 1 phòng ngủ cho giúp việc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng tắm: 06 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tầng hầm : 01 hầm</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thời hạn sử dụng đất: Sổ đỏ vĩnh viễn</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đầy đủ các hướng: Bắc, Đông Bắc, Tây Nam, Tây Bắc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ 56 đến 65 triệu/m2( Tùy từng vị trí và diện tích) chưa trừ chiết khấu.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Ngoài ra khách hàng có thể tự thiết kế mẫu biệt thự cho mình.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tình trạng: Hoàn thiện xong&nbsp;hạ tầng, đã bàn giao mặt bằng cho khách hàng tự xây dựng.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">LIÊN HỆ TRỰC TIẾP PHÒNG DỰ ÁN GAMUDA</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Hình ảnh thực tế của biệt thự đơn lập Gamuda Gardens</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"biet-thu-don-lap-gamuda-gardens\" class=\"alignnone wp-image-1678 size-full\" height=\"640\" sizes=\"(max-width: 960px) 100vw, 960px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-don-lap-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-don-lap-gamuda-gardens.jpg 960w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-don-lap-gamuda-gardens-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-don-lap-gamuda-gardens-768x512.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-don-lap-gamuda-gardens-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự đơn lập Gamuda Gardens\" width=\"960\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Không gian xanh khu biệt thự đơn lập</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"biet-thu-gamuda-gardens\" class=\"alignnone size-full wp-image-2077\" height=\"566\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-768x511.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khoảng sân vườn rộng rãi</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"khu -vui choi-cho -tre-nho\" class=\"alignnone\" data-id=\"1626\" height=\"574\" src=\"http://gamudacityhanoi.com/media/1362/khu-vui-choi-gamuda-garden.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Khu vui chơi gamuda gardens\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu vui chơi rộng rãi</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"biet-biet-thu-don-lap-gamuda\" class=\"alignnone wp-image-1682 size-full\" height=\"640\" sizes=\"(max-width: 960px) 100vw, 960px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-biet-thu-don-lap-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/biet-biet-thu-don-lap-gamuda.jpg 960w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-biet-thu-don-lap-gamuda-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-biet-thu-don-lap-gamuda-768x512.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/biet-biet-thu-don-lap-gamuda-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Không gian xanh tại Gamuda Gardens\" width=\"960\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Không gian xanh mát, thoáng đoãng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"phong-bep-biet-thu-gamuda\" class=\"alignnone wp-image-742 size-full\" height=\"533\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phong-bep-biet-thu-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phong-bep-biet-thu-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-bep-biet-thu-gamuda-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-bep-biet-thu-gamuda-768x512.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/phong-bep-biet-thu-gamuda-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Khu vực bếp Biệt thự Gamuda\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng bếp hòa cùng Thiên Nhiên</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"goc-hoc-tap\" class=\"alignnone wp-image-880 size-full\" height=\"529\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/goc-hoc-tap.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/goc-hoc-tap.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/goc-hoc-tap-300x198.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/goc-hoc-tap-768x508.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự gamuda - Phòng làm việc\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng làm việc rộng rãi, sáng tạo</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"phong-ngu-biet-thu-gamuda\" class=\"alignnone\" data-id=\"1552\" height=\"532\" src=\"http://gamudacityhanoi.com/media/1294/phong-ngu-tang-2-biet-thu-gamuda.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Phòng ngủ biệt thự đơn lập gamuda\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ tràn ngập ánh sáng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trong đợt mở bán này, Có rất nhiều ưu đãi cho khách hàng liên hệ sớm, ngoài được lựa chọn vị trí, hướng căn hộ, khách hàng còn được hưởng nhiều chính sách ưu đãi của chủ đầu tư Gamuda Land Việt Nam</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hãy chọn cho mình một căn biệt thự Gamuda để an nhàn tuổi già hay chỉ đơn giản là được trở về cuộc sống thư thái sau những giờ làm việc căng thẳng. Hãy sống ở&nbsp;<a href=\"http://gamudagardens.vn/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda Gardens</a>&nbsp;để tận hưởng cuộc sống đích thực mà bạn đáng được hưởng thụ.</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Liên hệ Phòng dự án Gamuda</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>', '', 'null', 'null', 0, 27, 1, -1, 0, 0, 0, 1, '', '', '', 1, 3, '2017-08-06 23:05:24', '2018-07-23 14:02:01'),
(54, 'Thông tin chi tiết 1', 'thong-tin-chi-tiet-1', '', 33, 'vietnamese', '[\"33\"]', '/uploads/images/bai-viet/img-tin.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>“Sức khỏe của mẹ và bé yêu vô cùng quan trọng trong suốt quá trình mang thai, sinh nở. Để bé phát triển toàn diện ngay từ khi còn trong bụng mẹ cho tới lúc chào đời, đồng thời, để thai phụ có thể vượt cạn an toàn thì một chế độ chăm sóc, nuôi dưỡng khoa học, có sự theo dõi, tư vấn và hỗ trợ của các chuyên gia, bác sỹ là rất cần thiết. Để bé phát triển toàn diện ngay từ khi còn trong bụng mẹ cho tới lúc chào đời, đồng thời, để thai phụ có thể vượt cạn an toàn thì một chế độ chăm sóc, nuôi dưỡng khoa học, có sự theo dõi, tư vấn và hỗ trợ của các chuyên gia, bác sỹ là rất cần thiết.”</p>\r\n\r\n<p>&nbsp;</p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT CHO SẢN PHẨM SHOPHOUSE THE ONE CENTRAL</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">&nbsp;Tiến Độ Thanh Toán :</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thanh toán 50% theo tiến độ xây dựng đến khi nhận nhà, 50% còn lại thanh toán trả chậm trong vòng 2-5 năm;0% lãi suất.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(255, 0, 0);\"><strong style=\"box-sizing: inherit;\">&nbsp;Khuyến Mãi Chung:</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tặng 01 &nbsp;năm phí sử dụng câu lạc bộ Clubhouse.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tri ân khách hàng 2- 7% chỉ áp dụng đến 31/9/2016.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với Block 3 khách hàng được hoàn thêm 434 triệu tiền xây dựng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhằm đem lại nhiều hơn nữa những tiện ích sẵn có cho cư dân khu đô thị Gamuda Gardens, chủ đầu tư Gamuda Land Việt Nam giới thiệu khu nhà phố thương mại The ONE Central với mô hình hoàn toàn mới tại Việt Nam – Mô hình nhà phố khởi nghiệp.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"the-one-central-shophouse\" class=\"alignnone size-full wp-image-1283\" height=\"450\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse-300x169.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse-768x432.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh Nhà phố Kinh doanh The One Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tọa lạc tại một trong những vị trí chiến lược nhất của khu đô thị&nbsp;<a href=\"http://gamudagardens.vn/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda Gardens</a>, một mặt hướng ra đường Vành đai 3, The ONE Central với 44 căn nhà phố bao quanh chung cư The ONE Residence sẽ cung cấp tiện ích không chỉ cho hơn 600 hộ gia đình sống tại chung cư mà còn gần 1000 giáo viên, học sinh trường liên cấp quốc tế Singapore. Giờ đây, chỉ cách vài bước đi bộ, cư dân hoàn toàn có thể trải nghiệm các dịch vụ đẳng cấp sẵn có mà không cần phải đi đâu xa.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">&nbsp;<img alt=\"vi-tri-nha-pho-thuong-mai-the-two-cen-tral\" data-id=\"1692\" src=\"http://gamudacityhanoi.com/media/1407/vi-tri-shop-house-gamuda.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vị trí dãy Nhà Phố số 1 The One Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hướng tới những doanh nghiệp trẻ mới khởi nghiệp và những công ty gia đình quy mô nhỏ, The&nbsp;ONE&nbsp;Central đem đến một không gian sống kết hợp kinh doanh linh hoạt với diện tích thiết thực cho giai đoạn khởi đầu. Toàn bộ nửa trước ngôi nhà sẽ được hoàn thiện với kết cấu hợp lý trong khi nửa không gian trống phía sau được thiết kế mở để các gia đình thỏa sức sử dụng theo nhu cầu riêng. Đó có thể là quầy café-bar ngoài trời hoặc khu vui chơi nhỏ cho trẻ em. Và bất cứ khi nào cần, gia chủ có thể hoàn thiện nốt mà vẫn đảm bảo không phá vỡ kết cấu của ngôi nhà. Kiểu thiết kế này giúp người mua tối ưu hóa diện tích xây dựng khi chưa có nhu cầu sử dụng toàn bộ, đưa lại mức chi phí hợp lý hơn, giảm thiểu áp lực kinh tế trong giai đoạn khởi đầu.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"the-one-central-shop-house-gamuda\" data-id=\"1697\" src=\"http://gamudacityhanoi.com/media/1411/the-one-central-gamuda-gardens.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Không chỉ vậy, The ONE Central được thiết kế linh hoạt với từng đường nét, họa tiết, chất liệu mang hơi hướng tối giản mà hiện đại, hài hòa với cảnh quan thiên nhiên và kiến trúc của những hạng mục khác. Khu nhà phố này được dự kiến bàn giao cho khách hàng và sẵn sàng đi vào hoạt động từ giữa năm 2017, ngay sau khi hoàn thiện chung cư The ONE Residence.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"tiem-nang-kinh-doanh-shophouse-gamuda\" data-id=\"1693\" src=\"http://gamudacityhanoi.com/media/1408/tien-nang-shop-house-gamuda.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiềm năng của Nhà phố thương mại Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">The One Central: tiềm năng không thua kém so với The Three Central, The One Central mặc dù đang trong quá trình xây dựng song nơi đây cũng được đánh giá là điểm đầu cơ sinh lời hấp dẫn trong tương lai. Theo đó The One Central sẽ là nơi cung cấp đầy đủ tiện nghi cho một cộng đồng&nbsp; văn minh, hiện đại bao gồm 15000 cư dân có mức thu nhập cao tại Gamuda Gardens, gấn 1000 học sinh và giáo viên của trường quốc tế SIS Singapore, hơn 600 hộ gia đình tại khu căn hộ The One Residence.. và phục vụ lượng lớn khách hàng sinh sống tại khu vực lân cận quận Hoàng Mai cũng như di chuyển trên đường Vành đai 3.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Thông số kĩ thuật</strong></span></h3>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<div style=\"box-sizing: inherit;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khởi công : Quý I/2015.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Dự kiến bàn giao : Quý IV/2016.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng số căn : 44 căn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích đất: Từ 127 – 133 – 388m2</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích xây dựng 4 tầng: Từ 260 – 340 – 944 m2</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bố trí tầng : Tầng 1 và tầng 2 để kinh doanh, tầng 3 và tầng 4 để ở.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng vệ sinh: 06 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước tiêu chuẩn : 5.5 X 23.5 M.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hình thức sử hữu: Sổ đỏ vĩnh viễn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ&nbsp;90 triệu/m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng giá : Từ&nbsp;10.5 tỷ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mức độ hoàn thiện : Hoàn thiên mặt ngoài và bàn giao cơ bản.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mật độ xây dựng : 65 %</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"mat-bang-thiet-ke-nha-pho-gamuda-the-one-central\" data-id=\"1690\" src=\"http://gamudacityhanoi.com/media/1402/mat-bang-nha-pho-gamuda-the-one-central.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế nhà phố The One Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"vi-tri-shophhouse-gamuda-gardens\" data-id=\"1696\" src=\"http://gamudacityhanoi.com/media/1410/vi-tri-shophouse-gamuda-the-one-central.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Sắp xếp các căn Nhà phố The One Central</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Tiến độ thanh toán</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 1: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần móng và ký kết Hợp Đồng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">(Thanh toán các đợt theo tiến độ xây dựng – Có thông báo khi hoàn thành các hạng mục trước 21 ngày.)</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 2: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần khung bê tông, cốt thép của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 3: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần tường của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 4: Thanh toán 10% giá trị HĐMB – Ngay sau khi hoàn thành phần mái và các phần che phủ của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 5: Thanh toán 5% giá trị HĐMB – Ngay sau khi hoàn thành phần trát bên ngoài của căn nhà.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 6: Thanh toán 5% giá trị HĐMB – Ngay sau khi hoàn thành hệ thống đường phục vụ cho căn nhà</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 7: Thanh toán 25% giá trị HĐMB – Ra thông báo bàn giao và hệ thống điện nước của căn nhà đã sẵn sang kết nối.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 8: Thanh toán 10% giá trị HĐMB – 30 ngày kể từ ngày bàn giao theo thông báo.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 9: Thanh toán 10% giá trị HĐMB – 60 ngày kể từ ngày bàn giao theo thông báo.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Lần 10: Thanh toán 5% giá trị HĐMB – Nhận sổ đỏ.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">The One Central đang trong giai đoạn mở bán những đợt đâu tiên. Hãy nhanh tay là những khách hàng đầu tiên sở hữu những căn nhà phố có vị trí đẹp nhất và được chiết khấu lên tới 6% cho những khách hàng đầu tiên.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Tiến độ&nbsp;xây dựng</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các căn Nhà phố đang có tiến độ tốt. Sẽ bàn giao cho cư dân cùng thời điểm bàn giao Chung cư The One Residence. Thời gian bàn giao vào quý IV/2016</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"tien-do-xay-dung-nha-pho-thuong-mai-gamuda\" data-id=\"1694\" src=\"http://gamudacityhanoi.com/media/1409/tien-do-day-nh-pho-gamuda-the-one-central.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà phố The One đã xong khung và Chung cư The One Residence đang hoàn thiện</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Liên hệ để nhận&nbsp;thêm thông tin chi tiết</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>', '530', 'null', 'null', 0, 17, 1, 0, 0, 1, 0, 1, '', '', '', 1, 3, '2017-08-06 23:15:19', '2018-12-10 09:10:48');
