(55, 'Đặc điểm dòng 3', 'dac-diem-dong-3', '', 44, 'vietnamese', '[\"44\"]', '/uploads/images/products/hb-0381-4.jpg', '', '\"\"', '<p>Lầu 13, Tòa nhà M-H, Số 728 Võ Văn</p>\r\n\r\n<p>Kiệt, P.1, Quận 5, TP Hồ Chí Minh</p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT CHO SẢN PHẨM SHOPHOUSE THE TWO&nbsp;CENTRAL</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">&nbsp;Tiến Độ Thanh Toán :</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Khách hàng thanh toán trả chậm trong vòng 3 năm 0% lãi suất.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">&nbsp;Khuyến Mãi Chung&nbsp;</strong>:</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chiết khấu 5% chỉ trong tháng 07/2017</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Ưu đãi kỷ niệm 10 năm thành lập Gamuda Land tại Việt Nam&nbsp;Tặng 10 xe Libety và&nbsp;nhiều phần quà có giá trị.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Tặng 1 năm phí sử dụng câu lạc bộ Clubhouse.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Miễn giảm 10% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Shophouse là một loại hình nhà ở kết hợp với cửa hàng&nbsp;kinh doanh, loại hình&nbsp;này chỉ mới xuất hiện tại Việt Nam cách đây vài năm, nhưng hiệu quả đầu tư lại khá cao. Thông thường Shophouse có ưu điểm về thiết kế&nbsp;sẻ khe đem lại nhiều không gian sử dụng. Các căn hộ shophouse có một hoặc hai mặt tiền trong những dự án chung cư cao tầng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trong khu đô thị Gamuda Các căn hộ Shophouse có tiềm năng kinh doanh rất lớn khi phục vụ hơn 12000 cư dân có thu nhập cao trong Khu đô thị. Ngoài ra Môi trường sống tốt cũng như tiện ích đồng bộ vẫn là lựa chọn hoàn hảo cho một tổ ấm tại nơi đây.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Vị trí Shophouse Gamda trong khu đô thị&nbsp;</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"vi-tri-shophouse-gamuda-gardens\" class=\"alignnone size-full wp-image-1573\" height=\"557\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens-300x209.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/vi-tri-shophouse-gamuda-gardens-768x535.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Vị trí Dãy nhà Phố The Two Central</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"box-sizing: inherit;\">Tọa lạc tại một trong những vị trí chiến lược nhất của khu đô thị</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda Gardens</a>,&nbsp;<span style=\"box-sizing: inherit;\">một mặt hướng ra đường Vành đai 3, mặt còn lại hướng vào tòa nhà Chung cư The Two Residence 550 căn hộ với khoảng 2000 cư dân sinh sống.</span></span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">&nbsp;Ưu điểm của các căn nhà Phố The Two Central</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Diện tích căn hộ đa dạng với chỉ từ 7 tỷ/căn</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Vừa có thể để ở vừa có thể kinh doanh, làm Văn phòng</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Cơ hội kinh doanh lớn khi phục vụ tới 15000 Cư dân có mức thu nhập cao trong Khu đô thị</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Tận hưởng mọi tiện tích trong khu đô thị Gamuda Gardens như khu nhà Clubhouse, trường học quốc tế, bệnh viện quốc tế, khu bể bơi, sân chơi thể thao…</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tiem-nang-nha-pho-thuong-mai-gamuda\" class=\"alignnone size-full wp-image-1575\" height=\"592\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tiem-nang-nha-pho-thuong-mai-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tiem-nang-nha-pho-thuong-mai-gamuda.jpg 900w, http://gamudagardens.vn/wp-content/uploads/2016/05/tiem-nang-nha-pho-thuong-mai-gamuda-300x197.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/tiem-nang-nha-pho-thuong-mai-gamuda-768x505.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"900\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Tiềm năng nhà Phố thương mại Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">&nbsp;Quy mô và thiết kế</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Toàn bộ nửa trước ngôi nhà sẽ được hoàn thiện với kết cấu hợp lý</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Nửa không gian trống phía sau được thiết kế mở để các gia đình thỏa sức sử dụng theo nhu cầu riêng như quầy cafe-bar ngoài trời hoặc khu vui chơi nhỏ cho trẻ em.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">+ Và bất cứ khi nào cần, gia chủ có thể hoàn thiện nốt mà vẫn đảm bảo không phá vỡ kết cấu của ngôi nhà</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"box-sizing: inherit;\">+ Từng đường nét, họa tiết, chất lượng của của</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">The Two Central</a>&nbsp;<span style=\"box-sizing: inherit;\">mang hơi hướng tối giản mà hiện đại, hòa hợp với cảnh quan thiên nhiên và kiến trúc của hạng mục khác.</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">-&gt; Kiểu thiết kế này giúp người mua tối ưu hóa diện tích xây dựng khi chưa có nhu cầu sử dụng toàn bộ, đưa lại mức chi phí hợp lý hơn, giảm thiểu áp lực kinh tế trong giai đoạn khởi đầu.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Với 55 căn nhà shophouse, The Two&nbsp;Central sẽ là tổ hợp thương mại của khu căn hộ The Two nói riêng và khu đô thị Gamuda Gardens nói chung.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Tại The Two Central mỗi căn nhà được thiết kế với diện tích 75 – 128m² đất xây dựng và 268 đến 782 m2 sàn/ 4 tầng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"mat-bang-can-ho-nha-pho-gamuda\" class=\"alignnone size-full wp-image-1449\" height=\"553\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-can-ho-nha-pho-gamuda-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-can-ho-nha-pho-gamuda-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-can-ho-nha-pho-gamuda-1-300x207.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/mat-bang-can-ho-nha-pho-gamuda-1-768x531.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Mặt bằng Căn nhà phố điển hình</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">+ Thông số kĩ thuật</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Diện tích đất: Từ 75 – 300m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Diện tích xây dựng 4 tầng: Từ 264m2 – 400m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Thiết kế : Tầng 1 và tầng 2 để kinh doanh và tầng 4 để ở .</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Phòng vệ sinh: 05 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Kích thước tiêu chuẩn : Từ&nbsp; 5. X 15 M.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Hình thức sử hữu: Sổ đỏ vĩnh viễn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Giá bán: Từ&nbsp;90 triệu/m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Tổng giá : Từ&nbsp;7 – 15 tỷ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Mức độ hoàn thiện : Hoàn thiên mặt ngoài và bàn giao cơ bản.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Tình trạng: Dự kiến bàn giao vào Quý I/2018.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Mật độ xây dựng : 65 %.</span></li>\r\n</ul>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Như vậy chỉ Từ 7tỷ ( Đã có VAT) Qúy khách có thể sở hữu 1 căn shophouse đa dụng tại Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Dịch vụ của các căn nhà phố thương mại Gamuda</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><img alt=\"nha-pho-kinh-doanh-quan-hoang-mai\" class=\"alignnone size-full wp-image-771\" height=\"660\" sizes=\"(max-width: 780px) 100vw, 780px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-kinh-doanh-quan-hoang-mai.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-kinh-doanh-quan-hoang-mai.png 780w, http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-kinh-doanh-quan-hoang-mai-300x254.png 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-kinh-doanh-quan-hoang-mai-768x650.png 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"780\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các&nbsp;mảng kinh doanh Của Nhà Phố Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Khu nhà phố thương mại sẽ đáp ứng và cung cấp những dịch vụ tiện ích hàng ngày bao gồm:</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Ngân hàng, siêu thị mini, nhà hàng, cửa hàng đồ gia dụng, cửa hàng thời trang, trung tâm chăm sóc sức khỏe, nha khoa, nhà thuốc, tiệm làm tóc, chăm sóc sắc đẹp, trung tâm đào tạo…Nhà phố thương mại The TWO Residence mang đến cho cộng đồng cư dân trong khu đô thị một tiện ích hoàn hảo, mang đến các dịch vụ đa dạng và nguồn cung hàng hóa dồi dào cho nhu cầu hàng ngày của cư dân</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Hình ảnh Các căn nhà phố The Two Central</strong></span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"chung-cu-the-two-residence-1\" class=\"alignnone size-full wp-image-482\" height=\"567\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/chung-cu-the-two-residence-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/chung-cu-the-two-residence-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/chung-cu-the-two-residence-1-300x213.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/chung-cu-the-two-residence-1-768x544.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các căn nhà phố Xung quanh Tòa Chung cư The Two Residence</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; colo