(56, 'Đặc điểm dòng 2', 'dac-diem-dong-2', '', 44, 'vietnamese', '[\"44\"]', '/uploads/images/products/img-sp1.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Lầu 13, Tòa nhà M-H, Số 728 Võ Văn</p>\r\n\r\n<p>Kiệt, P.1, Quận 5, TP Hồ Chí Minh</p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Tổng quan về Shophouse Gamuda Garden</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Shophouse hay Nhà phố thương mại là mô hình kinh doanh được ưa chuộng ở các đô thị Châu Âu và Mỹ từ cách đây rất lâu, sau đó xuất hiện ở Châu Á và ngày càng được “trọng vọng” tại các thành phố lớn của Đông Nam Á.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"nha-pho-thuong-mai-shop-house\" class=\"alignnone size-full wp-image-740\" height=\"600\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-thuong-mai-shop-house.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-thuong-mai-shop-house.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-thuong-mai-shop-house-300x225.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-thuong-mai-shop-house-768x576.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"box-sizing: inherit;\">Nắm bắt được xu hướng trên, Tập đoàn Gamuda đã mang dòng sản phẩm shop house vốn đã quen thuộc ở Malaysia đến Gamuda City. Nhà phố thương mại</span>&nbsp;<b>shophouse gamuda&nbsp;</b><span style=\"box-sizing: inherit;\">như một “sự nâng cấp” của nhà phố truyền thống với ưu điểm về quy hoạch, hạ tầng, giá trị thương mại và không gian chức năng hợp lý hơn. Hơn nữa, chức năng “kép” – vừa kinh doanh, vừa sinh hoạt thuận tiện “một bước ra phố” là ưu điểm nổi trội của loại hình bất động sản này. Nhờ đó, shophouse có giá trị thương mại cao mà vẫn phù hợp với tập quán sinh hoạt lâu đời cũng như mô hình kinh tế vừa và nhỏ của người Việt. Sự xuất hiện của Shophouse Gamuda sẽ trở thành sự lựa không thể bỏ qua cho các nhà kinh doanh năng động và thành đạt.</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"the-one-central-shophouse\" class=\"alignnone size-full wp-image-1283\" height=\"450\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse-300x169.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse-768x432.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các khu nhà phố xung quanh các tòa chung cư Gamuda The One Residence</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Vị Trí Nhà phố trong khu đô thị</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các căn ShopHouse Gamuda nằm tại vị trí chiến lược trong Gamuda Gardens. Nằm ở vị trí đẹp nhất trong khu đô thị ( 3 cổng chính vào trong khu đô thị), xung quanh 3 khối nhà chung cư, trường học quốc tế, nhà câu lạc bộ. Dãy nhà phố số 3 đã hoàn thiện, các hộ gia đình đã dọn về ở và kinh doanh… Trong khi đó, The One Central, nơi giao thương sầm uất bao quanh tòa chung cư The One Residence với một mặt hướng ra đường Vành đai 3.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"vi-tri-shop-house-gamuda\" class=\"alignnone size-full wp-image-776\" height=\"444\" sizes=\"(max-width: 595px) 100vw, 595px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/vi-tri-shop-house-gamuda.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/vi-tri-shop-house-gamuda.png 595w, http://gamudagardens.vn/wp-content/uploads/2016/08/vi-tri-shop-house-gamuda-300x224.png 300w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"595\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các căn Shophouse ở vị trí rất đẹp</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"box-sizing: inherit;\">Kinh doanh nơi đây bạn sẽ được phục vụ một lượng khách hàng đông đảo với gần 1.000 học sinh, giáo viên, hơn 600 căn hộ tại các khu The One Residence, The Three … Khu dân cư tại các biệt thự, liền kề</span><a href=\"http://kdtgamudacity.com/biet-thu-st3\">&nbsp;<strong>gamuda gardens</strong></a><b>&nbsp;</b><span style=\"box-sizing: inherit;\">lên tới hơn 15.000 cư dân sinh sống với mức thu nhập cao, đây quả là một thị trường lớn cho các hộ kinh doanh nơi đây</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Khi sở hữu nhà phố thương mại tại Gamuda Gardens, khách hàng được quyền sở hữu vĩnh viễn căn nhà bao gồm hai chức năng: sinh hoạt gia đình và kinh doanh buôn bán, mở văn phòng,cho thuê…đặc biệt hơn nữa là thuế đất ở đây rẻ hơn ở các nơi khác do chủ đầu tư đã xây dựng các công trình cho thủ đô Hà Nội</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"nha-pho-shop-house-gamuda\" class=\"alignnone size-full wp-image-739\" height=\"506\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-shop-house-gamuda.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-shop-house-gamuda.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-shop-house-gamuda-300x190.jpg 300w, 