(90, 'KHUYẾN MẠI HẤP DẪN', 'khuyen-mai-hap-dan', '', 50, 'vietnamese', '[\"50\"]', '/uploads/images/icon3.png', '', '\"\"', '<p>Cập nhật mỗi ngày</p>', '<p>✎ Bạn là người đang muốn tìm <b>xiên 3 miền Bắc</b> đẹp nhất để chơi trong ngày hôm nay mà chưa biết đánh con gì để trúng, hãy để cho các chuyên gia của chúng tôi tìm giúp các bạn xiên 3 tỉ lệ cao nhất. Công việc của bạn rất đơn giản chỉ cần nạp thẻ vào ô bên dưới là bạn sẽ sở hữu ngay xiên 3 xsmb chuẩn nhất trong ngày.<br />\r\n&nbsp;<br />\r\n► Cầu <font color=\"red\"><b>XIÊN 3</b></font> (3 con lô đá) <font color=\"red\"><b>VIP</b></font> (1 ngày), giá: <font color=\"red\"><b>2.000.000 VNĐ</b></font><b> (Hai triệu đồng)</b><br />\r\n► Các bạn có thể nạp thẻ vào lúc <b>07h00</b> đến <b>18h10</b><br />\r\n► Có thể nạp cộng dồn, bao nhiêu cái nạp bấy nhiêu lần <b>(Ví dụ 4 cái 500k nạp 4 lần)</b><br />\r\n► Sau khi nạp thẻ thành công ở mục dưới đây, các bạn hãy nhìn thật kĩ <font color=\"red\"><b>XIÊN 3 VIP</b></font> hiện ra nhé!<br />\r\n► Mạng thẻ cào: Viettel, Mobiphone, Vinaphone, Gate, VN-Mobile, Megacard, OnCash<br />\r\n&nbsp;<br />\r\n☎ Mọi thắc mắc xin liên hệ <b>SĐT</b> hoặc <b>Zalo:</b> <font color=\"red\"><b>01667.713.496</b></font><br />\r\n&nbsp;<br />\r\n★ Chúc các bạn thắng lớn mỗi ngày!</p>\r\n\r\n<div class=\"list1\">\r\n<div class=\"zmenu\">– Nếu mục nạp thẻ bị lỗi, các bạn liên hệ SĐT hoặc Zalo <font color=\"red\"><b>01667.713.496</b></font> để gửi thẻ cào hoặc chuyển khoản nhận số nhé!<br />\r\n– Nếu bạn gửi thẻ cào: gửi <b>mã số thẻ</b> kèm <b>số seri</b> kèm <b>cầu mà bạn muốn theo</b> qua SMS hoặc Zalo SĐT <font color=\"red\"><b>01667713496</b></font>, 5p sau bạn sẽ nhận được số.<br />\r\n– Nếu bạn chuyển khoản: vui lòng liên hệ SĐT hoặc Zalo <font color=\"red\"><b>01667713496</b></font> để biết thêm chi tiết!</div>\r\n\r\n<div class=\"list5\"><img src=\"http://soicauvip.net/wp-content/uploads/2017/11/thongbao.png\" style=\"height:18px; width:18px\" /><font color=\"blue\"> <b>Thông báo:</