(105, 'Tháo lắp điều hòa tại Hà Nội', 'thao-lap-dieu-hoa-tai-ha-noi', '', 54, 'vietnamese', '[\"54\"]', '/uploads/images/video/sp1.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Địa chỉ đáp ứng nhanh nhất, tốt nhất cho nhu cầu sửa chữa và lắp đặt điều hòa tại Hà Nội. Dù là đợt cao điểm hay những ngày thường thì chỉ 30 – 45p sau khi gọi, bạn sẽ được cử ngay 2 anh chàng cao to đẹp trai tới tận nhà để thực thi.</p>\r\n\r\n<p>Bảo dưỡng điều hòa là công việc hết sức quan trọng. Bạn và gia đình sẽ có sử khỏe tốt hơn khi luôn được sống trong bầu không khí trong lành, mát mẻ, tuổi thọ của chiếc điều hòa cũng từ đó mà được kéo dài nhiều lần. Vậy thì chẳng có lý do gì...</p>', '<p>Địa chỉ đáp ứng nhanh nhất, tốt nhất cho nhu cầu sửa chữa và lắp đặt điều hòa tại Hà Nội. Dù là đợt cao điểm hay những ngày thường thì chỉ 30 – 45p sau khi gọi, bạn sẽ được cử ngay 2 anh chàng cao to đẹp trai tới tận nhà để thực thi...</p>', '', '', '', 0, 8, 1, -1, 0, -1, -1, 1, '', '', '', 3, 0, '2018-12-11 08:44:40', '0000-00-00 00:00:00'),
