(131, 'Giải pháp tối ưu', 'giai-phap-toi-uu', '', 33, 'vietnamese', '[\"33\"]', '/uploads/images/support/7.png', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Chúng tôi cung cấp các sản phẩm chất lượng đã được đánh giá và chọn lựa chi tiết, nhằm giải quyết nhu cầu và nguyện vọng của khách hàng tối ưu nhất.</p>', '<p>.</p>', '', '', '', 0, 0, 1, -1, 1, -1, 0, 1, '', '', '', 7, 7, '2019-02-14 10:02:53', '2019-02-25 09:27:33'),
(132, 'Trải nghiệm thực tế', 'trai-nghiem-thuc-te', '', 33, 'vietnamese', '[\"33\"]', '/uploads/images/support/8.png', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Trải nghiệm của khách hàng về các giải pháp là điều chúng tôi quan tâm hàng đầu. Chúng tôi tập trung 100% tâm sức để trở thành cầu nối giữa nhà cung cấp và khách hàng.</p>', '<p>Lựa chọn dây dẫn khí nén cũng có thể được coi là công việc đơn giản, nếu ứng dụng mà bạn cần không có quy mô lớn như chỉ vận hành khí nén gia đình hoặc sửa chữa ô tô xe máy. Tuy nhiên, nếu bạn đang sở hữu một xưởng sản xuất quy mô lớn, hoặc có môi trường làm việc khắc nghiệt như công trường, hầm mỏ, xử lý hóa chất và dầu nhớt hì việc lựa chọn&nbsp;<a href=\"https://ongcongtrinh.com/danh-muc/day-hoi-khi-nen/\" rel=\"noopener\" target=\"_blank\"><strong>ống dẫn hơi</strong></a>&nbsp;đáp ứng chuẩn công việc lại là một việc khá phức tạp.</p>\r\n\r\n<p><img data-src=\"https://ongcongtrinh.com/wp-content/uploads/2018/10/day_hoi_khi_nen.png\" src=\"https://ongcongtrinh.com/wp-content/uploads/2018/10/day_hoi_khi_nen.png\" /></p>\r\n\r\n<p>Về cơ bản, khi lựa chọn dây dẫn áp lực, hãy cân nhắc thật kĩ lưỡng 5 yếu tố chính: Kích thước, nhiệt độ, ứng dụng, chất truyền dẫn và áp lực dẫn.</p>\r\n\r\n<h2><strong>Về kích thước hay đường kính dây hơi</strong></h2>\r\n\r\n<p>Kích thước của dây dẫn bao gồm: đường kính trong và đường kính ngoài. Đường kính của dây thường được liệt kê rất rõ ràng trong thông tin sản phẩm, và gần như luôn được in trên thân ngoài của dây. Nếu không thể tìm được thông tin chính xác, bạn có thể cắt dây và đo đạc trực tiếp. Tính theo đơn vị inch và phi (mm).</p>\r\n\r\n<p>Đường kính trong: Đường kính lớp trong cùng của dây, là con số cần quan tâm chủ yếu, và là cơ sở để tính toán mọi chỉ số liên quan như lưu lượng, chiều dài và khớp nối phù hợp.Bảng bên dưới có liệt kê các cỡ đường kính trong thông dụng.</p>\r\n\r\n<p><img alt=\"\" data-src=\"https://ongcongtrinh.com/wp-content/uploads/2018/10/z809957658383_db9dacbeac12e35b23ee5b9ab4384a07-768x1024.jpg\" height=\"1024\" src=\"https://ongcongtrinh.com/wp-content/uploads/2018/10/z809957658383_db9dacbeac12e35b23ee5b9ab4384a07-768x1024.jpg\" width=\"768\" /></p>\r\n\r\n<h4><em>Đường kính trong của dây</em></h4>\r\n\r\n<p>Đường kính trong cần được lựa chọn chính xác cho từng ứng dụng nhằm đạt lưu lượng tối ưu.Lưu lượng thiếu hụt sẽ dẫn đến tụt giảm hiệu suất vận hành của thiết bị đầu cuối, trong khi lưu lượng quá cao sẽ dẫn đến sụt áp, hư hại thiết bị, rò rỉ, và giảm tuổi thọ dây dẫn.Bảng bên dưới có thể dùng thể tham khảo sơ bộ cho việc xác định đường kính trong trong phù hợp với yêu cầu lưu lượng của ứng dụng.</p>\r\n\r\n<ul>\r\n	<li><a href=\"https://ongcongtrinh.com/danh-muc/day-hoi-khi-nen/day-hoi-toyork-han-quoc/\" rel=\"noopener\" target=\"_blank\"><strong>dây hơi Hàn Quốc</strong></a></li>\r\n</ul>\r\n\r\n<h4><em>Bảng tính lưu lượng theo đường kính</em></h4>\r\n\r\n<p>Đường kính ngoài: Đường kính tính ở lớp vỏ ngoài cùng của dây, là chỉ số không quan trọng, thường chỉ có ảnh hưởng khi bạn cần đi dây ở nơi chật hẹp như bên trong tường hoặc bên trong ống gen. Ở Việt Nam, sự thiếu hiểu biết của một số kỹ thuật viên, nhân viên vật tư, và cả người bán hàng đã khiến cho tầm quan trọng của đường kính ngoài dây dẫn thường được đẩy lên cao một cách không cần thiết.</p>\r\n\r\n<h2><strong>Nhiệt độ dây hơi khí nén</strong></h2>\r\n\r\n<p>Khi hình thành thông số dây hơi phù hợp, bạn cần tính toán 2 chỉ số nhiệt độ: nhiệt độ bên ngoài và nhiệt độ chất truyền dẫn.</p>\r\n\r\n<p>Nhiệt độ bên ngoài: Là nhiệt độ môi trường tại vị trí dây dẫn được sử dụng. Nhiệt độ bên ngoài quá nóng hoặc quá lạnh có thể gây ảnh hưởng xấu đến lớp vỏ và lớp gia cường của dây, dẫn đến sụt giảm tuổi thọ.</p>\r\n\r\n<p>Nhiệt độ chất truyền dẫn: Có ảnh hưởng cực kỳ lớn tới tuổi thọ dây, vì vậy là yếu tố cần được tính toán rất chính xác khi lên thông số dây dẫn. Ví dụ, chất truyền dẫn có nhiệt độ cao sẽ làm mất tính co giãn của dây chất liệu cao su, nếu vận hành kéo dài.</p>\r\n\r\n<p>Chất truyền dẫn khác nhau lại có ảnh hưởng khác nhau đến khả năng chịu nhiệt của dây.Chính vì vậy, một nhà sản xuất ống dẫn và dây hơi như dây dẫn hơi tự rút, ống dẫn khí lò xo chuyên nghiệp sẽ liệt kê nhiệt độ làm việc cho từng nhóm chất truyền dẫn. Ví dụ: Một mẫu dây hơi có thể được công bố là chịu nhiệt độ tới 125 độ C cho xăng dầu, nhưng chỉ 85 độ C cho nước và dung dịch, và thậm chí là chỉ 70 độ C cho khí nén.</p>\r\n\r\n<p>Các hỗn hợp và công thức sản xuất cụ thể sẽ cho ra loại dây dẫn có khả năng chịu nhiệt khác nhau. Về mặt bằng chung, khi xét ở 3 loại vật liệu chính thường được sử dụng trong dây dẫn là cao su, PVC và PU thì:</p>\r\n\r\n<p>Cao su có khả năng chịu nhiệt kém nhất, thường mất khả năng co giãn và giảm tuổi thọ khi tiếp xúc với nhiệt độ cao.</p>\r\n\r\n<p>PVC có khả năng chịu nhiệt tốt hơn, thông thường lên đến 50 độ C.</p>\r\n\r\n<p>PU có khả năng chịu nhiệt tốt nhất, lên đến 70 độ C.</p>', '', '', '', 0, 3, 1, -1, 1, -1, 0, 1, '', '', '', 7, 7, '2019-02-14 10:03:32', '2019-03-07 10:49:41'),
