(146, 'Lưu  ý 2', 'luu-y-2', '', 73, 'vietnamese', '[\"73\"]', '', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Trước khi mang sản phẩm đến TTBH, Quý khách phải chắc chắn gỡ bỏ tất cả các linh kiện, phụ kiện, thiết bị gắn thêm mà không được cung cấp hoặc bảo hành theo sản phẩm. TTBH sẽ không chịu trách nhiệm về sự hư hỏng hoặc mất mát của chúng (nếu có) trong quá trình sửa chữa.</p>', '<p>Trước khi mang sản phẩm đến TTBH, Quý khách phải chắc chắn gỡ bỏ tất cả các linh kiện, phụ kiện, thiết bị gắn thêm mà không được cung cấp hoặc bảo hành theo sản phẩm. TTBH sẽ không chịu trách nhiệm về sự hư hỏng hoặc mất mát của chúng (nếu có) trong quá trình sửa chữa.</p>', '', '', '', 0, 0, 1, -1, 0, -1, -1, 1, '', '', '', 7, 0, '2019-03-12 09:48:37', '0000-00-00 00:00:00'),
(147, 'Lưu ý 3', 'luu-y-3', '', 73, 'vietnamese', '[\"73\"]', '', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Việc sửa chữa và linh kiện thay thế hoặc sản phẩm đổi sẽ được bảo hành 3 tháng tính từ ngày khách hàng nhận lại sản phẩm, hoặc theo thời hạn bảo hành còn lại của sản phẩm, tùy theo thời hạn nào dài hơn</p>', '<p>Việc sửa chữa và linh kiện thay thế hoặc sản phẩm đổi sẽ được bảo hành 3 tháng tính từ ngày khách hàng nhận lại sản phẩm, hoặc theo thời hạn bảo hành còn lại của sản phẩm, tùy theo thời hạn nào dài hơn</p>', '', '', '', 0, 0, 1, -1, 0, -1, -1, 1, '', '', '', 7, 0, '2019-03-12 09:48:51', '0000-00-00 00:00:00'),
(148, 'Lưu  ý 4', 'luu-y-4', '', 73, 'vietnamese', '[\"73\"]', '', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Các sản phẩm không đủ điều kiện bảo hành hoặc hết hạn bảo hành sẽ được sửa chữa dạng tính phí. Quý khách vui lòng sử dụng dịch vụ sửa chữa tivi tại nhà . TTBH sẽ liên hệ khách hàng và báo giá trước khi sửa chữa (tiền công + tiền linh kiện + VAT)</p>', '<p>Các sản phẩm không đủ điều kiện bảo hành hoặc hết hạn bảo hành sẽ được sửa chữa dạng tính phí. Quý khách vui lòng sử dụng dịch vụ sửa chữa tivi tại nhà . TTBH sẽ liên hệ khách hàng và báo giá trước khi sửa chữa (tiền công + tiền linh kiện + VAT)</p>', '', '', '', 0, 0, 1, -1, 0, -1, -1, 1, '', '', '', 7, 0, '2019-03-12 09:49:08', '0000-00-00 00:00:00'),
(149, '1. TTBH có cung cấp dịch vụ bảo hành sửa chữa tại nhà không', '1-ttbh-co-cung-cap-dich-vu-bao-hanh-sua-chua-tai-nha-khong', '', 74, 'vietnamese', '[\"74\"]', '', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Hiện tại, chúng tôi có cung cấp dịch vụ bảo hành và sửa chữa tivi LG tại nhà cho sản phẩm Tivi . Quý khách vui lòng liên hệ đường dây nóng 1 900 068 628</p>', '<p>Hiện tại, chúng tôi có cung cấp dịch vụ bảo hành và sửa chữa tivi LG tại nhà cho sản phẩm Tivi . Quý khách vui lòng liên hệ đường dây nóng 1 900 068 628</p>', '', '', '', 0, 1, 1, -1, 0, -1, -1, 1, '', '', '', 7, 0, '2019-03-12 16:16:40', '0000-00-00 00:00:00'),
