\\u1ed5i\\/1 tu\\u1ea7n<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>3.Gi\\u00e1o tr\\u00ecnh ch\\u00ednh<\\/strong>: My Little Island 1- nh\\u00e0 xu\\u1ea5t b\\u1ea3n Pearson<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\">Gi\\u00e1o tr\\u00ecnh My Little Island 1 c\\u00f3 9 b\\u00e0i h\\u1ecdc ch\\u00ednh mang \\u0111\\u1ebfn cho h\\u1ecdc sinh nh\\u1eefng h\\u00e0nh tr\\u00ecnh phi\\u00eau l\\u01b0u, th\\u00fa v\\u1ecb.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>4.\\u0110\\u0103\\u0323c \\u0111i\\u00ea\\u0309m kho\\u0301a ho\\u0323c:<\\/strong> D\\u00e0nh cho h\\u1ecdc sinh l\\u1ee9a tu\\u1ed5i m\\u1eabu gi\\u00e1o ho\\u1eb7c b\\u1eaft \\u0111\\u1ea7u v\\u00e0o l\\u1edbp 1. Gi\\u00fap ph\\u00e1t tri\\u1ec3n k\\u1ef9 n\\u0103ng giao ti\\u1ebfp x\\u00e3 h\\u1ed9i v\\u00e0 x\\u00e2y d\\u1ef1ng kh\\u1ea3 n\\u0103ng ng\\u00f4n ng\\u1eef. H\\u1ecdc ti\\u1ebfng Anh th\\u00f4ng qua c\\u00e1c c\\u00e2u chuy\\u1ec7n, b\\u00e0i h\\u00e1t, th\\u01a1. L\\u00e0m quen ng\\u1eef \\u00e2m, \\u0111\\u1ecdc v\\u00e0 vi\\u1ebft c\\u01a1 b\\u1ea3n. C\\u00e1c ch\\u1ee7 \\u0111\\u1ec1 \\u0111\\u01b0\\u1ee3c k\\u1ebft n\\u1ed1i v\\u1edbi nh\\u1eefng b\\u00e0i h\\u1ecdc \\u0111\\u1ea1o \\u0111\\u1ee9c v\\u00e0 c\\u00e1c m\\u00f4n h\\u1ecdc kh\\u00e1c. Kh\\u00f3a h\\u1ecdc s\\u1eed d\\u1ee5ng c\\u00e1c ti\\u1ebfp c\\u1eadn v\\u1edbi ng\\u00f4n ng\\u1eef th\\u00f4ng qua c\\u00e1c ph\\u1ea3n x\\u1ea1 t\\u1ef1 nhi\\u00ean gi\\u00fap c\\u00e1c b\\u00e9 hi\\u1ec3u \\u0111\\u01b0\\u1ee3c \\u00fd ngh\\u0129a c\\u1ee7a ng\\u00f4n ng\\u1eef m\\u00e0 m\\u00ecnh \\u0111ang h\\u1ecdc. Ngo\\u00e0i c\\u00e1c b\\u00e0i luy\\u1ec7n t\\u1eadp trong s\\u00e1ch h\\u1ecdc sinh v\\u00e0 s\\u00e1ch b\\u00e0i t\\u1eadp, h\\u1ecdc sinh c\\u00f2n \\u0111\\u01b0\\u1ee3c tham gia v\\u00e0o c\\u00e1c d\\u1ef1 \\u00e1n, c\\u00e1c tr\\u00f2 ch\\u01a1i tr\\u00ean l\\u1edbp, \\u0111\\u01b0\\u1ee3c t\\u01b0\\u01a1ng t\\u00e1c v\\u1edbi c\\u00e1c b\\u1ea1n c\\u00f9ng l\\u1edbp v\\u00e0 \\u0111\\u01b0\\u1ee3c ti\\u1ebfp c\\u1eadn v\\u1edbi ng\\u00f4n ng\\u1eef th\\u00f4ng qua c\\u00e1c gi\\u00e1o c\\u1ee5 tr\\u1ef1c quan.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\">T\\u1ea1i kh\\u00f3a h\\u1ecdc Pre-starter 1, h\\u1ecdc sinh s\\u1ebd \\u0111\\u01b0\\u1ee3c l\\u00e0m quen v\\u1edbi hai nh\\u00e2n v\\u1eadt Kimmy v\\u00e0 Timmy v\\u00e0 h\\u1ecdc s\\u00e1ch ch\\u00e0o h\\u1ecfi, c\\u00e1c ho\\u1ea1t \\u0111\\u1ed9ng b\\u1eb1ng ti\\u1ebfng Anh. H\\u1ecdc sinh c\\u0169ng s\\u1ebd \\u0111\\u01b0\\u1ee3c l\\u00e0m quen v\\u1edbi Sammy v\\u00e0 Squirrel, hai nh\\u00e2n v\\u1eadt ho\\u1ea1t h\\u00ecnh s\\u1ebd xu\\u1ea5t hi\\u1ec7n xuy\\u00ean su\\u1ed1t trong su\\u1ed1t gi\\u00e1o tr\\u00ecnh<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><em><span style=\\\"color: #ff0000;\\\"><strong>SAU KH\\u00d3A H\\u1eccC:<\\/strong><\\/span><\\/em><\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>1.T\\u1eeb v\\u1ef1ng<\\/strong>: H\\u1ecdc sinh n\\u1eafm \\u0111\\u01b0\\u1ee3c m\\u1ed9t l\\u01b0\\u1ee3ng t\\u1eeb v\\u1ef1ng kho\\u1ea3ng 75 t\\u1eeb v\\u1edbi c\\u00e1c ch\\u1ee7 \\u0111\\u1ec1 \\u0111\\u01a1n gi\\u1ea3n nh\\u01b0 m\\u00e0u s\\u1eafc, h\\u00ecnh d\\u1ea1ng, \\u0111\\u1ed3 v\\u1eadt, con v\\u1eadt<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>2.Nghe:<\\/strong> H\\u1ecdc sinh c\\u00f3 th\\u1ebf nghe hi\\u1ec3u \\u0111\\u01b0\\u1ee3c nh\\u1eefng c\\u00e2u m\\u1ec7nh l\\u1ec7nh \\u0111\\u01a1n gi\\u1ea3n th\\u01b0\\u1eddng xuy\\u00ean \\u0111\\u01b0\\u1ee3c gi\\u00e1o vi\\u00ean s\\u1eed d\\u1ee5ng trong l\\u1edbp h\\u1ecdc<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>3.N\\u00f3i:<\\/strong> H\\u1ecdc sinh c\\u00f3 th\\u1ec3 b\\u1eaft \\u0111\\u1ea7u s\\u1eed d\\u1ee5ng m\\u1ed9t s\\u1ed1 c\\u00e2u h\\u1ed9i tho\\u1ea1i \\u0111\\u01a1n gi\\u1ea3n nh\\u01b0 ch\\u00e0o h\\u1ecfi, xin l\\u1ed7i v\\u00e0 c\\u00e1c c\\u00e2u m\\u1ec7nh l\\u1ec7nh th\\u1ee9c \\u0111\\u01a1n gi\\u1ea3n<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>4.\\u0110\\u1ecdc\\/Vi\\u1ebft<\\/strong>: Ph\\u00e1t tri\\u1ec3n c\\u00e1c k\\u1ef9 n\\u0103ng nh\\u1eadn bi\\u1ebft c\\u00e1c ch\\u1eef c\\u00e1i tr\\u01b0\\u1edbc khi t\\u1eadp vi\\u1ebft, t\\u1eadp \\u0111\\u1ecdc.<\\/p>\\r\\n\"},{\"title\":\"\\u0110\\u1eb7c t\\u00ednh k\\u1ef9 thu\\u1eadt\",\"description\":\"<p style=\\\"text-align: justify;\\\"><strong>1.L\\u1ee9a tu\\u1ed5i<\\/strong>: 4-5 tu\\u1ed5i (h\\u1ecdc sinh m\\u1eabu gi\\u00e1o, b\\u1eaft \\u0111\\u1ea7u v\\u00e0o l\\u1edbp 1)<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>2.Th\\u1eddi l\\u01b0\\u1ee3ng kh\\u00f3a h\\u1ecdc<\\/strong>: 32 tu\\u1ea7n\\/gi\\u00e1o tr\\u00ecnh; 90 ph\\u00fat\\/bu\\u1ed5i; 2 bu\\u1ed5i\\/1 tu\\u1ea7n<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>3.Gi\\u00e1o tr\\u00ecnh ch\\u00ednh<\\/strong>: My Little Island 2- nh\\u00e0 xu\\u1ea5t b\\u1ea3n Pearson<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\">Gi\\u00e1o tr\\u00ecnh My Little Island 2 c\\u00f3 9 b\\u00e0i h\\u1ecdc ch\\u00ednh mang \\u0111\\u1ebfn cho h\\u1ecdc sinh nh\\u1eefng h\\u00e0nh tr\\u00ecnh phi\\u00eau l\\u01b0u, th\\u00fa v\\u1ecb.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>4.\\u0110\\u0103\\u0323c \\u0111i\\u00ea\\u0309m kho\\u0301a ho\\u0323c:<\\/strong> D\\u00e0nh cho h\\u1ecdc sinh l\\u1ee9a tu\\u1ed5i m\\u1eabu gi\\u00e1o ho\\u1eb7c b\\u1eaft \\u0111\\u1ea7u v\\u00e0o l\\u1edbp 1. Gi\\u00fap ph\\u00e1t tri\\u1ec3n k\\u1ef9 n\\u0103ng giao ti\\u1ebfp x\\u00e3 h\\u1ed9i v\\u00e0 x\\u00e2y d\\u1ef1ng kh\\u1ea3 n\\u0103ng ng\\u00f4n ng\\u1eef. H\\u1ecdc ti\\u1ebfng Anh th\\u00f4ng qua c\\u00e1c c\\u00e2u chuy\\u1ec7n, b\\u00e0i h\\u00e1t, th\\u01a1. L\\u00e0m quen ng\\u1eef \\u00e2m, \\u0111\\u1ecdc v\\u00e0 vi\\u1ebft c\\u01a1 b\\u1ea3n. C\\u00e1c ch\\u1ee7 \\u0111\\u1ec1 \\u0111\\u01b0\\u1ee3c k\\u1ebft n\\u1ed1i v\\u1edbi nh\\u1eefng b\\u00e0i h\\u1ecdc \\u0111\\u1ea1o \\u0111\\u1ee9c v\\u00e0 c\\u00e1c m\\u00f4n h\\u1ecdc kh\\u00e1c.. Kh\\u00f3a h\\u1ecdc s\\u1eed d\\u1ee5ng c\\u00e1c ti\\u1ebfp c\\u1eadn v\\u1edbi ng\\u00f4n ng\\u1eef th\\u00f4ng qua c\\u00e1c ph\\u1ea3n x\\u1ea1 t\\u1ef1 nhi\\u00ean gi\\u00fap c\\u00e1c b\\u00e9 hi\\u1ec3u \\u0111\\u01b0\\u1ee3c \\u00fd ngh\\u0129a c\\u1ee7a ng\\u00f4n ng\\u1eef m\\u00e0 m\\u00ecnh \\u0111ang h\\u1ecdc. Ngo\\u00e0i c\\u00e1c b\\u00e0i luy\\u1ec7n t\\u1eadp trong s\\u00e1ch h\\u1ecdc sinh v\\u00e0 s\\u00e1ch b\\u00e0i t\\u1eadp, h\\u1ecdc sinh c\\u00f2n \\u0111\\u01b0\\u1ee3c tham gia v\\u00e0o c\\u00e1c d\\u1ef1 \\u00e1n, c\\u00e1c tr\\u00f2 ch\\u01a1i tr\\u00ean l\\u1edbp, \\u0111\\u01b0\\u1ee3c t\\u01b0\\u01a1ng t\\u00e1c v\\u1edbi c\\u00e1c b\\u1ea1n c\\u00f9ng l\\u1edbp v\\u00e0 \\u0111\\u01b0\\u1ee3c ti\\u1ebfp c\\u1eadn v\\u1edbi ng\\u00f4n ng\\u1eef th\\u00f4ng qua c\\u00e1c gi\\u00e1o c\\u1ee5 tr\\u1ef1c quan.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\">T\\u1ea1i kh\\u00f3a h\\u1ecdc Pre-starter 2, h\\u1ecdc sinh s\\u1ebd g\\u1eb7p g\\u1ee1 v\\u1edbi hai nh\\u00e2n v\\u1eadt Lilly v\\u00e0 Billy, h\\u1ecdc c\\u00e1ch ch\\u00e0o h\\u1ecfi v\\u00e0 c\\u00e1c h\\u00e0nh \\u0111\\u1ed9ng b\\u1eb1ng ti\\u1ebfng Anh. H\\u1ecdc sinh c\\u0169ng s\\u1ebd \\u0111\\u01b0\\u1ee3c g\\u1eb7p l\\u1ea1i Sammy v\\u00e0 Squirrel, hai nh\\u00e2n v\\u1eadt s\\u1ebd xu\\u1ea5t hi\\u1ec7n xuy\\u00ean su\\u1ed1t trong b\\u1ed9 gi\\u00e1o tr\\u00ecnh. Trong gi\\u00e1o tr\\u00ecnh n\\u00e0y, h\\u1ecdc sinh s\\u1ebd b\\u1eaft \\u0111\\u1ea7u l\\u00e0m quen v\\u1edbi c\\u00e1c c\\u00e2u truy\\u1ec7n tranh v\\u00e0 c\\u00e1c b\\u00e0i h\\u00e1t, ph\\u00e1t tri\\u1ec3n c\\u00e1c k\\u1ef9 n\\u0103ng nghe v\\u00e0 n\\u00f3i.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><em><span style=\\\"color: #ff0000;\\\"><strong>SAU KH\\u00d3A H\\u1eccC:<\\/strong><\\/span><\\/em><\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>1.T\\u1eeb v\\u1ef1ng<\\/strong>: H\\u1ecdc sinh n\\u1eafm \\u0111\\u01b0\\u1ee3c m\\u1ed9t l\\u01b0\\u1ee3ng t\\u1eeb v\\u1ef1ng kho\\u1ea3ng 60 t\\u1eeb v\\u1edbi c\\u00e1c ch\\u1ee7 \\u0111\\u1ec1 \\u0111\\u01a1n gi\\u1ea3n nh\\u01b0 gia \\u0111\\u00ecnh, \\u0111\\u1ed3 v\\u1eadt, con v\\u1eadt, t\\u00ednh t\\u1eeb mi\\u00eau t\\u1ea3, b\\u1ed9 ph\\u1eadn c\\u01a1 th\\u1ec3.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>2.Nghe:<\\/strong> H\\u1ecdc sinh c\\u00f3 th\\u1ebf nghe hi\\u1ec3u \\u0111\\u01b0\\u1ee3c nh\\u1eefng c\\u00e2u m\\u1ec7nh l\\u1ec7nh th\\u01b0\\u1eddng xuy\\u00ean \\u0111\\u01b0\\u1ee3c gi\\u00e1o vi\\u00ean s\\u1eed d\\u1ee5ng trong l\\u1edbp h\\u1ecdc<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>3.N\\u00f3i:<\\/strong> H\\u1ecdc sinh c\\u00f3 th\\u1ec3 b\\u1eaft \\u0111\\u1ea7u s\\u1eed d\\u1ee5ng m\\u1ed9t s\\u1ed1 c\\u00e2u h\\u1ed9i tho\\u1ea1i \\u0111\\u01a1n gi\\u1ea3n nh\\u01b0 c\\u1ea3m \\u01a1n, gi\\u1edbi thi\\u1ec7u, c\\u00e1c c\\u00e2u m\\u1ec7nh l\\u1ec7nh th\\u1ee9c \\u0111\\u01a1n gi\\u1ea3n v\\u00e0 c\\u00e1c c\\u00e2u h\\u1ecfi ng\\u1eafn.<\\/p>\\r\\n\"},{\"title\":\"\\u1ee8ng d\\u1ee5ng\",\"description\":\"<p style=\\\"text-align: justify;\\\"><strong>1.L\\u1ee9a tu\\u1ed5i<\\/strong>: t\\u1eeb 5-6 tu\\u1ed5i (l\\u1edbp 1)<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>2.Th\\u1eddi l\\u01b0\\u1ee3ng kh\\u00f3a h\\u1ecdc<\\/strong>: 32 tu\\u1ea7n\\/gi\\u00e1o tr\\u00ecnh; 90 ph\\u00fat\\/bu\\u1ed5i; 2 bu\\u1ed5i\\/1 tu\\u1ea7n<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>3.Gi\\u00e1o tr\\u00ecnh ch\\u00ednh<\\/strong>: My Little Island 3- nh\\u00e0 xu\\u1ea5t b\\u1ea3n Pearson<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\">Gi\\u00e1o tr\\u00ecnh My Little Island 3 c\\u00f3 9 b\\u00e0i h\\u1ecdc ch\\u00ednh mang \\u0111\\u1ebfn cho h\\u1ecdc sinh nh\\u1eefng h\\u00e0nh tr\\u00ecnh phi\\u00eau l\\u01b0u, th\\u00fa v\\u1ecb.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>4.\\u0110\\u0103\\u0323c \\u0111i\\u00ea\\u0309m kho\\u0301a ho\\u0323c:<\\/strong> D\\u00e0nh cho h\\u1ecdc sinh l\\u1ee9a tu\\u1ed5i m\\u1eabu gi\\u00e1o. Gi\\u00fap ph\\u00e1t tri\\u1ec3n k\\u1ef9 n\\u0103ng giao ti\\u1ebfp x\\u00e3 h\\u1ed9i v\\u00e0 x\\u00e2y d\\u1ef1ng kh\\u1ea3 n\\u0103ng ng\\u00f4n ng\\u1eef. H\\u1ecdc ti\\u1ebfng Anh th\\u00f4ng qua c\\u00e1c c\\u00e2u chuy\\u1ec7n, b\\u00e0i h\\u00e1t, th\\u01a1. L\\u00e0m quen ng\\u1eef \\u00e2m, \\u0111\\u1ecdc v\\u00e0 vi\\u1ebft c\\u01a1 b\\u1ea3n. C\\u00e1c ch\\u1ee7 \\u0111\\u1ec1 \\u0111\\u01b0\\u1ee3c k\\u1ebft n\\u1ed1i v\\u1edbi nh\\u1eefng b\\u00e0i h\\u1ecdc \\u0111\\u1ea1o \\u0111\\u1ee9c v\\u00e0 c\\u00e1c m\\u00f4n h\\u1ecdc kh\\u00e1c.. Kh\\u00f3a h\\u1ecdc s\\u1eed d\\u1ee5ng c\\u00e1c ti\\u1ebfp c\\u1eadn v\\u1edbi ng\\u00f4n ng\\u1eef th\\u00f4ng qua c\\u00e1c ph\\u1ea3n x\\u1ea1 t\\u1ef1 nhi\\u00ean gi\\u00fap c\\u00e1c b\\u00e9 hi\\u1ec3u \\u0111\\u01b0\\u1ee3c \\u00fd ngh\\u0129a c\\u1ee7a ng\\u00f4n ng\\u1eef m\\u00e0 m\\u00ecnh \\u0111ang h\\u1ecdc. Ngo\\u00e0i c\\u00e1c b\\u00e0i luy\\u1ec7n t\\u1eadp trong s\\u00e1ch h\\u1ecdc sinh v\\u00e0 s\\u00e1ch b\\u00e0i t\\u1eadp, h\\u1ecdc sinh c\\u00f2n \\u0111\\u01b0\\u1ee3c tham gia v\\u00e0o c\\u00e1c d\\u1ef1 \\u00e1n, c\\u00e1c tr\\u00f2 ch\\u01a1i tr\\u00ean l\\u1edbp, \\u0111\\u01b0\\u1ee3c t\\u01b0\\u01a1ng t\\u00e1c v\\u1edbi c\\u00e1c b\\u1ea1n c\\u00f9ng l\\u1edbp v\\u00e0 \\u0111\\u01b0\\u1ee3c ti\\u1ebfp c\\u1eadn v\\u1edbi ng\\u00f4n ng\\u1eef th\\u00f4ng qua c\\u00e1c gi\\u00e1o c\\u1ee5 tr\\u1ef1c quan.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\">T\\u1ea1i kh\\u00f3a h\\u1ecdc Pre-starter 3, h\\u1ecdc sinh s\\u1ebd g\\u1eb7p g\\u1ee1 v\\u1edbi hai nh\\u00e2n v\\u1eadt Sue v\\u00e0 Lou v\\u00e0 \\u00f4n t\\u1eadp l\\u1ea1i c\\u00e1c t\\u1eeb v\\u1ef1ng t\\u1eeb c\\u00e1c kh\\u00f3a h\\u1ecdc tr\\u01b0\\u1edbc. H\\u1ecdc sinh c\\u0169ng s\\u1ebd \\u0111\\u01b0\\u1ee3c g\\u1eb7p l\\u1ea1i Sammy v\\u00e0 Squirrel, hai nh\\u00e2n v\\u1eadt s\\u1ebd xu\\u1ea5t hi\\u1ec7n xuy\\u00ean su\\u1ed1t trong b\\u1ed9 gi\\u00e1o tr\\u00ecnh. Trong gi\\u00e1o tr\\u00ecnh n\\u00e0y, h\\u1ecdc sinh s\\u1ebd \\u0111\\u01b0\\u1ee3c ph\\u00e1t tri\\u1ec3n k\\u1ef9 n\\u0103ng nghe qua c\\u00e1c c\\u00e2u truy\\u1ec7n tranh, ph\\u00e1t tri\\u1ec3n k\\u1ef9 n\\u0103ng \\u0111\\u1ecdc t\\u1eeb c\\u00e1c b\\u00e0i kh\\u00f3a \\u0111\\u01a1n gi\\u1ea3n. Ngo\\u00e0i ra h\\u1ecdc sinh c\\u00f2n ph\\u00e1t tri\\u1ec3n k\\u1ef9 n\\u0103ng to\\u00e1n h\\u1ecdc v\\u1edbi c\\u00e1c con s\\u1ed1 c\\u01a1 b\\u1ea3n t\\u1eeb 1 \\u2013 20.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><em><span style=\\\"color: #ff0000;\\\"><strong>SAU KH\\u00d3A H\\u1eccC:<\\/strong><\\/span><\\/em><\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>1.T\\u1eeb v\\u1ef1ng<\\/strong>: H\\u1ecdc sinh n\\u1eafm \\u0111\\u01b0\\u1ee3c m\\u1ed9t l\\u01b0\\u1ee3ng t\\u1eeb v\\u1ef1ng kho\\u1ea3ng 70 t\\u1eeb v\\u1edbi c\\u00e1c ch\\u1ee7 \\u0111\\u1ec1 \\u0111\\u01a1n gi\\u1ea3n nh\\u01b0 con v\\u1eadt, thi\\u00ean nhi\\u00ean, ngh\\u1ec1 nghi\\u1ec7p, \\u0111\\u1ecba \\u0111i\\u1ec3m\\u2026<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>2.Nghe:<\\/strong> H\\u1ecdc sinh c\\u00f3 th\\u1ebf nghe hi\\u1ec3u \\u0111\\u01b0\\u1ee3c c\\u00e1c c\\u1ea5u tr\\u00fac c\\u00e2u v\\u00e0 c\\u00e1c c\\u00e2u h\\u1ecfi ph\\u1ee9c t\\u1ea1p h\\u01a1n v\\u1edbi vi\\u1ec7c l\\u00e0m quen v\\u1edbi c\\u00e1c \\u0111\\u1ed9ng t\\u1eeb ch\\u1ec9 h\\u00e0nh \\u0111\\u1ed9ng v\\u00e0 c\\u00e1c th\\u1eddi th\\u1ec3 trong ti\\u1ebfng Anh<\\/p>\\r\\n\\r\\n<p style=\\\"text-align: justify;\\\"><strong>3.N\\u00f3i:<\\/strong> H\\u1ecdc sinh c\\u00f3 th\\u1ec3 b\\u1eaft \\u0111\\u1ea7u s\\u1eed d\\u1ee5ng m\\u1ed9t s\\u1ed1 c\\u00e2u h\\u1ed9i tho\\u1ea1i ph\\u1ee9c t\\u1ea1p h\\u01a1n.<\\/p>\\r\\n\"}]', 0, 186, 1, '0000-00-00 00:00:00', 1, -1, -1, 0, 1, 1, 'vietnamese', '', '', '', 3, 3, '2017-11-23 16:22:58', '2018-07-06 11:30:55');
