(10, 'Lẵng hoa HL-0068', 'lang-hoa-hl-0068', '', 77, '[\"81\",\"77\",\"78\",\"79\",\"80\"]', '/uploads/images/products/hg-0008-6.jpg', '/uploads/images/products/banner/tam-nhua-picomat.jpg', '', '\"\"', '', 5800000, 5000000, '<p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo.</p>', '<p><span style=\"font-family: arial, helvetica, sans-serif;\">TEF thiết kế các khóa học Pre-starter dành cho trẻ em từ 3 – 6 tuổi, sử dụng giáo trình My Little Island của nhà xuất bản Pearson. Khóa học giúp phát triển kỹ năng giao tiếp xã hội và xây dựng khả năng ngôn ngữ. Học tiếng Anh thông qua các câu chuyện, bài hát, thơ. Làm quen ngữ âm, đọc và viết cơ bản. Các chủ đề được kết nối với những bài học đạo đức và các môn học khác. Khóa học sử dụng các tiếp cận với ngôn ngữ thông qua các phản xạ tự nhiên giúp các bé hiểu được ý nghĩa của ngôn ngữ mà mình đang học. Ngoài các bài luyện tập trong sách học sinh và sách bài tập, học sinh còn được tham gia vào các dự án, các trò chơi trên lớp, được tương tác với các bạn cùng lớp và được tiếp cận với ngôn ngữ thông qua các giáo cụ trực quan.</span></p>\r\n\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">TEF thiết kế các khóa học Pre-starter dành cho trẻ em từ 3 – 6 tuổi, sử dụng giáo trình My Little Island của nhà xuất bản Pearson. Khóa học giúp phát triển kỹ năng giao tiếp xã hội và xây dựng khả năng ngôn ngữ. Học tiếng Anh thông qua các câu chuyện, bài hát, thơ. Làm quen ngữ âm, đọc và viết cơ bản. Các chủ đề được kết nối với những bài học đạo đức và các môn học khác. Khóa học sử dụng các tiếp cận với ngôn ngữ thông qua các phản xạ tự nhiên giúp các bé hiểu được ý nghĩa của ngôn ngữ mà mình đang học. Ngoài các bài luyện tập trong sách học sinh và sách bài tập, học sinh còn được tham gia vào các dự á