(12, 'Hoa Bình HB-0381', 'hoa-binh-hb-0381', '', 84, '[\"84\"]', '/uploads/images/products/hb-0003-3.jpg', '', '', '\"\"', '', 0, 0, '<div class=\"entry-content\">\r\n<div class=\"entry-content\">\r\n<p>Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam egestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend leo.</p>\r\n\r\n<p><img alt=\"\" src=\"http://phpdev.local/uploads/images/hinh-anh/partner-1.jpg\" style=\"width: 121px; height: 121px;\" /></p>\r\n</div>\r\n</div>', '<p><strong>Tổng quan về ngành</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Khoa học máy tính là một chuyên ngành đặc biệt tại Đại học FPT bởi sinh viên theo học chuyên ngành này sẽ có cơ hội được cấp học bổng từ Cử nhân lên thẳng bậc Tiến sỹ, trong đó có thời gian đào tạo tại nước ngoài. Do đó sinh viên ngành Khoa học máy tính không chỉ được học với những giảng viên tốt nhất về chuyên ngành Khoa học máy tính tại trường, mà còn có cơ hội học tập trong những môi trường tiên tiến với các giáo sư nước ngoài cùng sinh viên quốc tế.</p>\r\n\r\n<p><strong>Thời gian học</strong>: 4 năm</p>\r\n\r\n<p><strong>Địa&nbsp;điểm học</strong>: Hà Nội.</p>\r\n\r\n<table style=\"width: 1044px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width: 301px;\">Học kỳ Fall</td>\r\n			<td style=\"width: 347px;\">Học kỳ Spring</td>\r\n			<td style=\"width: 376px;\">Học kỳ Summer</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 301px;\">Từ tháng 9 đến tháng 12</td>\r\n			<td style=\"width: 347px;\">Từ tháng 1 đến tháng 4</td>\r\n			<td style=\"width: 376px;\">Từ tháng 5 đến tháng 8</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 301px;\">Nơi tổ chức đào tạo</td>\r\n			<td style=\"width: 347px;\">Nơi tổ chức đào tạo</td>\r\n			<td style=\"width: 376px;\">Nơi tổ chức đào tạo</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 301px;\">Hà Nội</td>\r\n			<td style=\"width: 347px;\">Hà Nội</td>\r\n			<td style=\"width: 376px;\">Hà Nội</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align: center;\">Một năm có ba học kỳ, mỗi học kỳ kéo dài 16 tuần</p>\r\n\r\n<table style=\"width: 1045px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td rowspan=\"4\" style=\"width: 301px;\">Các thông tin chính</td>\r\n			<td style=\"width: 347px;\">Bằng cấp</td>\r\n			<td style=\"width: 377px;\">Kỹ sư</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 347px;\">Trình độ</td>\r\n			<td style=\"width: 377px;\">Đại học</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 347px;\">Phiên bản chương trình</td>\r\n			<td style=\"width: 377px;\">BCS 2016</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width: 347px;\">Học phí</td>\r\n			<td style=\"width: 377px;\">xem chi tiết tại Học phí</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Yêu cầu&nbsp;đầu vào:</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Khoa học máy tính là ngành học dành cho những cá nhân đam mê lĩnh vực nghiên cứu chuyên sâu về CNTT.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Triển vọng nghề nghiệp:</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Sinh viên tốt nghiệp ngành Khoa học máy tính có thể làm việc ở các vị trí sau: Nhà nghiên cứu chuyên nghiệp về khoa học máy tính; Giảng viên Viện nghiên cứu về khoa học máy tính; Chuyên gia trong môi trường công nghiệp, dịch vụ về máy tính, CNTT…</p>\r\n\r\n<p><strong>Cấu trúc chương trình:</strong></p>\r\n\r\n<p>Kiến thức nền tảng:&nbsp;114 tín chỉ</p>\r\n\r\n<p>Kiến thức chuyên ngành:&nbsp;16 tín chỉ</p>\r\n\r\n<p>Kiến thức bổ trợ/tự chọn: 15 tín chỉ</p>\r\n\r\n<p>Tổng số tín chỉ:&nbsp;145 tín chỉ</p>\r\n\r\n<table width=\"660\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"307\">Học phần bắt buộc</td>\r\n			<td width=\"353\">Học phần tự chọn</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kỳ 1 – Định hướng</td>\r\n			<td>Kỳ 7 – On the job training (làm việc tại doanh nghiệp)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kỳ 2 – Kiến thức nền tảng</td>\r\n			<td>Kỳ 8 – Chuyên ngành</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kỳ 3 – Kiến thức nền tảng</td>\r\n			<td>Kỳ 9 – Chuyên ngành</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kỳ 4 – Kiến thức nền tảng</td>\r\n			<td>Kỳ 10 – Đồ án/Khoá luận tốt nghiệp</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kỳ 5 – Kiến thức nền tảng</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Kỳ 6 – Kiến thức nền tảng</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Kinh nghiệm tích lũy sau chương trình:</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Tại Đại học FPT, sinh viên ngành Khoa học máy tính sẽ được trang bị nền tảng kiến thức rộng lớn trong lĩnh vực khoa học máy tính bao gồm: cơ sở toán học, vật lý, điện tử, cấu trúc máy tính, hệ điều hành, ngôn ngữ lập trình phần mềm, dữ liệu, giải thuật.<br />\r\nSinh viên sẽ được nghiên cứu và thực tập các hướng chuyên sâu trong chuyên ngành Khoa học máy tính thuộc lĩnh vực trí tuệ nhân tạo như hệ chuyên gia, tương tác người – máy và ứng dụng trong các môi trường như hệ đa phương tiện; xử lý hình ảnh, âm thanh; phân tích dữ liệu lớn.<br />\r\nTốt nghiệp ngành Khoa học máy tính, sinh viên có khả năng áp dụng các kiến thức khoa học và kỹ thuật trong thiết kế, xây dựng, phân tích và đánh giá các hệ thống công nghệ thông tin; có khả năng tham gia vào các lĩnh vực công nghiệp công nghệ thông tin, đáp ứng các yêu cầu về nghiên cứu phát triển và ứng dụng CNTT của xã hội; có năng lực tham mưu, tư vấn và có khả năng tổ chức thực hiện nhiệm vụ với tư cách của một chuyên viên nghiên cứu trong lĩnh vực CNTT.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '\"\"', 0, 111, 1, '2018-05-31 12:00:00', 1, -1, 1, 0, 0, 1, 'vietnamese', '', '', '', 3, 3, '2018-04-26 13:59:21', '2018-11-16 15:03:45'),
