(15, 'zxczxc', 'zxczxc', '', 66, '[\"66\"]', '/uploads/images/products/hb-0003-3.jpg', '', '\"\"', '\"\"', '', 20000, 5000, '<p>&nbsp;</p>\r\n\r\n<p>Ngày 28/10 Phương Ly chính thức cho ra mắt sản phẩm đánh dấu sự trở lại của mình trong thị trường âm nhạc mang tên \"Mặt Trời Của Em\". Ca khúc được chắp bút bởi nhạc sĩ trẻ Kai Đinh với giai điệu bắt tai, ca từ đẹp cùng phần hỗ trợ rap của Justa Tee.</p>', '<p>&nbsp;</p>\r\n\r\n<p>Ngày 28/10 Phương Ly chính thức cho ra mắt sản phẩm đánh dấu sự trở lại của mình trong thị trường âm nhạc mang tên \"Mặt Trời Của Em\". Ca khúc được chắp bút bởi nhạc sĩ trẻ Kai Đinh với giai điệu bắt tai, ca từ đẹp cùng phần hỗ trợ rap của Justa Tee.</p>\r\n', '<ul>\r\n	<li><span>Mã sản phẩm:</span>CU/CS-N9SKH-8</li>\r\n	<li><span>Nhà sản xuất:</span>Panasonic</li>\r\n	<li><span>Xuất xứ:</span>Chính hãng Malaysia</li>\r\n	<li><span>Bảo hành:</span>Chính hãng 12 tháng, máy nén 7 năm</li>\r\n	<li><span>Phí vận chuyển:</span> Miễn phí nội thành Hà Nội</li>\r\n</ul>\r\n', '', '\"\"', 0, 116, 1, '0000-00-00 00:00:00', 0, -1, 0, 0, 0, 0, 'vietnamese', '', '', '', 3, 7, '2018-12-03 08:55:36', '2019-03-09 09:04:30'),
(16, 'Lời bài hát Phút Ban Đầu', 'loi-bai-hat-phut-ban-dau', 'loi-bai-hat-phut-ban-dau', 66, '[\"66\"]', '/uploads/images/products/hg-0012-6.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '\"\"', '', 0, 0, '<p>Có ô cửa sổ nhỏ, lay hồn ai qua đây&nbsp;<br />\r\nCó giấc mơ là lạ, chạm vào trong ký ức&nbsp;<br />\r\nDường như mây đang khóc, mưa đang hát, hát bài hát mùa yêu.&nbsp;<br />\r\nDương như mây đang đến, mưa đi mất, tôi xao xuyến, em lưu luyến&nbsp;</p>', '<p>Gần em tôi thấy bâng khuâng bâng khuâng con tim này như chết lặng&nbsp;<br />\r\nBóng dáng người như cơn gió lạ, mang em về gần lại bên tôi&nbsp;<br />\r\nDương như góc phố thênh thang thênh thang sương đêm làm ướt tóc ai?&nbsp;<br />\r\nĐừng để nỗi nhớ miên man trong đêm thật dài&nbsp;<br />\r\nHãy để khoảnh khắc tim tôi tim em thật gần, với nhau.&nbsp;<br />\r\n<br />\r\nCó cơn mưa đầu mùa, xa thật xa chốn ấy&nbsp;<br />\r\nCó cô em ngày nào, tóc ngắn ngang vai&nbsp;<br />\r\nDường như mây đang khóc, mưa đang hát, hát bài hát mùa yêu.&nbsp;<br />\r\nDương như mây đang đến, mưa đi mất, tôi xao xuyến, em lưu luyến&nbsp;<br />\r\n<br />\r\nGần em tôi thấy bâng khuâng bâng khuâng con tim này như chết lặng&nbsp;<br />\r\nBóng dáng người như cơn gió lạ, mang em về gần lại bên tôi&nbsp;<br />\r\nDương như góc phố thênh thang thênh thang sương đêm làm ướt tóc ai?&nbsp;<br />\r\nĐừng để nỗi nhớ miên man trong đêm thật dài&nbsp;<br />\r\nHãy để khoảnh khắc tim tôi tim em thật gần, với nhau.&nbsp;<br />\r\n<br />\r\nVà tôi mong sớm mai đây khi em bên tôi, cùng say giấc nồng&nbsp;<br />\r\nKhẽ nhắc về mùa yêu thương đã qua&nbsp;<br />\r\nKhẽ tìm lại giây phút ban đầu, nhé em...</p>\r\n', '', '', '[{\"title\":\"\",\"description\":\"\"}]', 0, 4, 1, '0000-00-00 00:00:00', 1, -1, 0, 0, 0, 0, 'vietnamese', '', '', '', 3, 7, '2018-12-17 15:27:55', '2019-04-19 10:22:22'),
