(20, 'blue eyes white dragon ultimate', 'blue-eyes-white-dragon-ultimate', 'blue-eyes-white-dragon-ultimate', 66, '[\"66\"]', '/uploads/images/products/hb-0381-4.jpg', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '\"\"', '', 2000000, 2000000, '<p>Hanoi – Sapa – Halong Bay – Hue – Hoi An – Ben Tre – Can Tho – Phu Quoc – Ho Chi Minh City</p>', '<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">You’ll get to experience first-hand the beauty and diversity of Vietnam in this highlight tour from North to South. Start your trip with the classic northern loop of Hanoi, Sapa then go on an overnight cruise in Halong Bay, a UNESCO protected World Heritage Site, before heading south to the charming Hue &amp; Hoi An. Compare the traditional capital of Hanoi to Ho Chi Minh City; its bustling new-world counterpart in the South. Finish your trip at beautiful beaches of Phu Quoc islands.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">HIGHLIGHTS</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<ul style=\"margin:0.5em 0px 1em; padding:0px 0px 0px 1.5em; list-style-image:url(&quot;/sites/all/themes/tourist/images/menu-leaf.gif&quot;); color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-size:14px; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\">\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Spend a day venturing through the city, taking in museums, markets and other colorful sights in Hanoi.</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Trekking around ethnic minority villages in Sapa</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">A luxury cruise in Ha Long Bay</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">A romantic escape in quaint Hoi An Town</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Enjoy the idyllic beach paradise of Phu Quoc Island</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Private boat trip on Mekong River to explore the surrounding floating markets and islands.</li>\r\n</ul>\r\n\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">ITINERARY</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Day 1: Hanoi Arrival<br />\r\nDay 2: Full Day Hanoi City Tour<br />\r\nDay 3: Hanoi – Halong Bay<br />\r\nDay 4: Halong Bay – Hanoi/Night train to Sapa<br />\r\nDay 5: Lao Cai – Can Cau Market - Bac Ha<br />\r\nDay 6: Bac Ha - Sapa<br />\r\nDay 7:&nbsp; Y Linh Ho – Sapa/Night train to Hanoi<br />\r\nDay 8: Arrival Hanoi/Fly to Hue – Hue City Tour<br />\r\nDay 9: DMZ Tour<br />\r\nDay 10: Hue – Hoi An Ciy Tour<br />\r\nDay 11: Hoi An – Kim Bong Village – Tra Que Farm – Hoi An<br />\r\nDay 12: Hoi An – My Son – Hoi An<br />\r\nDay 13: Hoi An – Danang/Fly to Ho Chi Minh City<br />\r\nDay 14: Cao Dai Temple – Cu Chi Tunnel<br />\r\nDay 15: Ho Chi Minh City – Mekong Delta – Can Tho<br />\r\nDay 16: Can Tho/Fly to Phu Quoc<br />\r\nDay 17: Phu Quoc<br />\r\nDay 18: Phu Quoc<br />\r\nDay 19: Fly to Ho Chi Minh City/Departure</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n', '<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 1:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;HANOI ARRIVAL (D)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Upon arrival in Hanoi, you will be picked up from the airport and transferred to a hotel in Hanoi for relaxing and your welcome dinner.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Hanoi.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 2:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;FULL DAY HANOI CITY TOUR (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Depart your hotel to visit the Ho Chi Minh Complex (Ho Chi Minh Mausoleum, Ho Chi Minh Museum and One pillar pagoda) and the Tran Quoc Pagoda. Continue to the Temple of Literature, the first University in Vietnam dating back to the 16th century.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">In the afternoon, enjoy a walking tour through the Old Quarter will provide another fascinating insight into the character and history of the city, before moving on to Dong Xuan Market with its bustling stalls and brisk trading of day-to-day local goods. Finish the day with a traditional water puppet show.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Hanoi.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 3:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;HANOI – HALONG BAY (B, L, D)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">After breakfast, transferred to Halong Bay. Arrive at Halong City at noon and proceed with check-in formalities. After your welcome onboard, a lunch will be served while cruising towards the bay itself. A truly memorable experience awaits you as you cruise the delightful Bay. In the afternoon, enjoy some visits and/or activities depending on each boat’s itinerary or just spend some time relaxing on board.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Towards the end of the day the boat sets anchor for the night among the karst formations. Dinner is served on board.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight onboard Halong Bay.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 4:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;HALONG BAY – HANOI/NIGHT TRAIN TO SAPA (BRUNCH)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Start your day with calming Tai Chi, enjoy the sunrise over the Bay and continue cruising. Enjoy the brunch on the way back to port, transfer to Hanoi. En route visit Thanh Chuong Palace, the home and studio of Thanh Chuong, of the most celebrated painters in Vietnam. More a living space than a museum, the Palace is an architectural gem showcasing Vietnamese traditional cultural objects, exquisite antiques and remarkable structures.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Continue driving to Hanoi, free time at leisure until transfer to the Railway Station for a night train to Sapa.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<div style=\"text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight on train.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></div>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 5:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;SAPA – CAN CAU MARKET – BAC HA (B, L, D)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Arrive in Lao Cai early morning. Our local team meets the group at the station before the transfer to a local restaurant in Lao Cai for a breakfast. Depart for Can Cau to explore its atmospheric market. The market has been in existence for many years and always a riot of colours, many different ethnic groups gather to buy and sell their livestock, fresh produce and traditional handicrafts.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Continue on to Bac Ha Town, approximately 2.5 hours’ drive east of Sapa and close to the Chinese border. The journey is an extremely interesting one as you drive through some stunning scenery and pass numerous minority hill tribe villages en route.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">After checking in at your hotel the remainder of your day is at leisure to explore the town or walk to nearby hamlets.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Bac Ha.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 6:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;BAC HA – SAPA (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">After breakfast, we explore Bac Ha town and colourful market which takes place every Sunday. This is an important weekly gathering of hill tribe and ethnic minority people and the most famous of all the markets in the region.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">After lunch and refreshments, travel by road to Sapa town, taking time to stop at Thai Rang Pho to visit a school at the Hmong Village. Arriving in Sapa in the afternoon and check in to your hotel. The remainder of your day is at leisure.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Sapa.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 7:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;SAPA – Y LINH HO – SAPA/NIGHT TRAIN TO HANOI (B, L, D)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Morning drive to Y Linh Ho from where you will start your days trek with a walk into the Muong Hoa Valley below, passing through some of the stunning rice paddy terraces that the region is so well known for.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">The total trekking time is likely to be three to four hours and throughout the morning the backdrop is breathtaking. You will stop at several spots that offer panoramic views of the valleys below and you are also likely to pass many H’mong people. Thanks to the linguistic skills of your guide, you will have the opportunity to interact with them and learn more about their way of life.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Having returned to Sapa for lunch, in the afternoon take a trail heading out of town. Passing through beautiful gardens and lush pine forests you will soon arrive at the Black H\'mong ethnic minority village of Matra.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">The late afternoon is at leisure in Sapa, with a late check-out arranged at your hotel, before your transfer to Lao Cai for the overnight train back to Hanoi.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight on train.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 8:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;ARRIVAL HANOI/FLY TO HUE – FULL DAY HUE CITY TOUR (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Continue driving to Hanoi Airport, then take a short flight to Hue. Arrival Hue, check in Hotel. After short refreshing time, we visit the Imperial Citadel where the Nguyen Dynasty ruled between 1802 and 1945. From here take a cyclo through Dai Noi ‘Old City’ to Tinh Tam Lake where the Emperors used to come to relax.&nbsp;Continue to visit Thien Mu (Celestial Lady) Pagoda overlooking the Perfume River.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">In the afternoon see the tomb of the former emperor Minh Mang which is located in a tranquil setting of gardens and ponds. Journey on to Khai Dinh’s Tomb which is traditional Vietnamese in design with a European touch making it unique from the other tombs in Hue.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Before heading back to your hotel take time to stroll around Dong Ba Market, a great place to catch a glimpse of everyday life.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Hue.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 9:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;DMZ TOUR (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">After breakfast, drive north and stop at La Vang Cathedral (which despite its years of turmoil remains an important pilgrimage site for Vietnam’s Catholics). Carry on to what is left of Quang Tri Citadel, where in 1972 a fierce battle raged for 81 days, visit the museum where photographs, war remnants and artillery can be seen.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Continue up Highway 1 across the Hien Luong Bridge, and over the Ben Hai River which demarcated North and South Vietnam, this area saw some of the heaviest fighting during the war. Doc Mieu Firebase, which lies just north of here, played a pivotal role in the South\'s defence and for a while, this was the command post for calling in airstrikes along the Ho Chi Minh Trail.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">The journey from here to Vinh Moc Tunnels is scenic after you leave the main highway, pass through quaint villages and skirt along Cua Tung Beach. The village of Vinh Moc found itself tragically positioned in one of the most heavily bombed areas of Vietnam.&nbsp; In order to escape this bombardment, the villagers constructed approximately 2.8 km of underground tunnels which they used as a refuge to survive the bombings.&nbsp; Three hundred people lived intermittently in the tunnels from 1966 to 1971.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">From Vinh Moc drive to Truong Son National Cemetery where the remains of some 15,000 Vietnamese soldiers and civilians have been laid to rest, sadly many tombstones bear no name.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Hue.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 10:&nbsp;&nbsp; &nbsp;HUE – HOI AN (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Transfer to Hue via the Hai Van Pass and through the picturesque fishing village of Lang Co. Drive through Danang and visit the Cham museum which contains the finest collection of Cham sculptures in the world. Arrive Hoi An, check in hotel.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">In the afternoon, enjoy a walking tour around Hoi An ancient town and explore its treasures: the Japanese Bridge, Phuc Kien Pagoda, Phung Hung Old Merchant House, and Quang Dong Assembly Hall.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Hoi An.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 11:&nbsp;&nbsp; &nbsp;HOI AN – KIM BONG VILLAGE – TRA QUE FARM – HOI AN (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Take a morning boat journey along the Hoi An River to the village of Kim Bong. The village residents have long been famed for their carpentry skills. Disembark and enjoy a walk through the village, stopping to visit old Colonial houses, temples, several workshops and shops.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Crossing back to the mainland by boat, drive to the village of Tra Que to visit a farm where you can learn about the traditional gardening methods deployed by the residents of the region. Transfer back to Hoi An in the early afternoon where the remainder of your day is at leisure.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Hoi An.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 12:&nbsp;&nbsp; &nbsp;HOI AN – MY SON – HOI AN (B)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">This morning we will visit the temple complex at My Son. Granted UNESCO World Heritage status in 1999 the tower-temples were the seat of the Champa Kingdom for the majority of its existence between the 4th and 13th centuries.&nbsp;In the late morning return to Hoi An Town. Your afternoon is at leisure.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Hoi An.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 13:&nbsp;&nbsp; &nbsp;HOI AN – DANANG/FLY TO HO CHI MINH CITY (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">After breakfast, drive to Danang to take the morning flight to Ho Chi Minh City. Upon arrival, you will be transferred to hotel, check in.&nbsp;</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">In the afternoon, visit the Former Presidential Palace, the town’s center with the Notre Dame Cathedral, the City Hall, the Municipal Theater, Quan Am Pagoda, Cho Lon and China town.&nbsp;</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Finish the tour in fine style by heading up the Bitexco Tower, which is the city’s tallest building. Your guide will be happy to wait for a short while whilst you enjoy a stylish sundowner with breath-taking skyline views.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Ho Chi Minh City.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 14:&nbsp;&nbsp; &nbsp;CAO DAI TEMPLE – CU CHI TUNNEL (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Depart Ho Chi Minh City in the morning for the drive to Tay Ninh visit the Cao Dai Temple, a syncretistic, home-grown Vietnamese religion which incorporates aspects of Buddhism, Taoism, Confucianism and Catholicism. Construction of the Cao Dai Holy See began in 1933. It has a unique architectural style which reflect the roots of its blended traditions.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">After lunch in a local restaurant visit the famous Cu Chi, an incredible underground tunnel network constructed by Vietnamese resistance fighters during the long struggle for independence. The tunnels, over 250km in length and up to three levels deep in places, played a huge part in the Viet Cong’s victory over the Americans, allowing them to control a large rural area surrounding Ho Chi Minh City.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">In the late afternoon journey back to Ho Chi Minh City.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Overnight in Ho Chi Minh City.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<hr style=\"border:medium none; height:1px; margin:12px 0px; padding:0px; background:#e2e2e2; clear:both; display:block; font-size:1px; color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\" />\r\n<h4 style=\"margin:0px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:16px\"><span style=\"font-weight:normal\"><span style=\"color:#cc0033\"><span style=\"font-family:OpenSans-Bold\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">DAY 15:&nbsp;&nbsp; &nbsp;SAIGON – MEKONG DELTA – CAN THO (B, L)</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h4>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">This morning, leave bustling Ho Chi Minh City for the 2 hour drive to the delta town of Ben Tre. Board your local boat through small canals with beautiful tropical scenery. En-route visit the brick making factory, where the locals still use centuries-old traditional methods to make the bricks by hand then visit a small factory producing handicrafts made of coconut. Afterwards, take a ride on a horse driven cart along country roads, through the fruit plantation before enjoying lunch at riverside restaurant.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"', '<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\"><strong>SERVICE INCLUDED</strong></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<ul style=\"margin:0.5em 0px 1em; padding:0px 0px 0px 1.5em; list-style-image:url(&quot;/sites/all/themes/tourist/images/menu-leaf.gif&quot;); color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-size:14px; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\">\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Shared accommodation in twin/double room with daily breakfast</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Tours as per itinerary with local speaking guide (NO guide on board Halong Bay)</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">All transfers and transportation with air-con vehicles</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">All entrance fees as program</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Train ticket: Hanoi-Laocai-Hanoi (soft sleeper bed, share cabin)</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Private boat trips in Mekong Delta</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Meals (B: Breakfast; L: Lunch; D: Dinner) as indicated in the program</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">A bottle of mineral water per day tour</li>\r\n</ul>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">&nbsp;<br />\r\n<strong>SERVICE EXCLUDED</strong></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<ul style=\"margin:0.5em 0px 1em; padding:0px 0px 0px 1.5em; list-style-image:url(&quot;/sites/all/themes/tourist/images/menu-leaf.gif&quot;); color:#000000; font-family:OpenSans-Regular, OpenSans, Arial, Tahoma; font-size:14px; font-style:normal; font-variant-ligatures:normal; font-variant-caps:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:start; text-transform:none; white-space:normal; widows:2; word-spacing:0px; -webkit-text-stroke-width:0px; text-decoration-style:initial; text-decoration-color:initial\">\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Drinks</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Mineral water beyond that supplied</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Tips</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Personal expenses and tips</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Visa to Vietnam</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Airfares (international and domestic)</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Meals (other than mentioned in the program)</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Airport taxes&nbsp;&nbsp;</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Early check in or late check out</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Insurances</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Optional excursions and activities</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Additional transfer required due to any emergency situation</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Items of a personal nature (Phone calls, laundry, beverages…)</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">Peak season surcharges if any</li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\">All not mentioned above</li>\r\n</ul>\r\n', '\"\"', 0, 31, 1, '0000-00-00 00:00:00', 0, -1, 1, 0, 0, 0, 'vietnamese', '', '', '', 3, 7, '2018-12-17 15:36:17', '2019-03-27 15:49:36');
