(66, 'Vietnam', 'vietnam', 'vietnam', 0, 2, 3, 1, 0, '/uploads/images/sen-picture2-1-0.jpg', '15 ngày', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '\"\"', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi porta ex et pretium bibendum. Suspendisse potenti. Sed vehicula gravida porta. Integer at consequat libero. Phasellus suscipit odio at ipsum pellentesque bibendum. Nullam pharetra augue et arcu pulvinar, ac hendrerit arcu maximus. Nunc pellentesque tincidunt ante, vitae vulputate velit porta quis.</p>', '{\"attribute_catalogue\":[\"8\"],\"attribute\":{\"capacity\":[\"47\",\"48\",\"46\"]}}', 0, 1, 1, 0, 0, 0, 0, 'vietnamese', '', '', '', 3, 7, '2017-11-29 14:33:44', '2019-03-27 10:15:08'),
(77, 'Quy trình sản phẩm', 'quy-trinh-san-pham', 'quy-trinh-san-pham', 0, 6, 7, 1, 4, '/uploads/images/caro-product-4.jpg', '/uploads/images/ic10.png', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"V\\u1edbi vi\\u1ec7c l\\u1ea5y tr\\u1ebb l\\u00e0m trung t\\u00e2m, TEF th\\u00fac \\u0111\\u1ea9y s\\u1ef1 ph\\u00e1t tri\\u1ec3n to\\u00e0n di\\u1ec7n c\\u1ee7a tr\\u1ebb th\\u00f4ng qua vi\\u1ec7c h\\u1ecdc c\\u00e1c k\\u1ef9 n\\u0103ng : t\\u01b0 duy ph\\u00e2n t\\u00edch, S\\u00e1ng t\\u1ea1o, r\\u00e8n luy\\u1ec7n s\\u1ef1 t\\u1ef1 tin, kh\\u1ea3 n\\u0103ng giao ti\\u1ebfp v\\u00e0 tinh th\\u1ea7n h\\u1ee3p t\\u00e1c cho tr\\u1ebb. Tr\\u1ebb h\\u1ecdc b\\u1eb1ng vi\\u1ec7c nh\\u00ecn nghe, ch\\u1ea1m v\\u00e0 \\u00e1p d\\u1ee5ng v\\u1edbi c\\u00e1c m\\u00f4n h\\u1ecdc quen thu\\u1ed9c, th\\u00f4ng qua \\u0111\\u00f3 tr\\u1ebb s\\u1ebd \\u0111\\u01b0\\u1ee3c:\\r\\n- Trang b\\u1ecb ki\\u1ebfn th\\u1ee9c v\\u00e0 k\\u1ef9 n\\u0103ng s\\u1ed1ng \\u0111\\u1ec3 tr\\u1ebb t\\u1ef1 tin b\\u01b0\\u1edbc v\\u00e0o tr\\u01b0\\u1eddng h\\u1ecdc v\\u00e0 cu\\u1ed9c s\\u1ed1ng\\r\\n- Ph\\u00e1t tri\\u1ec3n kh\\u1ea3 n\\u0103ng s\\u00e1ng t\\u1ea1o gi\\u1ea3i quy\\u1ebft v\\u1ea5n \\u0111\\u1ec1\\r\\n- Ph\\u00e1t tri\\u1ec3n k\\u1ef9 n\\u0103ng giao ti\\u1ebfp\\r\\n- Kh\\u01a1i g\\u1ee3i v\\u00e0 nu\\u00f4i d\\u01b0\\u1ee1ng \\u0111am m\\u00ea h\\u1ecdc t\\u1eadp cho tr\\u1ebb\\r\\n\"},{\"images\":\"STT\",\"title\":\"\",\"description\":\"TEF gi\\u00fap tr\\u1ebb ph\\u00e1t tri\\u1ec3n to\\u00e0n b\\u1ed9 4 k\\u1ef9 n\\u0103ng Ti\\u1ebfng Anh v\\u00e0 c\\u1ea3i thi\\u1ec3n ng\\u1eef ph\\u00e1p, v\\u1ed1n t\\u1eeb v\\u1ef1ng v\\u00e0 c\\u00e1ch ph\\u00e1t \\u00e2m trong ng\\u1eef c\\u1ea3nh th\\u1ef1c t\\u1ebf sinh \\u0111\\u1ed9ng. D\\u1ea1y b\\u00e9 ph\\u00e1t \\u00e2m v\\u00e0 s\\u1eed d\\u1ee5ng m\\u1ed9t s\\u1ed1 c\\u00e2u giao ti\\u1ebfp t\\u1eeb \\u0111\\u01a1n gi\\u1ea3n \\u0111\\u1ebfn ph\\u1ee9c t\\u1ea1p \\u0111\\u1ec3 t\\u0103ng c\\u01b0\\u1eddng k\\u1ef9 n\\u0103ng ph\\u1ea3n x\\u1ea1 cho b\\u00e9.\"},{\"images\":\"STT\",\"title\":\"\",\"description\":\"H\\u1ecdc ti\\u1ebfng anh th\\u00f4ng qua phim ho\\u1ea1t h\\u00ecnh b\\u1eb1ng ti\\u1ebfng anh sau \\u0111\\u00f3 \\u0111\\u1ec3 c\\u00e1c b\\u00e9 k\\u1ec3 l\\u1ea1i t\\u00ean nh\\u00e2n v\\u1eadt, \\u0111\\u1ed3 v\\u1eadt, c\\u00e2u tho\\u1ea1i \\u0111\\u01a1n gi\\u1ea3n,..trong phim \\u0111\\u1ec3 t\\u1eadp cho b\\u00e9 k\\u1ef9 n\\u0103ng ghi nh\\u1edb.\"},{\"images\":\"STT\",\"title\":\"\",\"description\":\"(H\\u1eccC CH\\u1ee6 \\u0110\\u1ed8NG)  TEF c\\u00f3 nhi\\u1ec1u ph\\u01b0\\u01a1ng ph\\u00e1p \\u0111a d\\u1ea1ng cho vi\\u1ec7c trau d\\u1ed3i anh ng\\u1eef- h\\u1ecdc t\\u1eeb theo nh\\u00f3m, qua video, b\\u00e0i h\\u00e1t \\u2026.. Khuy\\u1ebfn kh\\u00edch c\\u00e1c b\\u00e9 t\\u01b0\\u01a1ng t\\u00e1c c\\u00f9ng gi\\u00e1o vi\\u00ean b\\u1ea3n ng\\u1eef v\\u00e0 b\\u1ea1n b\\u00e8 \\u0111\\u1ec3 kh\\u1ea3 n\\u0103ng giao ti\\u1ebfp c\\u1ee7a b\\u00e9 \\u0111\\u01b0\\u1ee3c c\\u1ea3i thi\\u1ec7n v\\u00e0 hi\\u1ec7u qu\\u1ea3 h\\u01a1n\"},{\"images\":\"STT\",\"title\":\"\",\"description\":\"(H\\u1eccC M\\u00c0 VUI) Ch\\u01b0\\u01a1ng tr\\u00ecnh h\\u1ecdc t\\u1ea1i TEF \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf ri\\u00eang ph\\u00f9 h\\u1ee3p cho t\\u1eebng \\u0111\\u1ed9 tu\\u1ed5i, b\\u00e9 luy\\u1ec7n ti\\u1ebfng anh qua tr\\u00f2 ch\\u01a1i, s\\u00e1ch b\\u00e0i c\\u00f9ng v\\u1edbi c\\u00e1c ch\\u01b0\\u01a1ng tr\\u00ecnh ngo\\u1ea1i kh\\u00f3a v\\u1edbi gi\\u00e1o vi\\u00ean b\\u1ea3n ng\\u1eef khi\\u1ebfn vi\\u1ec7c h\\u1ecdc tr\\u1edf n\\u00ean l\\u00f4i cu\\u1ed1n v\\u00e0 th\\u00fa v\\u1ecb h\\u01a1n. B\\u1eb1ng ph\\u01b0\\u01a1ng ph\\u00e1p h\\u1ecdc t\\u1eeb v\\u1ef1ng qua h\\u00ecnh \\u1ea3nh minh h\\u1ecda vui nh\\u1ed9n c\\u00f3 th\\u1ec3 b\\u00e9 nh\\u1edb nhanh h\\u01a1n, ph\\u01b0\\u01a1ng ph\\u00e1p h\\u1ecdc m\\u00e0 ch\\u01a1i, ch\\u01a1i m\\u00e0 h\\u1ecdc \\u0111\\u00e3 thu h\\u00fat nhi\\u1ec1u tr\\u1ebb h\\u1ecdc ti\\u1ebfng anh hi\\u1ec7u qu\\u1ea3.\"},{\"images\":\"STT\",\"title\":\"\",\"description\":\"M\\u00f4i tr\\u01b0\\u1eddng h\\u1ecdc c\\u1ee7a TEF th\\u00fa v\\u1ecb, gi\\u00e0u t\\u00ednh t\\u01b0\\u01a1ng t\\u00e1c ph\\u00f9 h\\u1ee3p v\\u1edbi t\\u1eebng l\\u1ee9a tu\\u1ed5i, \\u0111\\u1ea7y t\\u00ednh sang t\\u1ea1o v\\u00e0 nh\\u1eadn s\\u1ef1 h\\u1ed7 tr\\u1ee3 t\\u1ed1t nh\\u1ea5t cho vi\\u1ec7c h\\u1ecdc ti\\u1ebfng anh.\"},{\"images\":\"STT\",\"title\":\"\",\"description\":\"\\u00c1p d\\u1ee5ng c\\u00e1c h\\u00ecnh th\\u1ee9c khuy\\u1ebfn kh\\u00edch v\\u00e0 khen th\\u01b0\\u1edfng \\u0111\\u1ec3 c\\u00e1c b\\u00e9 \\u0111\\u1ea1t th\\u00e0nh t\\u00edch t\\u1ed1t, c\\u1ea3m th\\u1ea5y th\\u00e0nh c\\u00f4ng trong m\\u1ed7i gi\\u1edd h\\u1ecdc t\\u1eeb \\u0111\\u00f3 c\\u00e1c b\\u00e9 c\\u00e0ng nhi\\u1ec7t huy\\u1ebft v\\u00e0 mu\\u1ed1n \\u0111\\u1ea1t th\\u00e0nh t\\u00edch cao h\\u01a1n.\"}]', '[{\"images\":\"\\/uploads\\/images\\/video\\/he-thong-giao-duc-tai-nang.jpg\",\"title\":\"https:\\/\\/www.youtube.com\\/watch?v=WpUKKVuj0nI\",\"description\":\"<p><strong>Trung t\\u00e2m Anh ng\\u1eef T\\u00e0i n\\u0103ng TEF thu\\u1ed9c H\\u1ec7 th\\u1ed1ng Gi\\u00e1o d\\u1ee5c T\\u00e0i n\\u0103ng TEF<\\/strong><br \\/>\\r\\nC\\u01a1 s\\u1edf 1: 56 Gi\\u1ea3ng V\\u00f5, \\u0110\\u1ed1ng \\u0110a, H\\u00e0 N\\u1ed9i<br \\/>\\r\\nC\\u01a1 s\\u1edf 2: 77A Trung K\\u00ednh, C\\u1ea7u Gi\\u1ea5y, H\\u00e0 N\\u1ed9i<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1ebfn v\\u1edbi TEF c\\u00e1c b\\u00e9 \\u0111\\u01b0\\u1ee3c tr\\u1ea3i nghi\\u1ec7m ph\\u01b0\\u01a1ng ph\\u00e1p h\\u1ecdc m\\u1edbi hi\\u1ec7u qu\\u1ea3 h\\u01a1n gi\\u00fap c\\u00e1c b\\u00e9 y\\u00eau th\\u00edch v\\u00e0 \\u0111am m\\u00ea ti\\u1ebfng anh h\\u01a1n.<\\/p>\\r\\n\"}]', '<div class=\"term-decription\">\r\n<p>Túi Tshirt (Túi ni lông, Túi nylon, Túi xốp, Túi nhựa, Túi T-shirt, Túi dập quai, Túi bóng, Túi xốp siêu thị) là một trong những túi được dùng phổ biến nhất ở Việt Nam và các nước bởi giá thành thấp và dễ sử dụng.</p>\r\n\r\n<p>Túi nilon là giải pháp bao bì tối ưu cho các siêu thị, cửa hàng và cho các hộ gia đình. Túi nilon là một trong những công cụ tiếp thị hiệu quả nhất ví dụ như để thể hiện sự cảm ơn với khách hàng (túi “Thank You”) hay dùng để nhận diện thương hiệu của bạn.</p>\r\n\r\n<p>Chất liệu: HDPE, LDPE, MDPE, LLDPE, nguyên sinh<br />\r\nPhụ gia: các chất phân hủy sinh học, hạt màu, tái chế<br />\r\nIn: In 1 hoặc 2 màu bên hoặc không in<br />\r\nKhả năng in tối đa: 1-16 màu (2 bên túi)<br />\r\nThiết kế: túi nilon có gấp hông,quai dạng thông thường xếp theo từng tệp hoặc riêng lẻ hay có lỗ ở 2 bên quai.</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 3, 7, '2018-02-01 15:20:04', '2019-01-19 13:37:50'),
