(90, 'Giải pháp và thiết bị kiểm nghiệm', 'giai-phap-va-thiet-bi-kiem-nghiem', 'giai-phap-va-thiet-bi-kiem-nghiem', 66, 3, 4, 2, 0, '', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 0, '2019-02-14 11:32:52', '0000-00-00 00:00:00'),
(91, 'Intro', 'intro', 'intro', 92, 4, 5, 3, 0, '/uploads/images/vietnam-1-.jpg', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Although many westerners still imagine Vietnam through the lens of war, it is in reality a country filled with fascinating natural beauty and tranquil village life. Blessed with a ravishing coastline, emerald-green mountains, breathtaking national parks, dynamic cities, outstanding cultural interest and one of the world’s best cuisines, Vietnam has it all.</p>\r\n\r\n<p>The culture-addicts can seek the soul of Vietnam, amongst the silk boutiques of Hanoi’s Old quarter, through the lush paddy fields and the colorful hill tribes in Sa Pa, on boat trips into the bustling floating markets in Mekong Delta, amongst the beauty of limestone karsts of Halong Bay, around the ancient tombs and temples of Hue’s Imperial City, and in the flamboyant Colonial facades of Ho Chi Minh City.</p>\r\n\r\n<p>For the food-lovers, Vietnamese cuisine doesn\'t need an introduction. It\'s admired by foodies worldwide for good reason. The food-lovers can visit the best foodie stalls on the street food safaris in Saigon and Hanoi and learn a trick or two in one of the many Vietnamese cooking classes.</p>\r\n\r\n<p>If you want beautiful beaches, then witness the spectacular sandy beaches of the central coastline and explore the reefs and coves of the Cham, Phu Quoc and Con Dao Islands.</p>\r\n\r\n<p>For trekkers and bikers, Sapa &amp; Bac Ha offer a wide range of adventure holidays, both active and not-so-active. Without a doubt cycling is one of the many finest ways to discover a country where hospitality comes as second nature.</p>\r\n\r\n<p>No matter how many times you’ve encountered Vietnam, the Vietnam’s food, people, sights and history keep even the most seasoned travelers coming back for more.</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 7, '2019-03-26 14:19:58', '2019-03-26 14:20:43'),
(92, 'Vietnam overview', 'vietnam-overview', 'vietnam-overview', 66, 3, 4, 2, 0, '/uploads/images/sen-picture2-1-0.jpg', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '\"\"', '', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 7, '2019-03-26 14:20:35', '2019-03-26 14:30:36'),
(93, 'Weather & When to go', 'weather-when-to-go', 'weather-when-to-go', 92, 4, 5, 3, 0, '', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>There is no real best or worst time to visit Vietnam, with travel possible all year, but the seasons vary across the country and you will experience both sunshine and rain in varying quantities. Welcome to a country with more than 3000 km of coastline and three different weather systems.</p>\r\n\r\n<p><strong>Mountainous North (Ha Giang, Sapa, Bac Ha)</strong><br />\r\nThe climate in Sapa and Vietnam’s far north-west is divided into two seasons:&nbsp; the dry season runs from October to late March with the wet season lasting&nbsp; from April to September. It can get very cold in December and January, especially at night.</p>\r\n\r\n<p>The best months to travel in the north-east (Ha Giang) is during the dry season, from October to April,&nbsp;although December and January can get very cold. We recommend avoiding travelling&nbsp; in Ha Giang during the rainy season (May to September).</p>\r\n\r\n<p>Daytime temperatures range from 15-28°C, and night-time temperatures from 10-18°C. Trekking and cycling are possible year round, however the wintertime can be rather chilly, and the summer rather wet.</p>\r\n\r\n<p><strong>North Vietnam (Hanoi, Halong Bay, Mai Chau, Ninh Binh)</strong><br />\r\nNorthern Vietnam has a distinct winter and summer season. The cool but mostly dry winter lasts from November to April when temperatures average 17-22°C with the coldest months being January - March.</p>\r\n\r\n<p>However, it is possible to experience lovely sunny, cloudless days here during this period. Summer lasts from May to October when it is hot and humid and the region experiences its highest rainfall. July to September are often the wettest months of the year.</p>\r\n\r\n<p><strong>Central Vietnam (Hue, Hoi An, Danang, Quy Nhon, Nha Trang)</strong><br />\r\nThe centre of Vietnam have hot and dry weather from mid-January to late August, with temperatures often reaching the mid-30\'s °C. The wettest from September through to December see monsoon rains and occasional typhoons which can cause flooding in the area.</p>\r\n\r\n<p>Consequences, to accommodate the weather conditions, there may be last minute changes to itineraries.</p>\r\n\r\n<p><strong>South Vietnam (Ho Chi Minh City, the Mekong Delta, Da Lat, Phu Quoc)</strong><br />\r\nWith temperatures remaining constant year round the climate of the south is split into two simple seasons, wet and dry. The dry season begins in November and ends in April/early May with late February to May being slightly hotter and with higher humidity. The wet season lasts from May to early November with the months from June to August receiving the highest rainfall of the year. The average temperatures in the south range between 25 - 35°C year round.</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 0, '2019-03-26 14:21:38', '0000-00-00 00:00:00'),
(94, 'Where to go', 'where-to-go', 'where-to-go', 66, 11, 12, 2, 0, '', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '\"\"', '<h2 class=\"node-title\" style=\"margin:5px 0px 20px; padding:0px; text-align:start; -webkit-text-stroke-width:0px\"><span style=\"font-size:25px\"><span style=\"font-weight:normal\"><span style=\"line-height:25px\"><span style=\"font-family:OpenSans-Bold\"><span style=\"color:#cc0033\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Where to go in Vietnam?</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></h2>\r\n\r\n<div class=\"content clearfix\" style=\"text-align:start; -webkit-text-stroke-width:0px\">\r\n<div class=\"field field-name-body field-type-text-with-summary field-label-hidden\">\r\n<div class=\"field-items\">\r\n<div class=\"field-item even\" property=\"content:encoded\">\r\n<p style=\"margin:8px 0px 12px; padding:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Vietnam has so much to offer, to all kind of travelers. If you want to travel the length of the country at some leisure, meet the people, see something of the highlands and the deltas, you should set aside a month. With only two weeks at your disposal, the choice is either to hopscotch up the coast calling at only the most mainstream destinations or, perhaps better, to concentrate on one region and enjoy it at your own pace. However, if you do want to see both north and south in a fortnight, internal flights can speed up an itinerary substantially, and aren’t too expensive. Our team at Sen Travel Group is happy to make suggestion and share our destination knowledge with you.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Hanoi and Ho Chi Minh City are the Vietnam’s two main hubs for almost international travelers. If you start in the north, you will arrive to the city of Hanoi-Vietnam’s capital for over a thousand years. You will have time to explore the new culture, soak in to a place of pagodas and dynastic temples, tamarisk-edged lakes and elegant boulevards of French-era villas. From Hanoi, most would then include a stop in Halong Bay, staying on a traditional junk before traveling south for many highlights of their journey in Vietnam. Alternatively, you may wish to spend longer in the north-home to a patchwork of ethnic minorities and the country’s most dramatic mountain landscapes like in Sapa, Ha Giang or to the south of Hanoi in the Mai Chau Valley, Ninh Binh or the Cuc Phuong National Park</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">To the south of the imperial city of Hue, you will discover the former capital’s historic citadel, mausoleums and gardens before riding over the Hai Van pass to Da Nang and Hoi An. If you have more time, take one or two-day trip from Hue to the Demilitarized Zone (DMZ), which cleaved the country in two from 1954 to 1975.&nbsp;</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Before traveling to Ho Chi Minh City and spending a day or more on the water and visiting a floating markets of the Mekong Delta, you should spend at least few days on one of idyllic beaches of Danang, Quy Nhon, Nha Trang in the center or the southern beaches of Phan Thiet &amp; Mui Ne or the islands of Phu Quoc and Con Dao. Da Lat, the gateway to the central highlands is the ideal entry point to the region. There are also the less travelled in the central highlands to consider, such as Buon Ma Thuot, Pleiku and Kontum, which are surrounded by ethnic minority tribes.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">&nbsp;</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:8px 0px 12px; padding:0px\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\"><span style=\"font-size:26px\"><span style=\"font-family:tahoma, geneva, sans-serif\"><span style=\"color:#cc0033\"><strong>Things not to miss</strong></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n\r\n<ul style=\"margin:0.5em 0px 1em; padding:0px 0px 0px 1.5em; list-style-image:url(&quot;/sites/all/themes/tourist/images/menu-leaf.gif&quot;)\">\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Explore the evocative of the Hanoi Old Quarter</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Browse the local markets</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Soak up the atmosphere at a street kitchen</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Cruise the sparkling waters of Halong Bay</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Take a cyclo ride for an up-close view of street life</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Trek in the northern mountains around Sapa</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Sit back and relax on the Reunification Express</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Admire the former capital’s historic citadel of Hue</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Express silk tailoring in Hoi An</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Take a snorkeling trip in the emerald waters of the outlying islands around Nha Trang</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Experience the most important festival in the Vietnamese calendar, TET</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Experience life under the ground of Cu Chi Tunnels</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Enjoy the genuine hospitality on a Mekong Delta farmstay</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Relax on unspoilt beaches of Phu Quoc Island</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Learn the secret of Vietnamese cuisine through a cooking class</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n	<li style=\"margin:0.15em 0px 0.15em 0.5em; padding-bottom:0.1em\"><span style=\"font-size:14px\"><span style=\"color:#000000\"><span style=\"font-family:OpenSans-Regular, OpenSans, Arial, Tahoma\"><span style=\"font-style:normal\"><span style=\"font-variant-ligatures:normal\"><span style=\"font-variant-caps:normal\"><span style=\"font-weight:400\"><span style=\"letter-spacing:normal\"><span style=\"orphans:2\"><span style=\"text-transform:none\"><span style=\"white-space:normal\"><span style=\"widows:2\"><span style=\"word-spacing:0px\"><span style=\"text-decoration-style:initial\"><span style=\"text-decoration-color:initial\">Chill out in Ho Chi Minh City</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 7, '2019-03-26 14:22:40', '2019-03-27 09:02:15'),
