(96, 'Hotels/Resorts', 'hotels-resorts', 'hotels-resorts', 66, 21, 22, 2, 0, '', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 0, '2019-03-26 14:23:14', '0000-00-00 00:00:00'),
(97, 'Classic Cultures', 'classic-cultures', 'classic-cultures', 95, 4, 5, 3, 0, '', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<p>Whatever your interest we are confident we will find the perfect holidays for you. The itineraries shown below are designed to give you an inspiration of what is possible and can be tailored to suit your preferences.</p>\r\n\r\n<p>We invite you to call or email to us to start planning your next adventure and to experience the real Indochine with us.</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 0, '2019-03-26 15:06:01', '0000-00-00 00:00:00'),
(98, 'Adventure Travels', 'adventure-travels', 'adventure-travels', 95, 6, 7, 3, 0, '/uploads/images/sen-picture2-1-0.jpg', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 0, '2019-03-26 15:07:29', '0000-00-00 00:00:00'),
(99, 'Special Interests', 'special-interests', 'special-interests', 95, 8, 9, 3, 0, '/uploads/images/sen-picture2-1-0.jpg', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 0, '2019-03-26 15:07:51', '0000-00-00 00:00:00'),
(100, 'Visa', 'visa', 'visa', 92, 4, 5, 3, 0, '/uploads/images/sen-picture2-1-0.jpg', '', '[{\"images\":\"STT\",\"title\":\"\",\"description\":\"\"}]', '\"\"', '<p>Citizens of the UK, EU countries, Australia, New Zealand, Canada and the United States require a visa to visit Vietnam. The standard tourist visa is a single entry visa that allows you to travel in Vietnam for 28 days from the date of your entry.&nbsp; If you exist Vietnam for an extension trip to Cambodia, Laos or Myanmar, you will require a new visa to enter. Sen Travel Group can assist and facilitate applications for Tourist visa.</p>\r\n\r\n<p><strong>How to obtain a tourist visa?</strong></p>\r\n\r\n<p><strong>Visa application in your country before departure</strong><br />\r\nIn case there is a Vietnamese Embassy or Consulate in your country. Apply directly at the Vietnamese embassy or consulate. The length of the process can vary. You will need one clear page (per visa) in a full passport that is valid for at least 6 months beyond the date of your departure from Vietnam.</p>\r\n\r\n<p><strong>Pre-arranged visa-on-arrival at international entry points:</strong><br />\r\nIn case there is no Vietnamese Embassy or Consulate in your country. Sen Travel Group can assist by applying for the approval locally in Vietnam and sending you a copy of this Approval Letter. We do not require your passport or photos, requiring just a completed form which you can return to us by email. You will then be issued with a letter of authorization to obtain your visas stamp upon landing. You must print out and bring this Visa Approval Letter to the airline check-in counter. Without this letter the airline will refuse you boarding. On arrival in Vietnam, before going through passport control proceed to the Visa on Arrival counter with your letter. You will then be asked to fill one more form, give 2 photos and pay 45USD/person (single entry), 65 USD/person (multi-entry until 28 days) or 95 USD/person (multi-entry until 45 days) in cash before the visa is stamped into your passport and handed back.</p>', '{\"attribute_catalogue\":null,\"attribute\":null}', 0, 1, 0, 0, 0, 0, 1, 'vietnamese', '', '', '', 7, 7, '2019-03-26 15:38:03', '2019-03-27 08:57:11');
