(4, 'Chính chủ cần tiền bán gấp Vinhomes 56 Nguyễn Chí Thanh Tầng 20', 'chinh-chu-can-tien-ban-gap-vinhomes-56-nguyen-chi-thanh-tang-20', 'chinh-chu-can-tien-ban-gap-vinhomes-56-nguyen-chi-thanh-tang-20', 5, '#3_10001', 'vietnamese', 0, 24, 306, 4251, 1, ' - Phường Liễu Giai - Quận Ba Đình - Hà Nội', '[\"5\"]', '/uploads/images/project/b4bf98f5-f751-40b1-8b4d-114f2b937f7f.jpg', '\"\"', 86, 5, 0, 0, 5, 1, 0, '', '', '', '', 'Địa chỉ: Vinhomes 56 Nguyễn Chí Thanh\r\nSố điện thoại: 0977184688 \r\nNgười đăng: Oanh', '<div id=\"ContentPlaceHolder2_divContent\">\r\n<p><b>Chính chủ cần tiền bán gấp Vin Home 56 Nguyễn Chí Thanh</b></p>\r\n\r\n<p>Tầng 20: S = 86,6m, 2 ngủ, 2 phụ, ban công tây nam, cửa đông bắc, các phòng đều có ánh sáng tự nhiên, đã đóng 70%, tháng 3 bàn giao nhà.</p>\r\n\r\n<p><b>Giá gốc + 200 triệu, giá chênh rẻ nhất thị trường</b></p>\r\n\r\n<p><b>Liên hệ để biết thêm thông tin căn hộ: 0977184688 gặp Oanh</b></p>\r\n<br />\r\n<br />\r\n<strong>0977184688 gặp Oanh</strong></div>', '', 0, 3, 1, -1, -1, 1, 0, 0, '', '', '', 4, 3, '2017-09-20 17:00:00', '2017-09-06 10:22:26', '2017-09-07 14:03:19'),
(5, '3.5 tỷ=39m2x3t ôtô đỗ cửa, ba đình (sđcc) bán gấp', '3-5-ty-39m2x3t-oto-do-cua-ba-dinh-sdcc-ban-gap', '3-5-ty-39m2x3t-oto-do-cua-ba-dinh-sdcc-ban-gap', 4, '#3_10005', 'vietnamese', 0, 24, 306, 4251, 1, 'Phường Liễu Giai - Quận Ba Đình - Hà Nội', '[\"4\"]', '/uploads/images/project/b4bf98f5-f751-40b1-8b4d-114f2b937f7f.jpg', '\"\"', 39, 0, 0, 0, 3.5, 2, 0, '', '', '', '', 'A Thanh 0984220559\r\nBa Đình Hà Nội', '<p>Tôi cần bán gấp:<br />\r\n_Nhà khung chắc chắn 3 Tầng.<br />\r\n_Có sân rộng 12m trước nhà.<br />\r\n_Ngõ rộng 3.5m Oto vào tận cổng.<br />\r\n_Cách mặt phố 30m.<br />\r\n_Vị trí trung tâm, dân trí cao, đi lại thuận tiện (gần công viên, bệnh viện, khu mua sắm...)<br />\r\n<br />\r\n<strong>A Thanh 0984220559</strong></p>', '', 0, 127, 1, -1, -1, 1, 0, 0, '', '', '', 2, 3, '2017-09-29 18:00:00', '2017-09-07 11:45:35', '0000-00-00 00:00:00'),
(6, 'Nhà cực nét hoàn cầu, đống đa, dt50m2x5t, 8 tỷ', 'nha-cuc-net-hoan-cau-dong-da-dt50m2x5t-8-ty', '', 4, '#3_10006', 'vietnamese', 0, 24, 306, 4250, 2, ' - Phường Kim Mã - Quận Ba Đình - Hà Nội', '[\"4\"]', '/uploads/images/project/b4bf98f5-f751-40b1-8b4d-114f2b937f7f.jpg', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', 50, 0, 0, 0, 5.8, 2, 0, '', '', '', '', 'Người đăng: Gia An\r\nSố điện thoại: 0915977007', '<p>Chính chủ bán nhà Ngõ phố Láng Hạ, Thành Công, Hoàn Cầu, La Thành, Thái Hà, Đống Đa, Diện Tích 50m2 xây mới 5 tầng thiết kế cực đẹp, đường ngõ to đều oto vào nhà, cách đường Láng Hạ 100m, nội thất sang trọng tinh tế gồm.</p>\r\n\r\n<p>Tầng 1 gara + bếp rộng thoáng+vệ sinh phụ</p>\r\n\r\n<p>Tầng 2 Phòng Khách rộng +phòng ngủ và vệ sinh</p>\r\n\r\n<p>Tầng 3,4 mỗi tầng 2 phòng ngủ rộng cực thoáng+ vệ sinh</p>\r\n\r\n<p>Tầng 5 phòng thờ + sân phơi rộng khu để máy giặt</p>\r\n\r\n<p>Tất cả các phòng đều có cửa thông thoáng</p>\r\n\r\n<p>Thiết kế hoàn hảo từng chi tiết cửa, cầu thang tất cả đều được sử dụng gỗ Lim nguyên khối, sán nhà gỗ Malaysia nhập khẩu, hệ thống điện nước thiết kế theo tiêu chuẩn an toàn và rất tiện nghi, sử dụng toàn bộ là hệ thống đèn Led, các thiết bị nước Inax cao cấp.</p>\r\n\r\n<p>Vị trí trung tâm đi lại thuận tiện, gần nhiều trung tâm mua sắm sầm uất, vui chơi giải trí như Rạp Chiếu Phim Quốc Gia…, gần nhiều trường Tiểu Hoc và Trung Học trên trục đường Láng Hạ, khu phố an ninh thoáng mát bán kính 200m có rất nhiều Hồ Công Viên bao quanh như Hồ Đống Đa, Công Viên Indira Gandhi, Hồ Giảng Võ, không gian cực kỳ lý tưởng và trong lành… vị trí hoàn hảo cho cược sống.</p>\r\n\r\n<p>Giá ; 8 tỷ (có thương lượng)</p>\r\n\r\n<p>Lh ; Chính chủ; 0915977007 , 0981681283 Anh An ( miễn trung gian, môi giới )</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n<strong>Gia An , 0915977007</strong></p>', '', 0, 0, 1, -1, -1, -1, 0, 0, '', '', '', 1, 3, '1970-01-01 07:00:00', '2017-09-06 08:42:54', '0000-00-00 00:00:00'),
(8, 'Bán 50m2 đất thôn Nghĩa Lại, xã Uy Nỗ, huyện Đông Anh. Đường 3m, ngay công viên Kim Quy', 'ban-50m2-dat-thon-nghia-lai-xa-uy-no-huyen-dong-anh-duong-3m-ngay-cong-vien-kim-quy', '', 4, '#3_10009', 'vietnamese', 0, 24, 291, 3923, 0, 'Xã Uy Nỗ - Huyện Đông Anh - Hà Nội', '[\"4\"]', '/uploads/images/projects/001.jpg', '[{\"images\":\"\\/uploads\\/images\\/projects\\/001.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/003.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/004_2.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/001.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/003.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/004_2.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/005_03.jpg\",\"title\":\"\",\"description\":\"\"}]', 50.5, 6, 0, 0, 7.5, 0, 0, '', '', '', '', 'Địa chỉ : Room 2908 Tòa 103 Usilk City, Văn Khê, Hà Đông, Hà Nội. \r\nHỗ trợ đăng quảng cáo: 0982.180.807 \r\nHỗ trợ nhà đất: 0987.281.636 \r\nPhone: (04)22400123 - Fax: 04.62661512.\r\na', '<p>* Bán nhà phân lô phố Trung Kính Trung Yên! 0906.288.551</p>\r\n\r\n<p>- Nhà phân lô khu đô thị Trung Yên gần đường đôi Trung Kính diện tích 60m2 nhà xây 5 tầng đẹp, mặt tiền 5,5m nhà thiết kế đẹp, nội thất xịn, đường rộng có gara oto gần trục đường đôi Trung Kính, khu dân trí cao để ở hoặc làm văn phòng công ty rất tốt. giá bán 10,5ty. liên hệ 0906.288.551 để xem nhà<br />\r\n<br />\r\n* Bán nhà phân lô, biệt thự phố Trung Kính, trung yên! 0906.288.551.</p>', '', 0, 80, 1, 0, 0, 0, 0, 0, '', '', '', 1, 3, '2017-09-11 10:00:00', '2017-09-11 09:36:05', '2017-09-11 09:30:28'),
(9, 'Bán căn hộ chung cư 25m2 tại tập thể Phương Mai, Giải Phóng, Đống Đa, Hà Nội', 'ban-can-ho-chung-cu-25m2-tai-tap-the-phuong-mai-giai-phong-dong-da-ha-noi', '', 6, '#3_10009', 'vietnamese', 0, 24, 308, 4278, 0, 'Phường Phương Mai - Quận Đống Đa - Hà Nội', '[\"6\"]', '/uploads/images/projects/001.jpg', '[{\"images\":\"\\/uploads\\/images\\/projects\\/001.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/003.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/004_2.jpg\",\"title\":\"\",\"description\":\"\"},{\"images\":\"\\/uploads\\/images\\/projects\\/005_03.jpg\",\"title\":\"\",\"description\":\"\"}]', 25, 8, 0, 0, 750, 1, 1, '', '', '', '', 'Văn phòng tại Hà Nội : Room 2908 Tòa 103 Usilk City, Văn Khê, Hà Đông, Hà Nội. Hỗ trợ đăng quảng cáo: 0982.180.807 Hỗ trợ nhà đất: 0987.281.636 Phone: (04)22400123 - Fax: 04.62661512.', '<p><span>Văn phòng tại Hà Nội : Room 2908 Tòa 103 Usilk City, Văn Khê, Hà Đông, Hà Nội. </span></p>\r\n\r\n<p><span>Hỗ trợ đăng quảng cáo: 0982.180.807 </span></p>\r\n\r\n<p><span>Hỗ trợ nhà đất: 0987.281.636</span></p>\r\n\r\n<p><span>Phone: (04)22400123 - Fax: 04.62661512.</span></p>\r\n\r\n<p>Bán căn hộ chung cư 25m2 tại tập thể Phương Mai, Giải Phóng, Đống Đa, Hà Nội. Gần bệnh viện Tai-Mũi-Họng và bệnh viện Bạch Mai.</p>', '', 0, 3, 1, 0, 0, 1, 0, 0, '', '', '', 1, 3, '2017-09-24 15:00:00', '2017-09-18 15:06:12', '2017-09-18 14:59:16');
